(44, 'views', 'Additional_Sessions-block_1', 'cufpZen', 1, -17, 'left', 0, 0, 2, '<?php\r\n$match =false;\r\n$matchType = ''session'';\r\n$url = (!empty($_SERVER[''HTTPS''])) ? "https://".$_SERVER[''SERVER_NAME''].$_SERVER[''REQUEST_URI''] : "http://".$_SERVER[''SERVER_NAME''].$_SERVER[''REQUEST_URI''];\r\n\r\nif (arg(0)==''node'' ){	\r\n	//Grab the NID From the URL\r\n	$nid = arg(1);\r\n	//Check the DB to get its type.\r\n	$sql = "SELECT type FROM {node} WHERE nid = ''$nid''";\r\n	$result = db_query(db_rewrite_sql($sql));\r\n	$type = db_fetch_object($result);\r\n	$type = $type->type;\r\n	//If it the right type we call it a match\r\n	if ($type==$matchType ){\r\n		$pos = strrpos($url, ''edit'');\r\n		if ($pos === false) { // note: three equal signs\r\n			// not found...\r\n			$match =true;\r\n		} \r\n	}\r\n}\r\n\r\nreturn $match;\r\n?>', '', -1),
