(269, 269, 1285938000, 1285950600, '## Audience\r\nParticipants should bring a working knowledge of basic statistics and\r\nexperience with at least one of:\r\n- Java\r\n- some dialect of Lisp,\r\n- functional programming\r\n## Software prerequisites\r\nJDK (version 1.6) should installed and accessible.  (Clojure itself\r\nwill be provided via USB sticks.)\r\n## Aaron Bedra\r\nis a principal at Relevance,\r\nInc. (http://thinkrelevance.com) where he works as a technical lead,\r\nspeaker, and author. Aaron''s current focus is Enterprise Systems\r\nIntegration using Clojure and JRuby. He is the maintainer of the Ruby\r\ncode coverage analysis tool, RCov, and is a contributor to many open\r\nsource projects including Clojure Contrib, Compojure, and Ruby on\r\nRails. Aaron is the author of the Rails Security Audit Peepcode.\r\n', 1),
(271, 271, 1285938000, 1285950600, '## Audience\r\nParticipants should bring basic Erlang knowledge.\r\n## Software prerequisites\r\nThe prerequisites for this class are to have Erlang the Sinan build\r\nsystem installed on your machine. If this is not possible for your OS\r\nthen at least Erlang itself should be installed.\r\n\r\nErlang is available here:\r\n\r\n[`http://www.erlang.org/download.html`](http://www.erlang.org/download.html)\r\n\r\nSinan is available here:\r\n\r\n[`http://code.google.com/p/sinan/`](http://code.google.com/p/sinan/)\r\n## Martin Logan\r\nhas been heavily involved with the Erlang community since 1999.\r\nMartin''s great interest in distributed systems\r\nand service based design has led him to be a constant presence in the\r\ncommunity having spoken many times all over the world on the topic in\r\nplaces such as Canada, USA, Sweden, and the UK as well as author the\r\ndefinitive book on the Erlang/OTP system with Manning publishing\r\nentitled "Erlang and OTP in action". Martin has implemented many\r\ncomplex systems that used Erlang in the telecom space including one of\r\nthe first call detail record collection systems for the SIP protocol.\r\nMost recently Martin has focused on large scale e-commerce backing\r\nsystems. Currently Martin brings his expertise to Orbitz Worldwide,\r\none of the largest online travel companies in the world. Martin has\r\ntaken a leadership role with [Erlware](http://erlware.org/) where he is a core\r\ndeveloper and the primary developer of the Faxien package management\r\nsystem.\r\n', 1),
(272, 272, 1285938000, 1285950600, '## Audience\r\nExperienced programmers familiar with functional\r\nprogramming. Familiarity with Haskell will be useful, but not\r\nrequired.\r\n## Software prerequisites\r\nHaskell Platform 2010.1.0.0 (or later) and the Criterion benchmarking\r\nlibrary. The latter can be installed by running \r\n\r\n`cabal install -f-Chart criterion`\r\n\r\nafter installing the Haskell Platform.\r\n\r\nThe Haskell Platform can be downloaded for Mac, Windows, and Linux from:\r\n\r\n[`http://hackage.haskell.org/platform/`](http://hackage.haskell.org/platform/)\r\n## Johan Tibell\r\nis a Software Engineer at Google Inc. His main\r\ninterests are in distributed systems and functional programming. He\r\nreceived a M.S. in Software Engineering from the Chalmers University\r\nof Technology, Sweden, in 2007.', 1),
(273, 273, 1285956000, 1285970400, '## Audience\r\nGeneral.  All programmers are welcome.  Come with curiosity and an\r\nopen mind.  Those at any level of functional programming or F# experience\r\nwill enjoy this session.\r\n## Software prerequisites:\r\n(Windows) Visual Studio 2010, Visual Studio 2008 w/ F# plugin\r\n(Linux/Mac) Mono w/ F# Zip Package Installed\r\n\r\n### Visual Studio 2010\r\nAny non-express Visual Studio 2010 installation comes with F#, just as long\r\nas it wasn''t deselected during installation.\r\n\r\n### Microsoft Windows without Visual Studio 2010\r\nOn Windows, you need to download and install [Visual Studio 2010 Shell\r\n(integrated mode)](http://www.microsoft.com/downloads/en/details.aspx?FamilyID=8e5aa7b6-8436-43f0-b778-00c3bca733d3&displaylang=en).\r\nAfter installing Visual Studio 2010 Shell the next step is to download and\r\ninstall the F# Standalone package.  To do this just go to the [F# MSDN\r\nportal](http://msdn.microsoft.com/en-us/fsharp/default.aspx) and click\r\n"Get the F# Standalone and VS2008 CTP". After that, scroll to the bottom of the page, click the download button for "InstallFSharp.msi" and run it.\r\n\r\n### Macintosh / Linux\r\n\r\nIf you don''t already have a recent version of Mono installed, you''ll need to\r\nget it.  This process varies from platform to platform, please see\r\n[this page](http://www.mono-project.com/Getting_Mono) for more information.\r\n\r\nNext, you''ll need to install F#.  This requires downloading two things: the\r\nF# standalone package and the Mono key file.\r\n\r\n* Download the F# standalone package, `fsharp.zip`, from\r\n[here](http://www.microsoft.com/downloads/en/details.aspx?FamilyID=f8c623ae-aef6-4a06-a185-05f59be47d67&displaylang=en).\r\n\r\n* Download the Mono Key from [here](http://github.com/mono/mono/raw/master/mcs/class/mono.snk).\r\n\r\n* Unarchive `fsharp.zip`, copy `mono.snk` to the location F# was unarchived\r\nto, and run `install-mono.sh`.  This script will install F# assemblies into\r\nthe Mono GAC and ensure correct permissions.\r\n\r\n* To use F#, from the unarchived FSharp directory, run `mono bin/fsi.exe` for the interactive window (REPL) and `mono bin/fsc.exe` to\r\ncompile from source.\r\n\r\n## Richard Minerich\r\nis a Microsoft MVP for the F# programming language.\r\nThrough writing, speaking and running events, Richard hopes to help bridge\r\nthe gap between the cutting edge in computation and the mainstream software\r\nengineer.  Currently, Richard works as a Software Architect specializing in\r\ndigital image processing at Atalasoft, Inc.  He also leads the New England\r\nF# User Group and is anxiously awaiting the release of his first book,\r\nProfessional F# 2.0.', 1),
(274, 274, 1285956000, 1285970400, '## Audience\r\nParticipants should bring basic knowledge of functional programming.\r\n## Software prerequisites\r\n\r\nYou should have [Java 1.6](http://java.sun.com) and Simple [Build Tool 0.7+](http://code.google.com/p/simple-build-tool/) installed on your machine as\r\nwell as the ability to open a TAR or ZIP file and a text editor.\r\n\r\nYou should also download one of the following:\r\n\r\n[`http://tunaforcats.com/chat.tgz`](http://tunaforcats.com/chat.tgz)\r\n\r\n[`http://tunaforcats.com/chat.zip`](http://tunaforcats.com/chat.zip)\r\n\r\nThese are both self-contained starting points for the tutorial.\r\n\r\nTo test that you have everything you need, you should run\r\n\r\n`sbt jetty-run`\r\n\r\nin the the `chat` directory that the above archives unpack into.\r\n## David Pollak\r\nhas been writing commercial software since 1977. He wrote the\r\nfirst real-time spreadsheet and the worlds highest performance spreadsheet\r\nengine. Since 1996, David has been using and devising web development tools.\r\nAs CTO of CMP Media, David oversaw the first large-scale deployment of\r\nWebLogic. David was CTO and VPE at Cenzic, a web application security\r\ncompany. David has also developed numerous commercial projects in Ruby on\r\nRails.\r\n\r\nIn 2007, David founded the Lift Web Framework open source project. Lift is\r\nan expressive and elegant framework for writing web applications. Lift\r\nstresses the importance of security, maintainability, scalability and\r\nperformance, while allowing for high levels of developer productivity. Lift\r\nopen source software licensed under an Apache 2.0 license.\r\nDavid is a consultant in San Francisco and works on Lift-based projects.\r\n', 1),
(275, 275, 1285956000, 1285970400, '## Audience\r\nParticipants should be familiar with either OCaml or Haskell, but we\r\nwill assume no prior knowledge of Template Haskell or Camlp4. It would\r\nbe helpful to know the basics of parsing (lexing vs. parsing, abstract\r\nsyntax trees, recursive descent) and be familiar with at least one\r\nparser generator.\r\n## Software prerequisites\r\nParticipants should have recent versions of Objective Caml and the\r\nHaskell Platform installed.  Objective Caml is available here:\r\n\r\n[`http://caml.inria.fr/download.en.html`](http://caml.inria.fr/download.en.html)\r\n\r\nThe Haskell platform is available here:\r\n\r\n[`http://hackage.haskell.org/platform/`](http://hackage.haskell.org/platform/)\r\n\r\nFor OCaml, participants need to\r\ninstall Findlib:\r\n\r\n[`http://projects.camlcity.org/projects/findlib.html`](http://projects.camlcity.org/projects/findlib.html)\r\n\r\nand for both OCaml and Haskell the tutorial materials are at:\r\n\r\n[`http://github.com/jaked/cufp-metaprogramming-tutorial/tarball/release-0930`](http://github.com/jaked/cufp-metaprogramming-tutorial/tarball/release-0930)\r\n\r\n\r\n## [Jake Donham](http://jaked.org/)\r\nis the author of several OCaml free\r\nsoftware projects, and blogs about OCaml at Ambassador to the\r\nComputers. Jake previously spoke about the ocamljs project at CUFP\r\n2008.\r\n\r\n## Nicolas Pouillard\r\nWhen learning programming in the engineering school of EPITA in Paris,\r\nNicolas Pouillard first met meta-programming using Camlp4 for very\r\nbasic syntax extensions, C++ templates and program transformation\r\nusing Stratego/XT.  Then he entered the research team of Xavier Leroy\r\nat INRIA. He first spent six months as an intern for the renovation of\r\nCamlp4 under the direction of Michel Mauny.  He continued with him by\r\naccepting an engineer job on a project joint with Intel.  During this\r\ncontract he worked on a new front-end (written in OCaml) for their\r\nin-house functional language featuring overloading and\r\nmeta-programming facilities.  During these months he also learned\r\nHaskell and in particular meta-programming through Template Haskell.\r\nFinally he continued as a PhD on "Safer and more expressive languages\r\nfor meta-programming" directed by Francois Pottier.  In this work we\r\naim at leveraging safety features like strong typing and lexical\r\nscoping to manipulated programs within a meta-programming language.', 1),
(3211, 3211, 1316696400, 1316709000, '## Audience\r\n\r\nAttendees who will benefit from this tutorial includes those want to\r\nlearn more about Erlang and its concurrency model. Attending will put\r\nyou on the right track in building distributed, fault tolerant\r\nmassively concurrent soft real-time systems.\r\n\r\nIn order to get the most out of this tutorial, you must have a good\r\ngrasp of other programming languages. Having dabbled with\r\n[<code>http://tryerlang.org</code>](http://tryerlang.org) is not necessary, but will help.\r\n\r\n## Preparation\r\n\r\nWe will have a lot of material to cover in a\r\nshort time, so the more prepared you are, the better. To be able to\r\nattend the tutorial, you must have Erlang working alongside your\r\nfavorite editor. You can download binary snapshots of the distro\r\n[here](http://www.erlang-solutions.com/section/98/downloads).\r\n\r\nIf you prefer to compile from source, you can download it\r\n[here](http://www.erlang.org/download.html).\r\n\r\nIt would be beneficial if you can get the Erlang mode running on your\r\nfavorite editor. The most commonly used editors include emacs and vim,\r\nbut you will find an Erlang support in most environments.\r\n\r\nIf you have time to dabble with Erlang, a great site with simple\r\ntutorials is [tryerlang](http://www.tryerlang.org).\r\n\r\nIf you do not have one of the Erlang books, online resources where you\r\ncan read more about Erlang include\r\n\r\n* [Learn You Some Erlang for Great Good!](http://learnyousomeerlang.com/)\r\n* The [User''s Guide](http://www.erlang.org/doc/getting_started/users_guide.html)\r\n\r\nIf you have any questions, do not hesitate to \r\n[email me](mailto:francesco@erlang-solutions.com).\r\n\r\n## Francesco Cesarini\r\n\r\nis Technical Director of Erlang Solutions Ltd, a company specialised\r\nin high availability, massively concurrent soft real time systems. He\r\nhas been programming Erlang since 1995 and was on the team who worked\r\non the OTP R1 release. Francesco has worked with start-ups and blue\r\nchip companies alike helping them with all the aspects of Erlang based\r\nprojects - from coding, reviews and architecture designs to setting up\r\ndevelopment centers. He has taught Erlang to hundreds of developers,\r\ntesters, support staff and university students.He documented these\r\nexperiences in Erlang Programming, a book published by O''Reilly Media\r\nin 2009. Francesco is also a frequent speaker at conferences worldwide\r\nand teaches graduates and undergraduates at the IT University of\r\nGothenburg in Sweden and Oxford University in the UK.\r\n', 1),
(3212, 3212, 1316696400, 1316709000, '## Audience\r\n\r\nThe class will not teach OCaml proper, so attendees should already\r\nknow the basic constructs of the language, and be comfortable writing\r\nshort programs in it.  Beyond a facility with the concepts of\r\nfunctional programming, no further experience is required.\r\n\r\n## Preparation\r\n\r\n*Note: This is the same VM as for the [T3: Building a Functional OS](http://cufp.org/conference/sessions/2011/t3-building-functional-os).*\r\n\r\nYou''ll need:\r\n\r\n* an SSH client on your machine\r\n* [Virtualbox](http://www.virtualbox.org/wiki/Downloads)\r\n* the [machine image](http://minsky-primus.net/CUFP-Core-and-Mirage-Tutorials.ova)\r\n\r\nClick `Import Appliance` from the File menu, and select the `.ova` file.\r\nAfter it imports the file, click on `CUFP Core and Mirage Tutorials`,\r\nand click the green `Start` arrow.\r\n\r\nThe user account is `cufp`, and the password is `cufp2011`.  Log in,\r\nand type `/sbin/ifconfig` to figure out what the internet address of\r\nthe virtual image is.  It should be the one associated with `eth1`.\r\nThen ssh to the box as `cufp` and log in.  All the software you should\r\nneed is installed on the virtual machine.\r\n\r\nYou can also direct a web-browser at the virtual host.  You''ll find\r\nocamldoc documentation for the Core libraries there.\r\n\r\n## Alternate preparation\r\n\r\nIf you have trouble with virtualbox, you can install OCaml and the relevant packages on their own.  Here are the packages you should get, and the order of installation:\r\n\r\n- [type-conv](http://www.janestreet.com/ocaml/type-conv-2.3.0.tar.gz)\r\n- [sexplib](http://www.janestreet.com/ocaml/sexplib-7.0.2.tar.gz)\r\n- [bin-prot](http://www.janestreet.com/ocaml/bin-prot-2.0.3.tar.gz)\r\n- [fieldslib](http://www.janestreet.com/ocaml/fieldslib-107.01.tar.gz)\r\n- [variantslib](http://www.janestreet.com/ocaml/variantslib-107.01.tar.gz)\r\n- [core](http://www.janestreet.com/ocaml/core-107.01.tar.gz)\r\n- [core-extended](http://www.janestreet.com/ocaml/core_extended-107.01.tar.gz)\r\n\r\nAll of Jane Street''s packages can be found [here](http://ocaml.janestreet.com/?q=node/13).\r\n\r\n## Yaron Minsky\r\n\r\nis the head of the technology group at Jane Street, a proprietary\r\ntrading firm that uses OCaml as its primary development language.\r\nYaron got his PhD in Computer Science at Cornell in 2002, where his\r\nresearch was focused on probabilistic algorithms for distributed\r\nsystems.\r\n\r\n', 1),
(3213, 3213, 1316714400, 1316727000, '## Audience\r\n\r\nThe tutorial will start gently, but participants should have some\r\nproficiency in OCaml.\r\n\r\n## Preparation\r\n\r\n*Note: This is the same VM as for the [T2: JaneStreet''s OCaml Core Library](http://cufp.org/conference/sessions/2011/t2-janestreets-ocaml-core-library).*\r\n\r\nYou''ll need:\r\n\r\n* an SSH client on your machine\r\n* [Virtualbox](http://www.virtualbox.org/wiki/Downloads)\r\n* the [machine image](http://minsky-primus.net/CUFP-Core-and-Mirage-Tutorials.ova)\r\n\r\nClick `Import Appliance` from the File menu, and select the `.ova` file.\r\nAfter it imports the file, click on `CUFP Core and Mirage Tutorials`,\r\nand click the green `Start` arrow.\r\n\r\nThe user account is `cufp`, and the password is `cufp2011`.  Log in,\r\nand type `/sbin/ifconfig` to figure out what the internet address of\r\nthe virtual image is.  It should be the one associated with `eth1`.\r\nThen ssh to the box as `cufp` and log in.  All the software you should\r\nneed is installed on the virtual machine.\r\n\r\nYou can also direct a web-browser at the virtual host.  You''ll find\r\nocamldoc documentation for the Core libraries there.\r\n\r\n## Alternative Preparation\r\n\r\nIf you prefer not to use VirtualBox, you can run most of the Mirage tutorial if you have the following software:\r\n\r\n* MacOS X (10.6+) or Linux. 64-bit is preferred, but 32-bit should work\r\n* Tuntap networking (usually default on Linux, and downloadable for MacOS X from [here](http://tuntaposx.sourceforge.net/)\r\n* OCaml-3.12.0 with the native code version of the compilers (e.g. ocamlopt.opt) installed; available [here](http://caml.inria.fr/pub/distrib/ocaml-3.12/). Note that you need precisely this version of OCaml.\r\n* [Git](http://git-scm.com/)\r\n\r\nYou can test that your setup works by cloning [http://github.com/avsm/mirage](http://github.com/avsm/mirage) and typing in ''make''.  A final version of the source tree will be tagged the day before the tutorial, but the expectation is that you just pull the latest version before beginning.\r\n\r\n\r\n## Anil Madhavapeddy \r\n\r\nis a Senior Research Fellow at Wolfson College Cambridge based in the\r\nSystems Research Group. Dr. Madhavapeddy was on the original team at\r\nCambridge that developed the Xen hypervisor, and subsequently served\r\nas the senior architect and product director for XenSource/Citrix\r\nbefore returning to academia. Prior to obtaining his PhD in 2006 from\r\nthe University of Cambridge, he had a diverse background in industry\r\nat Network Appliance, NASA, and Internet Vision. In addition to\r\nprofessional and academic activities, he is an active member of the\r\nopen source development community with the OpenBSD operating system, a\r\nmember of the steering committee for Commercial Uses of Functional\r\nProgramming, and on the boards of startup companies such as Ashima\r\nArts.\r\n\r\n## Richard Mortier\r\n\r\nis a Horizon Transitional Fellow in Computer Science at the\r\nUniversity of Nottingham.  His research currently centres on\r\nnetworked technologies within the Digital Economy.  In addition to\r\nthe topic of this talk this currently also includes exokernels for\r\nsecure high-performance multiscale computing; and infrastructure to\r\nbuild an ecosystem around privacy preserving third-party access to\r\npersonal data. His background is in systems and networking, covering\r\noperating systems, distributed systems, and local and wide-area\r\nnetworking.  Prior to joining Nottingham he spent two years as\r\nfounder at Vipadia Limited designing and building the Clackpoint and\r\nKaraka real-time communications products, six years as a researcher\r\nwith Microsoft Research Cambridge, and seven months as a visitor at\r\nSprint ATL, CA. He received a Ph.D. from the Systems Research Group\r\nat the University of Cambridge Computer Laboratory, and a B.A. in\r\nMathematics, also from the University of Cambridge.\r\n\r\n## Dave Scott\r\n\r\nis the XenServer System Architect at Citrix, making virtualisation\r\nproducts based on the open source Xen hypervisor. Previously he was a\r\nconsultant research scientist at Fraser Research, where he worked on\r\ntheir next-generation networking initiatives. In 2004 he finished a\r\nPhD in the University of Cambridge Computer Laboratory, affiliated\r\nwith the Cambridge Programming Research Group . He was also a\r\nco-founder of High Energy Magic, which produced mobile phone software\r\nto recognise printed visual symbols, known as SpotCodes.\r\n', 1),
(3214, 3214, 1316714400, 1316727000, '## Audience\r\n\r\nAudience should be comfortable writing basic programs in OCaml. Working\r\nthrough any one of the introductory texts on OCaml is sufficient.\r\nFamiliarity with the specific libraries being used in the tutorial is not\r\nnecessary. Their use will be covered in the tutorial.\r\n\r\n## Preparation\r\n\r\nOn September 15th, please download the\r\n[virtual machine](http://cims.nyu.edu/~agarwal/download/CUFP2011-T4.ova)\r\nneeded for this\r\ntutorial onto your laptop. Note the URL will not be active before then.\r\nInstall\r\n[VirtualBox](http://www.virtualbox.org)\r\nif you do not already have it. Open VirtualBox''s\r\npreferences and select the `Network` tab. In the `Host-Only Networks` box, you\r\nshould see one entry, `vobxnet0`. If not, click the `+` button to add it. Then,\r\nimport the VM into VirtualBox using the `File` -> `Import Appliance` command.\r\nDuring import, you will have the option of changing the VM''s settings. Do\r\nnot change them unnecessarily, especially the Network settings. It should be\r\nokay to change the name and path to the Virtual Disk Image if needed.\r\n\r\nOnce the import is complete, boot up the VM and make sure it runs correctly.\r\nThe user account name is `camel` and the password is `OCaml` with a capital\r\n`O` and capital `C`. In particular, make sure you can do the following:\r\n\r\n* Run `ifconfig` in the VM, and note the IP address on `eth1`. From a terminal window on the host, ssh to the VM using this IP address. It should let you connect.\r\n\r\n* From within the VM, ping to an external site such as `google.com`. It should work.\r\n\r\n## Ashish Agarwal\r\nis a researcher at the Center for Genomics and Systems\r\nBiology and the Courant Institute at NYU. He is designing a domain specific\r\nlanguage, implemented in OCaml, for managing and processing large quantities\r\nof bioinformatics data in a high performance computing environment. His\r\nbackground is a mix of the natural sciences, with studies in Chemistry and\r\nBiology, and computer science, a PhD from CMU in the area of programming\r\nlanguages.\r\n', 1),
(3215, 3215, 1316782800, 1316795400, '## Audience\r\n\r\nGenerally we will assume that you are reasonably proficient in\r\nHaskell.  However, while non-Haskellers may not get all the details,\r\nyou should still have a good time.  The "whirlwind tour" part in\r\nparticular requires minimal Haskell expertise.\r\n	\r\n## Preparation\r\n\r\n### Debian or Ubuntu Linux\r\n\r\nFrom the command line:\r\n\r\n<code>apt-get install Haskell-platform\r\napt-get install threadscope\r\ncabal install monad-par</code>\r\n\r\nThis gets you GHC 6.12.3 at the moment, which is enough to run the examples and do the exercises in the tutorial.\r\n\r\nAlternatively, you can get a more up to date Haskell Platform \r\n[here](http://hackage.haskell.org/platform/)\r\nand installing it yourself.\r\n\r\nYou may also want to get the newer version of ThreadScope (0.2).  For instructions go to \r\n[this page](http://haskell.org/haskellwiki/ThreadScope).\r\n\r\n### Windows\r\n\r\nInstall the [Haskell Platform](http://hackage.haskell.org/platform/).\r\n\r\nInstall the `monad-par` package (using the command line):\r\n\r\n<code>cabal install monad-par</code>\r\n\r\nAlso, an installation of [ThreadScope](http://haskell.org/haskellwiki/ThreadScope) is optional but recommended.\r\n \r\n### Mac\r\n\r\nInstall the [Haskell Platform](http://hackage.haskell.org/platform/).\r\n\r\nInstall the `monad-par` package (using the command line):\r\n\r\n<code>cabal install monad-par</code>\r\n\r\nThreadScope is optional but recommended, although it depends on the GTK library which is reportedly hard to install on Mac OS X.  Apparently installing it via HomeBrew is the method most likely to work.  Some tips on installing ThreadScope are on the [ThreadScope page](http://haskell.org/haskellwiki/ThreadScope).\r\n\r\n\r\n## Simon Peyton Jones\r\n\r\nis a Principal Researcher at Microsoft''s research lab in Cambridge\r\nEngland. He became addicted to functional programming in 1979, and has\r\nbeen working on the design and implementation of functional languages\r\never since.  He is one of the original designers of Haskell and with\r\nSimon Marlow is responsible for the Glasgow Haskell Compiler (GHC).\r\n\r\n## Simon Marlow\r\n\r\nis a Senior Research Software Engineer at Microsoft''s Cambridge\r\nresearch lab.  He has been working on Haskell-related research\r\nprojects since the 90''s, and together with Simon Peyton Jones is\r\nresponsible for the Glasgow Haskell Compiler (GHC).  Simon in\r\nparticular developed GHC''s multicore runtime system, and over the past\r\nfew years has been working to improve GHC''s support for parallel and\r\nconcurrent programming, both at the runtime and the language level.\r\n\r\n## Manuel Chakravarty\r\n\r\nis an Associate Professor at the University of New South Wales,\r\nSydney.  His main research interests are in functional and parallel\r\nprogramming.  He contributed to Haskell''s foreign function interface,\r\nthe theory and implementation of type families, and the design and\r\nrealisation of Data Parallel Haskell, an implementation of nested data\r\nparallelism in the Glasgow Haskell Compiler.\r\n\r\n', 1),
(3216, 3216, 1316782800, 1316795400, '## Audience\r\n\r\nWe assume attendees have working knowledge of basic functional\r\nprogramming constructs such as pattern matching, higher order\r\nfunctions and recursion.  Basic knowledge of object oriented\r\nprogramming (classes, methods, inheritance) is also required.\r\nFamiliarity with Java concepts is a plus, but not required.\r\n\r\n## Software Prerequisites\r\n\r\n- A Twitter account\r\n- A working Java (JVM) installation\r\n- The [bootstrap tarball](http://cufp.org/sites/all/files/uploads/scalaschool.tgz), also available [online](http://twitter.github.com/scala_school/).\r\n\r\n## Steve Jenson\r\n\r\nAn engineer at Twitter since 2008 focused on building Scala\r\napplications and libraries for high-volume systems. He has been\r\nprogramming on the JVM since 1999 and in Scala since 2007. He''s a\r\ncontributor to a number of open source Scala libraries.\r\n\r\n## Marius Eriksen\r\n\r\nMarius works on systems infrastructure at Twitter. He has worked on\r\nRPC and streaming systems, profiling tools, storage & indexing systems\r\nand our front-end serving stack. He loves applying functional\r\nprogramming techniques to these domains.\r\n\r\n\r\n', 1),
(3217, 3217, 1316800800, 1316813400, '## Audience\r\n\r\nSome familiarity with Haskell is required: If you''ve read and\r\nunderstand "Learn You a Haskell" and have started in on "Real World\r\nHaskell", that''s enough.\r\n\r\n## Preparation\r\n\r\nBefore attending, participants should have a copy of the Haskell framework,\r\nas per the instructions that come with tutorial [T5: Parallel Programming in Haskell](http://cufp.org/conference/sessions/2011/t5-parallel-programming-haskell-simon-peyton-jones).\r\n\r\nYou will also need the Snap framework, which you can install via this command:\r\n\r\n<code>cabal install snap</code>\r\n\r\nMoreover, download the tutorial code which will be available by September 11\r\n[here](https://github.com/snapframework/cufp2011) - either click the\r\nbig "Download" button or follow the instructions for cloning the Git\r\nrepository.\r\n\r\n## Gregory Collins\r\n\r\nis a Canadian software engineer living in Zürich, Switzerland. He\r\nworks at Google Zürich in the Site Reliability Engineering group.\r\n\r\n', 1),
(3218, 3218, 1316800800, 1316813400, '## Audience\r\n\r\nAudience should be familiar with at least one other functional\r\nlanguage.\r\n\r\n## Preparation\r\n\r\nBy far the most convenient way to follow the tutorial on your computer\r\nis within Windows: Get a version of Visual Studio that works with F#.\r\nF# ships with Visual Studio 2010, it works with the free Visual Studio\r\n2010 Shell, and it can be installed as an add-on to Visual Studio\r\n2008.\r\n\r\nDetails are on [Microsoft''s F#\r\npage](http://research.microsoft.com/en-us/um/cambridge/projects/fsharp/release.aspx).\r\n\r\nIf you must run F# outside Windows, you should get a recent version of\r\nthe *Mono* .NET-compatible run time from the [Mono download\r\npage](http://www.go-mono.com/mono-downloads/download.html).  For Mac OS X, the latest version 2.10 is broken - get the [slightly older version 2.8](http://download.mono-project.com/archive/2.8/download/).  If you''re installing a Linux package of Mono or installing\r\nfrom source, F# is probably not included: Check if there''s a binary\r\n`fsc` in the path after installation of Mono.\r\n\r\nIf you have Mono but *not* F# yet, get the F# distribution as a\r\n`.zip` file from [Microsoft''s F#\r\npage](http://research.microsoft.com/en-us/um/cambridge/projects/fsharp/release.aspx).\r\nUnzip it somewhere convenient, and run the\r\n`install-mono.sh` shell script in the top-level directory.\r\n(This will instruct you to download and install a key file.)\r\nYou should create front-end scripts `fsc` and\r\n`fsi` in your path, that should look approximately like this:\r\n\r\n<code>#!/bin/sh\r\nexec mono .../FSharp-2.0.0.0/bin/fsc.exe "$@"\r\n</code>\r\n\r\n(Replacing the `...` by the location where you unzipped the F# distribution.)\r\n\r\nAs to editing F# files outside of Visual Studio, it''s probably best if\r\nyou bring a plain text editor that can indent without creating tabs.\r\nIf you know your way around Elisp, you may consider downloading and installing\r\nthe [F# Emacs Mode](http://sourceforge.net/projects/fsharp-mode/).\r\n\r\nYou may be tempted to download *MonoDevelop* and install the F# plugin,\r\nbut you need versions of Mono, MonoDevelop and the F# plugin (not the\r\nlatest) that are just right.  This is probably not worth the effort.\r\n\r\nFinally, you''ll also need the *NUnit unit-testing framework*, which\r\ncan be downloaded from [NUnit''s download\r\npage](http://www.nunit.org/index.php?p=download).\r\n\r\n## Mike Sperber\r\n\r\nis a software architect with Active Group in Filderstadt, Germany.\r\nHe''s done research on functional programmince since 1995, and has used\r\nfunctional programming in a wide variety commercial projects since\r\n2003.  Mike designed the introductory programming curriculum at\r\nthe University of Tübingen (which is based on functional programming,\r\nof course), which he still occasionally teaches.  He is the author of\r\nseveral textbooks, was the project editor of the R6RS standard for the\r\nprogramming language Scheme, and is a member of the CUFP Steering\r\ncommittee.\r\n', 1),
