(3241, 3241, 1316874600, 1316876400, 'We began with a specification for AES written in Cryptol, a high-level functional language designed specifically for describing the domain of bit-level computations as arise in Cryptography. Over a series of five design stages we were able to produce an industrial grade encrypt core. In each stage, we stated theorems which related the component behaviors in one stage with the corresponding behaviors in the refinement. The resulting cores, running at 350Mhz-440Mhz depending on the FPGA part, bore little relationship to the original, except that the step-by-step theorems ensured we had not gone astray.\r\n\r\nThe next significant challenge we faced was in performing decrypt. While there are many similarities between encrypt and decrypt in AES, there are some crucial differences with regard to high performance. First concerns the generation of key material. The AES key is used as a seed for a specific pseudo-random number generator which produces key material for use in each of the AES rounds. For encrypt, the key-generator runs in sync with the action of encryption, so may be scheduled alongside it. For decrypt, they run counter to one-another, facing a major challenge to be overcome. Second, the generated key material needs to have an additional transformation applied to it, which occurs deep in the middle of the high performing core.\r\n\r\nUsing theorems as stepping stones along the way, we redesigned the key expansion algorithm so that it would run in sync with the decryption, and we traced parallel steps to the derivation of encrypt, establishing a commuting ladder diagram along the way. At each barriers in development, we produced many theorems to isolate the bug, using theorems as a principled kind of printf. When the bug was eradicated, we elided many of the temporary theorems, leaving behind those that provided important insights into the behavior of the code.\r\n\r\nThis talk is a story of the journey with demonstrations of the tool at work. Its ultimate message is to highlight the value of including a theorem facility within purely functional domain-specific languages.', 1),
(3242, 3242, 1316876400, 1316878200, 'Yet the simulation of such large systems (potentially dozens of millions of complex interacting devices like meters, gateways, concentrators, etc.) requires a significant amount of computing resources to be harnessed.\r\n\r\nAs a result, our project needed an effective, highly concurrent (parallel and distributed) simulation engine, which was capable of also enforcing a set of required simulation properties (uncoupling of virtual time, respect of causality, total reproducibility, some form of ergodicity, etc.).\r\n\r\nOur review of the state-of-the-art did not show us a good match for our requirements; the Sim-Diasca engine, which stands for Simulation of Discrete Systems of All Scales, was thus devel- oped to fulfill this need. Sim-Diasca is a generic discrete synchro- nous simulation engine which has been designed for maximum scalability.\r\n\r\nTo achieve this, we needed to bridge the semantic gap between the problem and its solution: in order to simulate an intrinsically concurrent system, we chose to rely on a language which was itself concurrent, Erlang. \r\n\r\nThis choice had for side-effect to bring the functional ap- proach at the core of the engine design, an approach which in turn climbed our software stack and applied to all layers, from the engine to the models and simulation cases.\r\n\r\nThis experience report describes the various design issues and challenges that had to be overcome at all levels of the technical architecture, from the business modeling to the implementation of the engine and the models. ', 1),
(3243, 3243, 1316878200, 1316880000, 'Model based testing presents the solution. Instead of manually writing test cases, one creates a test model for the software. From this test model and a given configuration, one can generate millions of tests automatically: exploring a wild variety of possible scenarios.  Volvo, Mentor Graphics, SP and Quviq joined in the development of test models for AUTOSAR 4.0 components, including all communication stacks, diagnostics and mode management. These models have been used to validate components from a number of vendors and to detect a number of AUTOSAR ambiguities.\r\n\r\nIt turns out that creating models is far more cost effective than manually creating test cases, at least a factor ten when using Quviq’s QuickCheck approach. The resulting models are more general than any test suite could be and are configuration independent, in the sense that given a certain configuration, test cases for that configuration are generated. Scenarios are randomly generated according to some tool specific logic and whenever a scenario in the software differs from what the model expects, a minimal difference is created. The minimal failing test case is a great help in analyzing why the model and the code are incompatible. ', 1),
(3244, 3244, 1316880000, 1316885400, NULL, NULL),
(3245, 3245, 1316885400, 1316887200, 'One of our project is a forex chart for smartphones which have rapid and responsive scroll-and-zoom animation based on CSS3. Such quick animation was not achieved by any of previous forex charts which works on smartphone web browsers. You will see the working example at http://www.itpl.co.jp/ conga-forex-chart/. This works on both Android and iOS browsers, and also on a few PC browsers like Safari, Firefox, and Opera (The support for Firefox and Opera is currently partial). \r\n\r\nOther one is a web client of a peculiar filesystem. In the code it utilizes a monad that pretends complex asynchronous operations of Ajax to be a sequence of simple, synchronous ones. Although there’s no working example of that, you can access to the source code freely at http: //sourceforge.jp/projects/ngms/.  OCaml is currently not regarded as a ready-to-use programming language for web development.  When someone tries to use a new technology in the first place, one must usually convince their customers it is actually useful. Regarding to the forex chart development, say, the customer already trusted us and OCaml in some degree. I.e. we have been developed similar forex charts for several platforms for several years, and some server-side programs are already developed in OCaml. Additionally, to convince the feasibility of our challenge, we have prepared the prototypical build of CSS3 animation written in JavaScript, and they are not very interested in more technical details.\r\n\r\nOur writing of the source code is rather standard (i.e. there’s no phantom types, no reactive programming, no machine-verified proof of that, and so on), except for the following aspects: * It utilizes the inline-JavaScript feature of Ocamljs.  * The usage of Ajax monad acts as if it is multi-threaded.\r\n\r\nInline JavaScript is sometimes necessary to gain performance, like in a tight loop to compute a sequence of forex analysis results. It also works like a charm when you want to use JavaScript''s APIs (like logging, regex and so on) in that place.  There''s the other compiler, Js_of_ocaml [2], which will produce faster code. We will report the experience of replacing Ocamljs with Js of ocaml.\r\n\r\n[1] Jake Donham, Ocamljs, http://jaked. github.com/ocamljs.\r\n[2] Jerome Vouillon and Vincent Balat, From bytecodeto Javascript: the js of ocaml compiler,  Available at http://www.pps. jussieu.fr/∼balat/publi.php', 1),
(3247, 3247, 1316887200, 1316889000, 'We''ll present three case studies of systems design in Scala.\r\n\r\n* A stateless service for inspecting and routing traffic. \r\n* Long-lived, stateful services for caching tweets and processing  vector and graph data.\r\n* A reliable, high throughput message queue with disk journaling.\r\n\r\nWe''ll discuss features of Scala that lend themselves to building these systems. Namely, the benefits of Scala''s rich type system, lazy evaluation, higher-order functions, immutability, and ease of integration with existing Java libraries and tools.\r\n\r\nAdditionally, we''ll cover some challenges we''ve faced in adopting Scala. ', 1),
(3248, 3248, 1316889000, 1316890800, 'These problems have given rise to many promising alternatives and technologies that aim to bridge across various mobile platforms and enable sharing some or all the code in between versions of applications for different mobile OSs. Two main directions unfolded: targeting mobile code generation from mainstream languages such as C# and Java, and embracing web applications with platform-independent UI abstractions and enhanced access to the capabilities of the underlying device. While the technologies that enabled the former are an interesting topic, we believe that the latter has implications not only for mobile applications but also for their desktop counterparts, and finding ways to utilize functional programming in the development of these web-based applications has an immense impact on mobiles and desktops alike.\r\n\r\nIn this talk I will highlight some of the work we are doing at IntelliFactory to enable building platform-independent mobile applications in F#. This work leverages our commercially available WebSharper framework, the premiere functional web development framework for F# with thousands of active users and partner companies, and utilizes some key functional programming abstractions that enable modeling first-class, type-safe, composable web applications and user interfaces. I will briefly outline the metaprogramming infrastructure that enables us to enlist arbitrary JavaScript libraries into the type-safe discipline of F#, and the underlying CoreJS language that is more amenable to reasoning about and applying code transformations and optimizations. \r\n\r\n At the end of the talk, I will briefly touch upon our upcoming F# in the Cloud support and how that helps to seamlessly scale into the cloud desktop and mobile web applications with immense server computation needs.', 1),
(3249, 3249, 1316890800, 1316892600, NULL, NULL),
(3250, 3250, 1316892600, 1316894400, 'This talk describes a project that used functional programming to build the core of a real time communication system.  It was built by the GreenTouch consortium, an organization of telecommunication equipment vendors, service providers, universities and research institutes to show a new antenna technology that could reduce the energy used by wireless networks.  The goal of the project was to demonstrate an algorithm that reduces radio transmit power as the number of base station antenna elements is increased, and is capable of scaling to antennas with thousands of elements.\r\n\r\nThe heart of the demonstration system is a narrowband software radio, written in Haskell and running in (soft) real-time. Not only did the software have to run in real time, but it had to be written very quickly.  The project, from the beginning specification to delivery of hardware, took just over three months.  I will walk through the timeline of writing the software, and tell how the data acquisition, signal processing and data display were put together within two weeks.\r\n\r\nOf particular interest is how the control structures of Haskell were used to lash the pieces together.  Lazy lists and software transactional memory turned out to be an architecturally simple way to have the component modules communicate.  Using sophisticated control structures of Haskell to abstract away the complexity of the data path was a big win, and was key to getting the job done within the allotted time.\r\n\r\nThe demonstration system was a success and was shown to the public at a press event in London in early February 2011.', 1),
(3251, 3251, 1316894400, 1316896200, 'Disco is an open-source project that was started in 2008 when attempts to use Hadoop to analyze data proved to be a painful experience. The MapReduce step formed only a portion of the analytics stack, and it was felt that it would be faster to write a custom implementation that would integrate well, than adapt Hadoop with the amount of internal Hadoop expertise available.  Among the crucial tasks of such an implementation would be to deal with cluster monitoring, fault- tolerance, and the management and scheduling of a large number of concurrent and distributed jobs. To keep the implementation simple, the use of a platform that provided first-class support for distribution and concurrency was imperative. This motivated the choice of Erlang/OTP to implement the core control plane of Disco. It bears stressing that this choice was driven primarily by pragmatic concerns, as opposed to any beliefs about the superiority of functional programming languages in general or Erlang in particular. The fact that Erlang has a well-known track record in the implementation of production- quality reliable server systems with minimal downtime made it an easier selection to justify internally. The choice of language to implement computations in Disco was Python, which also emerged from pragmatic priorities.  Python is a popular language in the scientific computing community, with numerous readily- available libraries. It is simple to write Python programs using the extensive Python libraries to analyze relatively unstructured log and data files, an important initial use case for Disco.  Once the core of Disco was implemented in Erlang, a need was felt for a custom distributed filesystem, since experiences with off-the-shelf solutions for Linux proved unsatisfactory.  Many of the interfaces and abstractions offered by POSIX-compatible filesystems were thought unnecessary in the MapReduce set- ting; instead, a minimal set of requirements and interfaces was chosen, and these were implemented as the Disco Distributed Filesystem (DDFS). Again, the choice of Erlang for the implementation proved sound: the tag-based replicating DDFS has been implemented in 2.8K lines of Erlang (including comments). The Erlang portion of Disco itself is 6.3K lines. \r\n\r\nWe’ve recently implemented a support library [2] for writing Disco jobs in OCaml. This takes advantage of the support for workers in arbitrary languages added to Disco 0.4.  The talk will not discuss the architecture of Disco [3]. Instead, we’ll discuss our experiences using Erlang, Python and OCaml.  Although Erlang is a dynamically-typed functional programming language, there are type-checking tools available like Typer and Dialyzer whose use make it possible to apply some amount of static analysis to an Erlang codebase. In the case of Disco, the use of these tools was introduced after the system had been developed; we will talk about some issues we faced in introducing these tools post-facto, and what new Erlang projects can do to avoid these issues. We will present the results of using these tools, some of the issues and bugs they found, and some of the features we wished they had. We will also discuss our experiences in using property-testing Quickcheck-like tools for Erlang like Triq and Proper.  One problem that projects in unusual programming languages face is getting even interested parties to contribute to the codebase. For instance, even though one of the new contributors to Disco had a functional programming background, it was not straightforward for him to quickly understand the Erlang code of Disco, even though Erlang is a fairly simple functional language.  We will explore the reasons for this, and what we think may help in reducing such hurdles[4]. Lastly, we will discuss some of the Nokia-internal consequences of using Erlang for Disco. \r\n\r\n[1] The Disco Project is at http://discoproject.org. \r\n[2] ODisco, available at https://github.com/pmundkur/odisco.\r\n[3] A paper on the architecture has been submitted to the Erlang Workshop 2011.\r\n[4] In particular, we think this is because Erlang programs have a highly dynamic process and linkage structure that is not easily understood by an Erlang newcomer by just looking at source code.  Experience needs to be gained with running systems via logs and interaction, more so than with projects in most other languages, which often use relatively static threading structures. Process tree diagrams indicating parent-child and linkage relationships in the documentation are invaluable to get oriented. ', 1),
(3252, 3252, 1316896200, 1316898000, NULL, NULL);
INSERT INTO `content_type_session` (`vid`, `nid`, `field_sesion_time_value`, `field_sesion_time_value2`, `field_session_details_value`, `field_session_details_format`) VALUES
(3253, 3253, 1316898000, 1316899800, 'I''d like to talk about our experiences (both good and bad). I''d like to discuss why we''ve moved away from OCaml as our primary prototyping language.  We''ve interfaced with a lot of C code, and I''d like to share with the audience the unwritten rules and techniques we''ve used when when we encounter hard to debug segfaults. And finally we are just about to launch a product containing 50k+ lines of OCaml in the management stack, so something must have gone well...\r\n\r\nThe Acunu Management Stack is a disaggregated collection of services running on every host in a cluster, implementing role such as deployment assistance, configuration and monitoring. Each service has a specific role and exposes (a subset of) the same, autogenerated API - for instance, we have a clustering service that continually gossips to discover other hosts and keep an (eventually) consistent view of the cluster. Our JavaScript/HTML UI communicates with these service via a routing service, which exposes the unified API and can route events and forward RPC calls between services on different hosts, based on various policies. \r\n\r\nI’d like to talk about our experiences developing this system in OCaml and what specific features of the language we have used. I also like to discuss some of the common patterns which have fallen out of our development, and what libraries we have used (or wish we had used!) Finally (if I get time), I’d like quickly to demonstrate how cool the Acunu Storage Platform is, and what kind of performance improvements it can bring to massive, distributed storage systems. \r\n\r\n[1] Byde, A. et al (2011). Stratified B-trees and Versioned Dictionaries. Appearing in HotStorage ’11 ', 1),
(3324, 3324, 1316728800, 1316736000, NULL, NULL),
(3325, 3325, 1316815200, 1316822400, NULL, NULL);
