INSERT INTO `node_revisions` (`nid`, `vid`, `uid`, `title`, `body`, `teaser`, `log`, `timestamp`, `format`) VALUES
(1, 1, 39, 'Functional Programming in Action', 'Functional programming languages have been a hot topic of academic research for over 35 years, and are rapidly being adopted in diverse real-world settings ranging from from tech start-ups to financial and biomedical firms. At the same time, a vigorous community of practically-minded functional programmers has come into existence.\r\n\r\nCUFP is a yearly workshop aimed at serving this community.   The 2012 conference is in Copenhagen, from September 13th-15th. Once again, it is co-located with [ICFP 2012](http://icfpconference.org/icfp2012/).', 'Functional programming languages have been a hot topic of academic research for over 35 years, and are rapidly being adopted in diverse real-world settings ranging from from tech start-ups to financial and biomedical firms. At the same time, a vigorous community of practically-minded functional programmers has come into existence.\r\n\r\nCUFP is a yearly workshop aimed at serving this community.   The 2012 conference is in Copenhagen, from September 13th-15th. Once again, it is co-located with [ICFP 2012](http://icfpconference.org/icfp2012/).', '', 1327346001, 1),
(3473, 3473, 39, '2012 Copenhagen, Denmark', 'CUFP 2012 will be co-located with [ICFP 2012](http://icfpconference.org/icfp2012/), and will consist of three\r\ncomponents: CUFP Talks, CUFP Tutorials and CUFP BOFs. We will announce\r\nthe call for proposals, tutorials and BOFs shortly.\r\n\r\n**CUFP Talks** will consist of a series of talks given by\r\npractitioners in the field. The talks will be split between experience\r\nreports, describing ways in which functional programming has been\r\nused, either successfully or unsuccessfully, in the real world; and\r\ntechnical talks, which will detail techniques and approaches for\r\napplying functional programming in practical settings.\r\n\r\n**CUFP Tutorials** will be made up of in-depth, hands-on sessions for\r\nlearning particular technologies and techniques in functional\r\nprogramming. These will range from language introductions for\r\nbeginners to more advanced and focused sessions on particular language\r\nfeatures, techniques or tool kits.\r\n\r\n**CUFP BOFs** will consist of so-called "birds-of-a-feather" sessions,\r\nwhich will create spaces for informal conversations on a variety of\r\ntopics. Among other things, this will be a good venue for language\r\ndesigners and practitioners to exchange ideas about the future of\r\nfunctional programming. As is typical with BOFs, topics will be chosen\r\nbeforehand based on a public process for gathering proposals,\r\norganised via our website.\r\n\r\n## Program Chairs\r\n\r\n- [Mike Sperber](http://www.deinprogramm.de/sperber/) (Active Group), co-chair\r\n- [Anil Madhavapeddy](http://anil.recoil.org/) (University of Cambridge), co-chair\r\n\r\n## Tutorial and BOF organizers\r\n\r\n- [Duncan Coutts](http://www.well-typed.com/who_we_are), Well Typed, Inc.\r\n- [Simon Thompson](http://www.cs.kent.ac.uk/people/staff/sjt/), University of Kent\r\n\r\n## Program Committee\r\n\r\n- [Ashish Agarwal](http://ashishagarwal.org/) (New York University)\r\n- [Thomas Arts](http://www.quviq.com/) (QuviQ AB)\r\n- [Chris Houser](http://n01se.net/chouser/) (LonoCloud)\r\n- [Tomas Petricek](http://tomasp.net/) (University of Cambridge)\r\n- [Heiko Seeberger](http://www.heikoseeberger.name/)  (Typesafe)\r\n- [Stefan Wehr](http://www.stefanwehr.de/) (factis research)\r\n- [Noel Welsh](http://noelwelsh.com/) (untyped)\r\n', 'CUFP 2012 will be co-located with [ICFP 2012](http://icfpconference.org/icfp2012/), and will consist of three\r\ncomponents: CUFP Talks, CUFP Tutorials and CUFP BOFs. We will announce\r\nthe call for proposals, tutorials and BOFs shortly.\r\n\r\n**CUFP Talks** will consist of a series of talks given by\r\npractitioners in the field.', '', 1328296810, 1),
(10, 10, 1, '2009 Edinburgh, Scotland Conference Info', 'The conference will be held at the <a href="http://www.rcpe.ac.uk/conferencing/index.php">Royal College of Physicians</a>, a historic building in the centre of Scotland''s capital city of <a href="http://en.wikipedia.org/wiki/Edinburgh">Edinburgh</a>. As an additional attraction for participants, the conference also coincides with the final week of the <a href="http://www.eif.co.uk/">Edinburgh International Festival</a>, one of the premier arts and cultural festivals in the world. Due to the popularity of Edinburgh during the festival period, we recommend booking accommodation early, via the local arrangements link below. Various forms of financial support, including support for student authors and child-care assistance, is available from the <a href="http://www.sigplan.org/PAC.htm">SIGPLAN Professional Activities Committee</a>\r\n\r\n####Program Committee\r\n\r\n- <a href=''<?php print url(''user/13'');?>''>Francesco Cesarini</a>, *Erlang Training and Consulting, UK (Co-Chair)*\r\n- <a href=''<?php print url(''user/14'');?>''>Manuel Chakravarty</a>, *The University of New South Wales, Australia*\r\n- <a href=''<?php print url(''user/15'');?>''>Kathleen Fisher</a>, *AT&amp;T, USA*\r\n- <a href=''<?php print url(''user/16'');?>''>Jim Grundy</a>, *Intel, USA (Co-Chair)*\r\n- <a href=''<?php print url(''user/17'');?>''>John Hughes</a>, *QuviQ, Sweden*\r\n- Nick Levine, *Ravenbrook, UK*\r\n- <a href=''<?php print url(''user/19'');?>''>Anil Madhavapeddy</a>, *UK*\r\n- <a href=''<?php print url(''user/20'');?>''>Laura McKinney</a>, *Galois, USA*\r\n- <a href=''<?php print url(''user/21'');?>''>Yaron Minsky</a>, *Jane Street Capital, USA*\r\n- <a href=''<?php print url(''user/22'');?>''>David Pollak</a>\r\n- <a href=''<?php print url(''user/24'');?>''>Ganesh Sittampalam</a>, *Credit Suisse, UK*\r\n- <a href=''<?php print url(''user/23'');?>''>Ulf Wiger</a>, *Ericsson, Sweden*\r\n', 'The conference will be held at the <a href="http://www.rcpe.ac.uk/conferencing/index.php">Royal College of Physicians</a>, a historic building in the centre of Scotland''s capital city of <a href="http://en.wikipedia.org/wiki/Edinburgh">Edinburgh</a>. As an additional attraction for participants, the conference also coincides with the final week of the <a href="http://www.eif.co.uk/">Edinburgh International Festival</a>, one of the premier arts and cultural festivals in the world. Due to the popularity of Edinburgh during the festival period, we recommend booking accommodation early, via the local arrangements link below. Various forms of financial support, including support for student authors and child-care assistance, is available from the <a href="http://www.sigplan.org/PAC.htm">SIGPLAN Professional Activities Committee</a>\r\n\r\n####Program Committee\r\n\r\n- <a href=''<?php print url(''user/13'');?>''>Francesco Cesarini</a>, *Erlang Training and Consulting, UK (Co-Chair)*\r\n- <a href=''<?php print url(''user/14'');?>''>Manuel Chakravarty</a>, *The University of New South Wales, Australia*\r\n- <a href=''<?php print url(''user/15'');?>''>Kathleen Fisher</a>, *AT&amp;T, USA*\r\n- <a href=''<?php print url(''user/16'');?>''>Jim Grundy</a>, *Intel, USA (Co-Chair)*\r\n- <a href=''<?php print url(''user/17'');?>''>John Hughes</a>, *QuviQ, Sweden*\r\n- Nick Levine, *Ravenbrook, UK*\r\n- <a href=''<?php print url(''user/19'');?>''>Anil Madhavapeddy</a>, *UK*\r\n- <a href=''<?php print url(''user/20'');?>''>Laura McKinney</a>, *Galois, USA*\r\n- <a href=''<?php print url(''user/21'');?>''>Yaron Minsky</a>, *Jane Street Capital, USA*\r\n- <a href=''<?php print url(''user/22'');?>''>David Pollak</a>\r\n- <a href=''<?php print url(''user/24'');?>''>Ganesh Sittampalam</a>, *Credit Suisse, UK*\r\n- <a href=''<?php print url(''user/23'');?>''>Ulf Wiger</a>, *Ericsson, Sweden*\r\n', '', 1267464328, 3),
(143, 143, 1, 'Bylaws', '##Goals of CUFP\r\n\r\nThe goal of CUFP is to build a community of users of functional programming languages and technology, regardless of whether community members use functional languages in their professional lives, in an open source project (other than in the implementation of functional languages), as a hobby, or any combination thereof. In short: anyone who uses functional programming as a means, not an end.\r\n\r\nCUFP aims to help functional programming become increasingly viable as a technology for use in the commercial, industrial, and government space by providing a forum for FP professionals to share their experiences and ideas, whether business, management, or engineering. It also aims to enable the formation and cementing of relationships and alliances that further the commercial use of functional languages. Providing user feedback to language designers and implementers is not a primary goal of CUFP, though it will be welcome if it occurs.\r\n\r\n##Annual Meeting\r\n\r\nIn pursuit of this goal, CUFP holds an annual meeting at which people present their stories of how functional programming has worked (or not!) for them. The meeting may also include tutorials and other content aimed at helping users of functional programming languages. The program for the meeting is put together by a program committee, typically chaired by two people, serving staggered two-year terms. It is the responsibility of the program chairs to form a program committee with the consultation and approval of the CUFP Board/SC and the SIGPLAN Chair and Vice Chair to secure continued SIGPLAN sponsorship.\r\n\r\n##Steering Committee\r\n\r\nThe steering committee is responsible for setting the long-term direction of CUFP, both for the annual meeting and for any other activities deemed to forward the goals of CUFP. The chair of the steering committee serves a two-year term. The steering committee is comprised of the following:\r\n\r\n- The four most recent program committee co-chairs (starting as soon as a person agrees to be a program committee co-chair)\r\n-  Four members-at-large (serving 4-year terms, one turning over at CUFP each year)\r\n- In years in which a new steering committee chair has been elected, the previous steering committee chair remains a member of the committee for continuity\r\n\r\nEach year the steering committee will meet and take the following actions to renew its membership:\r\n\r\n- If the steering committee chair has completed their term, a new steering committee chair is elected, typically from among the other members of the committee. The now prior steering committee chair remains a member of the committee for a year to ensure continuity. If the steering committee chair is continuing in their role, then the prior chair retires from the committee unless they also serve in some other role.\r\n- Elect new program committee co-chairs, typically two, retaining the most recently elected program committee co-chair for continuity and choosing a new co-chair. The four most recently elected co-chairs now serve on the steering committee. Prior holders of that role retire from the committee unless they continue to serve in some other role.\r\n- Elect a new member-at-large who is not otherwise serving on the committee. The four most recently elected members-at-large now serve on the steering committee. Prior holders of that role retire from the committee unless they continue to serve in some other role.\r\n\r\nNew steering committee members should be chosen to ensure representation on the steering committee of the breadth of the CUFP community. Diversity factors include those under the <a href="http://www.sigplan.org/DiversityPolicy.htm" target="_blank">SIGPLAN diversity policy</a>. In addition, we strive to include people from a variety of industries and using a variety of functional programming languages. In the event that someone is unable to serve to the completion of his or her term, the steering committee will appoint someone to fill the vacancy.', '##Goals of CUFP\r\n\r\nThe goal of CUFP is to build a community of users of functional programming languages and technology, regardless of whether community members use functional languages in their professional lives, in an open source project (other than in the implementation of functional languages), as a hobby, or any combination thereof.', '', 1267465045, 1),
(16, 16, 1, 'Francesco Cesarini - Profile 16', 'Founder and Chief Strategy officer at Erlang Solutions. Worked with the ACM SIGPLAN Erlang workshop since it was first sponsored by ACM in 2002. Co-Chair and frequent speaker at CUFP. Started the Erlang Factory, commercial Erlang conferences and training in London and San Francisco. We now also run the Erlang User Conference on behalf of Ericsson. Author of Erlang Programming, an animal guide published by O''Reilly media in 2009. <p>Erlang Solutions: http://www.erlang-solutions.com</p><p>Erlang Factory: http://www.erlang-factory.com</p><p>''Erlang Programming'' by Francesco Cesarini and Simon Thompson: http://www.erlangprogramming.org/</p>', 'Founder and Chief Strategy officer at Erlang Solutions. Worked with the ACM SIGPLAN Erlang workshop since it was first sponsored by ACM in 2002. Co-Chair and frequent speaker at CUFP. Started the Erlang Factory, commercial Erlang conferences and training in London and San Francisco. We now also run the Erlang User Conference on behalf of Ericsson. Author of Erlang Programming, an animal guide published by O''Reilly media in 2009. ', '', 1289352316, 1),
