(19, 19, 1, 'Jim Grundy - Profile 19', 'Jim is a researcher in formal verification technologies and applications at Intel corporation; a position he has held since 2000.  Prior to that Jim was on the faculty of the Department of Computer Science at the Australian National University.  Jim has also worked as a post-doctoral researcher at Åbo Akademi in Finland, and as a research scientist at the Australian Defence Science and Technology Organisation.<p>Profile: http://www.google.com/profiles/grundy.jim</p><p>Professional Information: http://sites.google.com/site/grundyjim/home/professional</p>', 'Jim is a researcher in formal verification technologies and applications at Intel corporation; a position he has held since 2000.  Prior to that Jim was on the faculty of the Department of Computer Science at the Australian National University.  Jim has also worked as a post-doctoral researcher at Åbo Akademi in Finland, and as a research scientist at the Australian Defence Science and Technology Organisation.', '', 1289352681, 1),
