(24, 24, 1, 'Yaron Minsky - Profile 24', 'Yaron Minsky obtained his PhD in Computer Science from Cornell University in 2002 focusing on distributed systems. In 2003, he joined Jane Street where he founded the quantitative research and technology group there.<p>Jane Street: http://janestreet.com</p><p>Jane Street''s OCaml blog: http://ocaml.janestreet.com</p>', 'Yaron Minsky obtained his PhD in Computer Science from Cornell University in 2002 focusing on distributed systems. In 2003, he joined Jane Street where he founded the quantitative research and technology group there.', '', 1289352681, 1),
(133, 133, 19, '2010 Baltimore, Maryland', '**Registration is now available [here](https://regmaster3.com/2010conf/ICFP10/register.php).**\r\n\r\nCUFP 2010 will be colocated with ICFP 2010, and will consist of three\r\ncomponents: CUFP Talks, CUFP Tutorials and CUFP BOFs.\r\n\r\n**CUFP Talks** will consist of a series of talks given by\r\npractitioners in the field. The talks will be split between shorter\r\nexperience reports, describing ways in which functional programming\r\nhas been used, either successfully or unsuccessfully, in the real\r\nworld; and longer technical talks, which will detail techniques and\r\napproaches for applying functional programming in practical settings.\r\n\r\n**CUFP Tutorials** will be made up of in-depth, hands-on sessions for\r\nlearning particular technologies and techniques in functional\r\nprogramming. These will range from language introductions for\r\nbeginners to more advanced and focused sessions on particular language\r\nfeatures, techniques or tool kits.\r\n\r\n**CUFP BOFs** will consist of so-called "birds-of-a-feather" sessions,\r\nwhich will create spaces for informal conversations on a variety of\r\ntopics. Among other things, this will be a good venue for language\r\ndesigners and practitioners to exchange ideas about the future of\r\nfunctional programming. As is typical with BOFs, topics will be chosen\r\nbeforehand based on a public process for gathering proposals,\r\norganized via our website and a mailing list.\r\n\r\nYou can see the full talk and tutorial\r\n[schedule](http://cufp.org/conference/schedule/2010) here.\r\n\r\nThere will be no published proceedings, as the meeting is intended to\r\nbe more a discussion forum than a technical interchange.\r\n\r\n## Program Committee\r\n\r\n- <a href=''<?php print url(''user/13'');?>''>Francesco Cesarini</a>, *Erlang Solutions, UK (Co-Chair)*\r\n- Tim Dysinger, *Sonian Networks*\r\n- <a href=''<?php print url(''user/49'');?>''>Alain Frisch</a>, *LexiFi*\r\n- <a href=''