(44, 44, 36, 'Duncan Coutts - Profile 44', 'Duncan has more than ten years programming experience with Haskell. He is a well known member of the Haskell community. He helps maintain several popular libraries and tools including Cabal and bytestring. He also has several years experience in packaging the Haskell platform for Gentoo Linux. In 2004, in a team with Ian Lynagh and two others, he won the ICFP contest with an all-Haskell entry.\r\n\r\nHe holds a first class degree in Computer Science from Oxford University and is shortly to complete a PhD there too. He has published papers at international conferences, including ICFP. His research focus is on generating high performance code from idiomatic high level Haskell code. This included co-authoring the bytestring and binary libraries and work on stream fusion for lists. He has five years experience teaching computer science, including four years teaching Haskell to mature students at graduate level. ', 'Duncan has more than ten years programming experience with Haskell. He is a well known member of the Haskell community. He helps maintain several popular libraries and tools including Cabal and bytestring. He also has several years experience in packaging the Haskell platform for Gentoo Linux. In 2004, in a team with Ian Lynagh and two others, he won the ICFP contest with an all-Haskell entry.\r\n\r\nHe holds a first class degree in Computer Science from Oxford University and is shortly to complete a PhD there too. He has published papers at international conferences, including ICFP.', '', 1308233495, 1),
(45, 45, 1, 'Keynote: Real world Haskell.', 'Bryan will talk about how the book "Real World Haskell" came to be, and the response that it has received since publication. He will also discuss the opportunities presented, and the challenges faced, by functional languages in open source and in industry. ', 'Bryan will talk about how the book "Real World Haskell" came to be, and the response that it has received since publication. He will also discuss the opportunities presented, and the challenges faced, by functional languages in open source and in industry. ', '', 1265659672, 1),
(60, 60, 1, 'John Launchbury - Profile 60', '*At Galois*  \r\nDr. John Launchbury is Chief Scientist of Galois, Inc. John founded Galois in 1999 to address challenges in Information Assurance through the application of Functional Programming and Formal Methods. Under his leadership, formerly as CEO, the company has grown strongly, successfully winning and delivering on multiple contract awards for U.S. Government customers. John continues to lead Galois'' growing stature for its thought leadership in high assurance technology development.\r\n\r\n*My Background*  \r\nPrior to founding Galois, John was a full professor in Computer Science and Engineering at the Oregon Graduate Institute School of Science and Engineering at OHSU. His instruction style earned him several awards for outstanding teaching, and he is internationally recognized for his work on the analysis and semantics of programming languages, and on the Haskell programming language in particular. John received First Class Honors in Mathematics from Oxford University in 1985. He holds a Ph.D. in Computing Science from University of Glasgow and won the British Computer Society''s distinguished dissertation prize.<p>Galois: http://www.galois.com</p>', '*At Galois*  \r\nDr. John Launchbury is Chief Scientist of Galois, Inc. John founded Galois in 1999 to address challenges in Information Assurance through the application of Functional Programming and Formal Methods. Under his leadership, formerly as CEO, the company has grown strongly, successfully winning and delivering on multiple contract awards for U.S. Government customers.', '', 1289352704, 1),
