(48, 48, 1, 'Scala at EDF Trading.  Implementing a Domain-Specific Language for Derivative Pricing with Scala.', 'In this talk I shall explain how Scala has been used at EDF Trading. We have used Scala to implement Diesel: a domain-specific language used within our in-house system for pricing/risk-managing/hedging commodity derivatives. Diesel can represent commodity derivatives naturally and can then be executed to perform a Monte Carlo simulation. Compared to writing derivative-specific Monte Carlo simulations in a general-purpose computer language, the per-derivative development time has been reduced from weeks to hours.\r\n\r\nWe have been using Scala within a large code base of 300k lines of Java on a on a business-critical, production system, where performance requirements are key. Based on this experience, the second part of the talk will discuss the suitability of Scala for use within this context, comparing the risks of using a niche language against its productivity benefits. ', 'In this talk I shall explain how Scala has been used at EDF Trading. We have used Scala to implement Diesel: a domain-specific language used within our in-house system for pricing/risk-managing/hedging commodity derivatives. Diesel can represent commodity derivatives naturally and can then be executed to perform a Monte Carlo simulation.', '', 1265659720, 1),
(49, 49, 1, 'Erlang at hover.in', 'I''m Co-Founder &amp; CTO at ''hover.in'', the in-text content &amp; ad delivery platform that let''s blogs and website publishers to push client-side events to the cloud. The start-up predominantly runs off the LYME stack ( Linux / Yaws / Mnesia / Erlang ) .\r\n\r\nFrom our experiences at ''hover.in'' I''d like to discuss why we chose using Erlang and got about using it as our bridge across our multi-node cluster. In particular the architectural decisions that went into making our distributed python crawler back-end running off Mnesia with its sharing &amp; fragmentation strategies for tables that span several millions of rows, load-balancing to our 3-node Yaws web servers, tweaks to solve file descriptor &amp; efficiency bottlenecks, experiments in DHT''s, our cache worker implementations, our messaging queues, cron''s &amp; trade offs in dispatching jobs also throw light on design choices that can fit in distributed and heterogeneous environments. We have also recently built our own in-memory cache workers, persistent stats &amp; logging system, and in the process of now building our own A/B testing framework, that we''d love to talk about.\r\n\r\nAfter an initial quite 1 1/2 years of Erlang in production, we''ve just launched our developer blog which might give a closer insight of our work:\r\n\r\n- notes on our <a href="http://developers.hover.in/blog/2009/somethings-to-rejoice-about/">multi-core computing &amp; back-end experiences</a>\r\n- notes on <a href="http://developers.hover.in/blog/2009/yui-tsung-to-choose-a-cdn/">using a Erlang based load-testing tool (Tsung)</a>\r\n- my talk on <a href="http://www.slideshare.net/bosky101/erlang-at-hoverin-devcamp-blr-09">''Erlang at hover.in''</a> at devCamp Bangalore (with one slide listing all the modules written as well)\r\n- <a href="http://punetech.com/enrich-your-website-with-content-money-an-interview-with-hoverin/">a more product-oriented interview</a>', 'I''m Co-Founder &amp; CTO at ''hover.in'', the in-text content &amp; ad delivery platform that let''s blogs and website publishers to push client-side events to the cloud. The start-up predominantly runs off the LYME stack ( Linux / Yaws / Mnesia / Erlang ) .\r\n\r\nFrom our experiences at ''hover.in'' I''d like to discuss why we chose using Erlang and got about using it as our bridge across our multi-node cluster.', '', 1265659745, 1),
(50, 50, 1, 'The Big Board:  Teleconferencing over High-res Maps with Haskell.', 'A public emergency is the ultimate example of multitasking and collaboration over a wide area. Crowd control, first aid, fire, police, and search and rescue teams all have to provide a timely and coordinated response to save lives and property. This requires situational awareness, meaning that emergency managers know what and where their resources are on the ground, and what the ground''s features are. Managers who direct emergency operations centers have few technological tools to help them with these complicated, critical tasks. They are, in fact, still largely paper based.\r\n\r\nThe Big Board aids in filling this technological gap by providing aerial photography, facility for dynamic, geo-referenced content creation, and a mechanism for simulcasting the content to everyone participating in the management of an emergency. The goal is that it should give emergency managers a reliable and flexible way to coordinate on their most natural medium (maps), be as easy to use as pen and paper, quick to train a new user on, and able to run in many environments, some quite technologically out of date.\r\n\r\nIn The Big Board, users open a map, join a virtual conference room, and then can collaboratively mark up the map with paths, polygons, and placemarks and add content behind these using a wiki that is generated as part of every conference room. As they mark up the map, their annotations are simulcasted to everyone else in the same conference room. Additionally, web-services serving geo-referenced content can be integrated onto the map to overlay things such as real-time vehicle location and sensor data.\r\n\r\nThis application has been written from the ground up in Haskell, with a PostGIS backend. Haskell was chosen for its laziness, reliability of applications written in it, rapid development, multicore scalability, and native compilation. In this presentation I will describe:\r\n\r\n- The Big Board, who''s using it, and where we''re going with it.\r\n- The requirements of it, and how Haskell fulfills these   requirements better than the alternatives.\r\n- A high level overview of the application''s structure.\r\n- The challenges and advantages of functional design in such a large application.\r\n- How the design led naturally to two reusable, publicly available libraries now in Hackage: Buster (FRP for application orchestration) and Hieroglyph (for functional 2D vector-graphics).\r\n\r\nI will also give a demonstration of the application running, showing how it can be used to coordinate a disaster response.\r\n', 'A public emergency is the ultimate example of multitasking and collaboration over a wide area. Crowd control, first aid, fire, police, and search and rescue teams all have to provide a timely and coordinated response to save lives and property. This requires situational awareness, meaning that emergency managers know what and where their resources are on the ground, and what the ground''s features are. Managers who direct emergency operations centers have few technological tools to help them with these complicated, critical tasks.', '', 1265659783, 1),
