(76, 76, 39, 'Michael Sperber - Profile 76', 'I am an expert for creating high-level software models for complex problem domains. These models allow developers and users to represent domain-specific knowledge directly in the software, rather than forcing them to use awkward technical models. I employ a variety of disciplines – algebraic modelling, functional programming, and object-oriented design.\r\n\r\nMy specialty is exploiting modern programming-language technology, specifically functional programming, to develop software very rapidly and reliably. This enables productivity improvements over traditional object-oriented technologies with a factor of 3-10. I have extensive experience with deploying these technologies in a wide range of software projects.', 'I am an expert for creating high-level software models for complex problem domains. These models allow developers and users to represent domain-specific knowledge directly in the software, rather than forcing them to use awkward technical models. I employ a variety of disciplines – algebraic modelling, functional programming, and object-oriented design.\r\n\r\nMy specialty is exploiting modern programming-language technology, specifically functional programming, to develop software very rapidly and reliably.', '', 1310905913, 1),
