(75, 75, 1, 'Simon Peyton-Jones - Profile 75', '<p>I''m a researcher at Microsoft Research in Cambridge, England. I started here in Sept 1998. I''m also an Honorary Professor of the <a href="http://www.dcs.gla.ac.uk/">Computing Science Department</a> at <a href="http://www.gla.ac.uk/">Glasgow University</a>, where I was a professor during 1990-1998. </p>\r\n<p>I am married to Dorothy, a priest in the Church of England. We have three children, Michael, Sarah, and Margaret. </p>\r\n\r\n<p>I''m interested in the design, implementation, and application of lazy functional languages. In practical terms, that means I spend a most of my time on the design and implementation of <a href="http://www.haskell.org/">the language Haskell</a>. In particular, much of my work is focused around <a href="http://haskell.org/ghc">the Glasgow Haskell Compiler</a>, and its ramifications. </p>\r\n<p>Microsoft Research is next door to the Cambridge University Computer Lab, and I co-supervise a number of PhD students at the Computer Lab. If you are interested in doing a PhD at Cambridge in my area, then I am very happy to discuss it with you. </p>\r\n<p>Here is a <a href="/%7Esimonpj/bio.html">brief biography</a>, suitable for seminar announcements and suchlike. </p>\r\n<p>For amusement, here are some pictures of <a href="http://haskell.org/haskellwiki/Simon_Has_Fun">me having fun</a>, taken by John Petersen in 2008. </p><p>Microsoft Profile: http://research.microsoft.com/~simonpj/</p>', '<p>I''m a researcher at Microsoft Research in Cambridge, England. I started here in Sept 1998. I''m also an Honorary Professor of the <a href="http://www.dcs.gla.ac.uk/">Computing Science Department</a> at <a href="http://www.gla.ac.uk/">Glasgow University</a>, where I was a professor during 1990-1998. </p>\r\n<p>I am married to Dorothy, a priest in the Church of England. We have three children, Michael, Sarah, and Margaret. </p>', '', 1289352705, 1),
(77, 77, 1, 'Andy Adams-Moran - Profile 77', '*At Galois*  \r\nI''m a matchmaker: I match clients (and their needs) with Galois people and capabilities. This requires an understanding of the technical issues, of what is possible, how a client''s problem fits into our market strategy, but above all, listening. Another way to think of this is that I work hard to build trust. Our clients have truly profound problems they are required to solve, and they take stewardship of their constituents'' funds (whether taxpayers or shareholders) very seriously. A deep level of trust in Galois'' understanding of what''s important to them, in our ability to perform, and in our sincerity, is the basis of all of our working relationships.  \r\n\r\n*My Background*  \r\nI started out as a researcher in theoretical computer science, specifically semantics of non-determinism in functional languages. I found working in an esoteric field to be unsatisfying, in that my work was of interest to a handful of people around the world. The chance to apply my ideas and those of the functional programming community to solve real problems was too good to pass up. I spent a few very fun years working as a developer and project lead, and then started helping set up projects for the upcoming work year. Now, I work on setting up research, technology maturation, and technology transition projects (with a focus on the first two). I''m getting to spend more and more of my time writing Haskell code these days, which is profoundly satisfying!<p>Galois Profile: http://www.galois.com/company/people/andy_adams-moran</p>', '*At Galois*  \r\nI''m a matchmaker: I match clients (and their needs) with Galois people and capabilities. This requires an understanding of the technical issues, of what is possible, how a client''s problem fits into our market strategy, but above all, listening. Another way to think of this is that I work hard to build trust. Our clients have truly profound problems they are required to solve, and they take stewardship of their constituents'' funds (whether taxpayers or shareholders) very seriously.', '', 1289352706, 1),
