(136, 136, 1, 'Don Stewart - Profile 136', '[Don](http://donsbot.wordpress.com) is an Australian open source hacker, and engineer at [Galois, Inc](http://galois.com), in Portland, Oregon, where he works on creating trustworthiness and assurance in critical systems with an emphasis on language design and compiler techniques. Don is co-author of the book, [Real World Haskell](http://book.realworldhaskell.org/), published by O’Reilly, and [the XMonad window manager](http://xmonad.org).<p>Don''s Blog: http://donsbot.wordpress.com/</p><p>Don @ Twitter: http://twitter.com/donsbot</p><p>Galois: http://galois.com</p>', '[Don](http://donsbot.wordpress.com) is an Australian open source hacker, and engineer at [Galois, Inc](http://galois.com), in Portland, Oregon, where he works on creating trustworthiness and assurance in critical systems with an emphasis on language design and compiler techniques. Don is co-author of the book, [Real World Haskell](http://book.realworldhaskell.org/), published by O’Reilly, and [the XMonad window manager](http://xmonad.org).', '', 1289352707, 1),
(137, 137, 1, 'Mary Sheeran - Profile 137', 'Mary Sheeran is a Professor at Chalmers, working in functional programming, and particularly Domain Specific Languages. Her thesis, long ago before Verilog and VHDL existed, was about a DSL for hardware design based on Backus'' FP. She is currently working with colleagues from Ericsson and ELTE University Budapest on Feldspar, a DSL for DSP algorithm design. She is also working on DSLs for (hardware) architecture modelling and for GPU programming.', 'Mary Sheeran is a Professor at Chalmers, working in functional programming, and particularly Domain Specific Languages. Her thesis, long ago before Verilog and VHDL existed, was about a DSL for hardware design based on Backus'' FP. She is currently working with colleagues from Ericsson and ELTE University Budapest on Feldspar, a DSL for DSP algorithm design. She is also working on DSLs for (hardware) architecture modelling and for GPU programming.', '', 1289353192, 1),
