(139, 139, 1, 'Dean Wampler - Profile 139', 'Dean wrote "Programming Scala":http://programmingscala.com with Alex Payne (O''Reilly). He writes software for DRW Holdings, a Chicago-based trading company. He is also a guest editor for the forthcoming _IEEE Software_ special issue on *Multiparadigm Programming".<p>Dean''s Blog: http://blog.polyglotprogramming.com</p><p>Polyglot Programming: http://polyglotprogramming.com</p>', 'Dean wrote "Programming Scala":http://programmingscala.com with Alex Payne (O''Reilly). He writes software for DRW Holdings, a Chicago-based trading company. He is also a guest editor for the forthcoming _IEEE Software_ special issue on *Multiparadigm Programming".', '', 1289352707, 1),
