(242, 242, 39, 'F# 2.0 - A day at the beach (Rick Minerich)  ', '## Abstract\r\nThis tutorial will be organised around learning the building blocks of F#,\r\nreal world functional programming principles, and platform compatibility.\r\n\r\n- "Hello Seagull" - A first glimpse of F#\r\n\r\n- Beyond the REPL - A relaxing Visual Studio 2010 rubdown\r\n\r\n- The Power of Types - A distinct lack of unpleasant surprises\r\n\r\n- Asynchrony and Concurrency - Be lazy, it works so you don''t have to\r\n\r\n- Monadic Magic - A frosty gulp of language oriented programming\r\n\r\n- Tour de F# - Enjoy the fruits of others'' hard work\r\n\r\nWhat can attendees expect?  A thorough introduction to F#, one of the most\r\npowerful languages available for real world development.  Come dive into the\r\nbuilding blocks of functional programming, swim around with the safety and\r\nconvenience of type inferred statically checked code, and glide through F#''s\r\nimpressive array of libraries.\r\n## Audience\r\nGeneral.  All programmers are welcome.  Come with curiosity and an\r\nopen mind.  Those at any level of functional programming or F# experience\r\nwill enjoy this session.\r\n## Software prerequisites:\r\n(Windows) Visual Studio 2010, Visual Studio 2008 w/ F# plugin\r\n(Linux/Mac) Mono w/ F# Zip Package Installed\r\n\r\n### Visual Studio 2010\r\nAny non-express Visual Studio 2010 installation comes with F#, just as long\r\nas it wasn''t deselected during installation.\r\n\r\n### Non-Express Visual Studio 2008\r\nFor non-express Visual Studio 2008, just go to the [MSDN website](http://msdn.microsoft.com/en-us/fsharp/default.aspx), and click "Get the F#\r\nStandalone and VS2008 CTP".  After that, scroll to the bottom of the page,\r\nclick the download button for "InstallFSharp.msi" and run it.\r\n\r\n### Windows Without Visual Studio or with Visual Studio Express\r\n\r\nOn Windows, you need to download and install "Visual Studio 2008 Shell\r\n(integrated mode) from [here](http://www.microsoft.com/downloads/details.aspx?familyid=40646580-97FA-4698-B65F-620D4B4B1ED7).\r\nAfter installing Visual Studio 2008 Shell, you can follow the same\r\ninstructions as above for non-express Visual Studio 2008.\r\n\r\n### Macintosh / Linux\r\n\r\nIf you don''t already have a recent version of Mono installed, you''ll need to\r\nget it.  This process varies from platform to platform, please see\r\n[this page](http://www.mono-project.com/Getting_Mono) for more information.\r\n\r\nNext, you''ll need to install F#.  This requires downloading two things: the\r\nF# standalone package and the Mono key file.\r\n\r\nDownload the F# standalone package, `fsharp.zip`, from here\r\n[here](http://www.microsoft.com/downloads/details.aspx?FamilyID=444005fb-e627-4feb-b51d-13d6a3b4b8ed).\r\n\r\nDownload the Mono Key from [here](http://anonsvn.mono-project.com/source/trunk/mcs/class/mono.snk).\r\n\r\nNext, unarchive `fsharp.zip`, copy `mono.snk` to the location F# was unarchived\r\nto, and run `install-mono.sh`.  This script will install F# assemblies into\r\nthe Mono GAC and ensure correct permissions.\r\n\r\nTo use F#, run `fsi.exe` for the interactive window (REPL) and `fsc.exe` to\r\ncompile from source.\r\n## Richard Minerich\r\nis a Microsoft MVP for the F# programming language.\r\nThrough writing, speaking and running events, Richard hopes to help bridge\r\nthe gap between the cutting edge in computation and the mainstream software\r\nengineer.  Currently, Richard works as a Software Architect specializing in\r\ndigital image processing at Atalasoft, Inc.  He also leads the New England\r\nF# User Group and is anxiously awaiting the release of his first book,\r\nProfessional F# 2.0.\r\n', '## Abstract\r\nThis tutorial will be organised around learning the building blocks of F#,\r\nreal world functional programming principles, and platform compatibility.\r\n\r\n- "Hello Seagull" - A first glimpse of F#\r\n\r\n- Beyond the REPL - A relaxing Visual Studio 2010 rubdown\r\n\r\n- The Power of Types - A distinct lack of unpleasant surprises\r\n\r\n- Asynchrony and Concurrency - Be lazy, it works so you don''t have to\r\n\r\n- Monadic Magic - A frosty gulp of language oriented programming\r\n\r\n- Tour de F# - Enjoy the fruits of others'' hard work\r\n\r\nWhat can attendees expect?', '', 1280147169, 1),
(241, 241, 39, 'High-Performance Haskell (Johan Tibell)', '## Abstract\r\nHaskell makes it possible to write elegant, high-level code that\r\nrivals the performance of low-level, imperative languages. In this\r\ntutorial, I will introduce the tools Haskell provides for reasoning\r\nabout the performance of your code and techniques that you can use to\r\nmake your code faster. I will cover important topics in Haskell\r\nperformance optimization, including:\r\n\r\n- accurate benchmarking,\r\n- CPU and memory profiling,\r\n- laziness and strictness,\r\n- making sense of compiler output,\r\n- performance idioms, and\r\n- data types and their impact on performance.\r\n\r\nBy the end of the tutorial you should have an understanding of how to\r\naccurately measure the performance of your Haskell program, determine\r\nwhich parts of the program needs improvement, and finally, improve the\r\nperformance of the program.\r\n## Audience\r\nExperienced programmers familiar with functional\r\nprogramming. Familiarity with Haskell will be useful, but not\r\nrequired.\r\n## Software prerequisites\r\nHaskell Platform 2010.1.0.0 (or later) and the Criterion benchmarking\r\nlibrary. The latter can be installed by running \r\n\r\n`cabal install -f-Chart criterion`\r\n\r\nafter installing the Haskell Platform.\r\n\r\nThe Haskell Platform can be downloaded for Mac, Windows, and Linux from:\r\n\r\n[`http://hackage.haskell.org/platform/`](http://hackage.haskell.org/platform/)\r\n## Johan Tibell\r\nis a Software Engineer at Google Inc. His main\r\ninterests are in distributed systems and functional programming. He\r\nreceived a M.S. in Software Engineering from the Chalmers University\r\nof Technology, Sweden, in 2007.\r\n', '## Abstract\r\nHaskell makes it possible to write elegant, high-level code that\r\nrivals the performance of low-level, imperative languages. In this\r\ntutorial, I will introduce the tools Haskell provides for reasoning\r\nabout the performance of your code and techniques that you can use to\r\nmake your code faster.', '', 1280147154, 1),
(240, 240, 39, 'Building robust servers with Erlang (Martin Logan)  ', '## Abstract\r\nThe Building Robust Servers with Erlang tutorial will cover the\r\nfundamental concepts needs to write highly fault tolerant servers with\r\nErlang/OTP. In this tutorial you will learn some OTP basics focusing\r\nspecifically on the `gen_server` and supervision behaviours. With these\r\nbehaviours you will build server that is capable of processing\r\nrequests rapidly and concurrently and recovering in the face of\r\nfailures large and small. You will ultimately build a fault tolerant\r\nserver, package it, and deploy it as a running service.\r\n## Audience\r\nParticipants should bring basic Erlang knowledge.\r\n## Software prerequisites\r\nThe prerequisites for this class are to have Erlang the Sinan build\r\nsystem installed on your machine. If this is not possible for your OS\r\nthen at least Erlang itself should be installed.\r\n\r\nErlang is available here:\r\n\r\n[`http://www.erlang.org/download.html`](http://www.erlang.org/download.html)\r\n\r\nSinan is available here:\r\n\r\n[`http://code.google.com/p/sinan/`](http://code.google.com/p/sinan/)\r\n## Martin Logan\r\nhas been heavily involved with the Erlang community since 1999.\r\nMartin''s great interest in distributed systems\r\nand service based design has led him to be a constant presence in the\r\ncommunity having spoken many times all over the world on the topic in\r\nplaces such as Canada, USA, Sweden, and the UK as well as author the\r\ndefinitive book on the Erlang/OTP system with Manning publishing\r\nentitled "Erlang and OTP in action". Martin has implemented many\r\ncomplex systems that used Erlang in the telecom space including one of\r\nthe first call detail record collection systems for the SIP protocol.\r\nMost recently Martin has focused on large scale e-commerce backing\r\nsystems. Currently Martin brings his expertise to Orbitz Worldwide,\r\none of the largest online travel companies in the world. Martin has\r\ntaken a leadership role with [Erlware](http://erlware.org/) where he is a core\r\ndeveloper and the primary developer of the Faxien package management\r\nsystem.\r\n', '## Abstract\r\nThe Building Robust Servers with Erlang tutorial will cover the\r\nfundamental concepts needs to write highly fault tolerant servers with\r\nErlang/OTP. In this tutorial you will learn some OTP basics focusing\r\nspecifically on the `gen_server` and supervision behaviours. With these\r\nbehaviours you will build server that is capable of processing\r\nrequests rapidly and concurrently and recovering in the face of\r\nfailures large and small.', '', 1280147141, 1),
