(339, 339, 1, 'Michael Snoyman - Profile 339', 'I have been a Haskell programmer for the last three years, programming Haskell exclusively for the past year and a half. My main focus is on web development. I consult as a web developer producing web sites primarily with the Yesod web framework, of which I am the primary author.\r\n\r\nYou can find more information about my work at either [my blog](http://www.snoyman.com/blog/) or the [Yesod documentation site](http://docs.yesodweb.com/).<p>Blog: http://www.snoyman.com/blog/</p><p>Yesod Web Documentation: http://docs.yesodweb.com/</p>', 'I have been a Haskell programmer for the last three years, programming Haskell exclusively for the past year and a half. My main focus is on web development. I consult as a web developer producing web sites primarily with the Yesod web framework, of which I am the primary author.\r\n\r\nYou can find more information about my work at either [my blog](http://www.snoyman.com/blog/) or the [Yesod documentation site](http://docs.yesodweb.com/).', '', 1289352837, 1),
