(192, 192, 1, 'Geoffrey Knauth - Profile 192', 'Programmer since 1975.  Two decades of C.  Became an aficionado of functional languages while at BBN (1995-2002) thanks to wise mentoring by Ken Anderson.  CS Instructor at Lycoming College for four years.  Treasurer, FSF.<p>Home Page: http://knauth.org/gsk</p>', 'Programmer since 1975.  Two decades of C.  Became an aficionado of functional languages while at BBN (1995-2002) thanks to wise mentoring by Ken Anderson.  CS Instructor at Lycoming College for four years.  Treasurer, FSF.', '', 1289352752, 1),
