(198, 198, 1, 'Michael Fogus - Profile 198', 'Co-author of [The Joy of Clojure](http://joyofclojure.com).  Also a programmer working on web-services and distributed simulations using Java and Scala.\r\n<p>blog: http://blog.fogus.me</p><p>book: http://joyofclojure.com</p>', 'Co-author of [The Joy of Clojure](http://joyofclojure.com).  Also a programmer working on web-services and distributed simulations using Java and Scala.\r\n', '', 1289352752, 1),
(199, 199, 1, 'Andrey Nikolaenko - Profile 199', 'Packaged business applications expert, primarily focused on specific billing/CRM and cross-industry modules (HCM, Financials, SRM etc.) of packaged OLTP applications for telco and utilities customers and its integration. Worked as developer, implementor, consultant for the following apps: OEBS, SPL CC&B, SAP, CBOSS\r\n\r\nI believe a current large vendors'' tendency to build composite applications using web services as clay for out-of-date stuff is a path to cul-de-sac. So I''d like to formulate the objective: to find a techniques for designing and implementing new packaged enterprise applications, which should be declarative, free from side effects, easy convertible from legacy', 'Packaged business applications expert, primarily focused on specific billing/CRM and cross-industry modules (HCM, Financials, SRM etc.) of packaged OLTP applications for telco and utilities customers and its integration. Worked as developer, implementor, consultant for the following apps: OEBS, SPL CC&B, SAP, CBOSS\r\n\r\nI believe a current large vendors'' tendency to build composite applications using web services as clay for out-of-date stuff is a path to cul-de-sac.', '', 1289353157, 1),
