(213, 213, 1, 'Sylvain Le Gall - Profile 213', 'Sylvain Le Gall is an OCaml consulant. He founded and works now for OCamlCore, a french company that provides services for OCaml. OCamlCore is a member of the CAML consortium.\r\n\r\nSince then, he has worked to promote this functionnal programming language as a Debian developper and active member of the OCaml packaging team.\r\n\r\nHe started the OCamlCore.org community to provide even more services to the OCaml community. He also organized the 3 last OCaml Meetings in France and gave talks\r\nabout his work in OCaml at this time.<p>My Company: http://www.ocamlcore.com</p><p>OCamlCore open source services: http://www.ocamlcore.org</p><p>OCaml Meetings: http://wiki.cocan.org/events/europe</p><p>OCaml in Debian : http://wiki.debian.org/Teams/OCamlTaskForce</p><p>CAML consortium: http://caml.inria.fr/consortium/</p>', 'Sylvain Le Gall is an OCaml consulant. He founded and works now for OCamlCore, a french company that provides services for OCaml. OCamlCore is a member of the CAML consortium.\r\n\r\nSince then, he has worked to promote this functionnal programming language as a Debian developper and active member of the OCaml packaging team.\r\n\r\nHe started the OCamlCore.org community to provide even more services to the OCaml community. He also organized the 3 last OCaml Meetings in France and gave talks\r\nabout his work in OCaml at this time.', '', 1289352754, 1),
