(385, 385, 1, 'Dominique de Waleffe - Profile 385', 'Experimented (24 years) computer scientist. Specialized in using declarative technologies in the real world (prolog in the 91->95, Mercury 96->2005...\r\nFollowing Erlang since in was first made available outside Ericson in early 90''s...\r\nNow looking at both Erlang and F# for providing scalable/cloud based solutions for customers.\r\nExperience in managing projects (internal, with customers, research projects) and mentoring teams.\r\n<p>Owner, CEO, 4D Consult: http://www.4d-consult.com</p>', 'Experimented (24 years) computer scientist. Specialized in using declarative technologies in the real world (prolog in the 91->95, Mercury 96->2005...\r\nFollowing Erlang since in was first made available outside Ericson in early 90''s...\r\nNow looking at both Erlang and F# for providing scalable/cloud based solutions for customers.\r\nExperience in managing projects (internal, with customers, research projects) and mentoring teams.\r\n', '', 1289352840, 1),
