(228, 228, 1, 'Michiel  Klonhammer - Profile 228', 'Maximonster Interactive Things is a brand new company founded by Michiel Klønhammer (former CEO ICATT interactive media) who has joined forces with Marc Worrell (former owner and  lead architect at Mediamatic and developer of AnyMeta and Zotonic, a Erlang CMS). We are currently At Maximonster we are building a large scale social-media-like application called Klas.nl. Klas.nl will be an important tool for children, parents and teachers helping them communicate and learn.\r\nWe''re using open source stuff like <Erlang>, Zotonic, Django, JQuery, Open Social and are developing a lot of new open source technology as we go. The application will have to deal with extreme performance issues and needs to offer an incredibly good user experience. And we want it to look good too!<p>Maximonster Interactive Things: www.maximonster.com</p><p>Maximonster jobs: www.maximonster.com/work</p>', 'Maximonster Interactive Things is a brand new company founded by Michiel Klønhammer (former CEO ICATT interactive media) who has joined forces with Marc Worrell (former owner and  lead architect at Mediamatic and developer of AnyMeta and Zotonic, a Erlang CMS). We are currently At Maximonster we are building a large scale social-media-like application called Klas.nl.', '', 1289352754, 1),
