(243, 243, 39, 'Implementing web sites with Scala and Lift (David Pollak) ', '## Abstract\r\nLift is a Web framework in the vein of [Seaside](http://www.seaside.st/) and\r\n[WebObjects](http://developer.apple.com/tools/webobjects). Lift is built on\r\nScala, a functional/OO hybrid lanugage that runs on the Java Virtual\r\nMachine.\r\n\r\nIn contrast to frameworks oriented around the model-view-controller (MVC)\r\npattern, Lift abstracts the HTTP request~response cycle rather than wrapping\r\nHTTP concepts in APIs.  Lift makes use of Scala''s functional abstractions in\r\na way that allows composition of applications.\r\n\r\nIn this tutorial, we will build a multiuser, real-time chat application in\r\nLift and discuss Scala''s language features that make Lift possible.\r\n## Audience\r\nParticipants should bring basic knowledge of functional programming.\r\n## Software prerequisites\r\n\r\nYou should have [Java 1.6](http://java.sun.com) and Simple [Build Tool 0.7+](http://code.google.com/p/simple-build-tool/) installed on your machine as\r\nwell as the ability to open a TAR or ZIP file and a text editor.\r\n\r\nYou should also download one of the following:\r\n\r\n[`http://tunaforcats.com/chat.tgz`](http://tunaforcats.com/chat.tgz)\r\n\r\n[`http://tunaforcats.com/chat.zip`](http://tunaforcats.com/chat.zip)\r\n\r\nThese are both self-contained starting points for the tutorial.\r\n\r\nTo test that you have everything you need, you should run\r\n\r\n`sbt jetty-run`\r\n\r\nin the the `chat` directory that the above archives unpack into.\r\n## David Pollak\r\nhas been writing commercial software since 1977. He wrote the\r\nfirst real-time spreadsheet and the worlds highest performance spreadsheet\r\nengine. Since 1996, David has been using and devising web development tools.\r\nAs CTO of CMP Media, David oversaw the first large-scale deployment of\r\nWebLogic. David was CTO and VPE at Cenzic, a web application security\r\ncompany. David has also developed numerous commercial projects in Ruby on\r\nRails.\r\n\r\nIn 2007, David founded the Lift Web Framework open source project. Lift is\r\nan expressive and elegant framework for writing web applications. Lift\r\nstresses the importance of security, maintainability, scalability and\r\nperformance, while allowing for high levels of developer productivity. Lift\r\nopen source software licensed under an Apache 2.0 license.\r\nDavid is a consultant in San Francisco and works on Lift-based projects.\r\n', '## Abstract\r\nLift is a Web framework in the vein of [Seaside](http://www.seaside.st/) and\r\n[WebObjects](http://developer.apple.com/tools/webobjects). Lift is built on\r\nScala, a functional/OO hybrid lanugage that runs on the Java Virtual\r\nMachine.\r\n\r\nIn contrast to frameworks oriented around the model-view-controller (MVC)\r\npattern, Lift abstracts the HTTP request~response cycle rather than wrapping\r\nHTTP concepts in APIs.', '', 1280147185, 1),
(244, 244, 39, 'Camlp4 and Template Haskell (Nicolas Pouillard, Jake Donham)', '## Abstract\r\n"Static metaprogramming" is compile-time code analysis and\r\nsynthesis. It has many applications, such as (from simple to complex):\r\ndefining abbreviations, generating boilerplate from type definitions,\r\nextending the language syntax, and embedding DSLs.\r\n\r\nStatic metaprogramming is supported for Haskell with Template Haskell,\r\nand for OCaml with Camlp4; the two systems have a lot in common. In\r\nthis tutorial we will work through examples in both languages,\r\nsticking mostly to their commonalities. We will also say a little\r\nabout features which are unique to each.\r\n\r\nThe main features we will cover are:\r\n\r\n * host language syntax trees\r\n * quotations / antiquotations for host language syntax trees\r\n * defining new quotations\r\n * pragmatics of each tool\r\n\r\n(Quotations / antiquotations are a mechanism for working with host\r\nlanguage abstract syntax trees using the concrete syntax of the host\r\nlanguage.)\r\n\r\nWe will motivate these features through examples of increasing\r\ncomplexity, including a simple DSL for working with JSON data.\r\n\r\nParticipants will leave with a basic understanding of how to build\r\nsyntax extensions with the two systems, including how to run the tool,\r\nhow to work with the host language syntax trees using quotations and\r\nantiquotations, and how to define new quotations to extend the host\r\nlanguage.\r\n## Audience\r\nParticipants should be familiar with either OCaml or Haskell, but we\r\nwill assume no prior knowledge of Template Haskell or Camlp4. It would\r\nbe helpful to know the basics of parsing (lexing vs. parsing, abstract\r\nsyntax trees, recursive descent) and be familiar with at least one\r\nparser generator.\r\n## Software prerequisites\r\nParticipants should have recent versions of Objective Caml and the\r\nHaskell Platform installed.  Objective Caml is available here:\r\n\r\n[`http://caml.inria.fr/download.en.html`](http://caml.inria.fr/download.en.html)\r\n\r\nThe Haskell platform is available here:\r\n\r\n[`http://hackage.haskell.org/platform/`](http://hackage.haskell.org/platform/)\r\n## [Jake Donham](http://jaked.org/)\r\nis the author of several OCaml free\r\nsoftware projects, and blogs about OCaml at Ambassador to the\r\nComputers. Jake previously spoke about the ocamljs project at CUFP\r\n2008.\r\n\r\n## Nicolas Pouillard\r\nWhen learning programming in the engineering school of EPITA in Paris,\r\nNicolas Pouillard first met meta-programming using Camlp4 for very\r\nbasic syntax extensions, C++ templates and program transformation\r\nusing Stratego/XT.  Then he entered the research team of Xavier Leroy\r\nat INRIA. He first spent six months as an intern for the renovation of\r\nCamlp4 under the direction of Michel Mauny.  He continued with him by\r\naccepting an engineer job on a project joint with Intel.  During this\r\ncontract he worked on a new front-end (written in OCaml) for their\r\nin-house functional language featuring overloading and\r\nmeta-programming facilities.  During these months he also learned\r\nHaskell and in particular meta-programming through Template Haskell.\r\nFinally he continued as a PhD on "Safer and more expressive languages\r\nfor meta-programming" directed by Francois Pottier.  In this work we\r\naim at leveraging safety features like strong typing and lexical\r\nscoping to manipulated programs within a meta-programming language.\r\n\r\n', '## Abstract\r\n"Static metaprogramming" is compile-time code analysis and\r\nsynthesis. It has many applications, such as (from simple to complex):\r\ndefining abbreviations, generating boilerplate from type definitions,\r\nextending the language syntax, and embedding DSLs.\r\n\r\nStatic metaprogramming is supported for Haskell with Template Haskell,\r\nand for OCaml with Camlp4; the two systems have a lot in common. In\r\nthis tutorial we will work through examples in both languages,\r\nsticking mostly to their commonalities.', '', 1280147105, 1),
(245, 245, 1, 'CUFP 2010 Tutorials ', 'The first day of CUFP 2010 - Friday, October 1, 2010 - will feature\r\nsix specifically selected exciting hands-on tutorials on topics of\r\ninterest to professional software developers.  The day features two\r\nsessions with three concurrent tutorials each.\r\n\r\n## Morning session\r\n\r\n- [Clojure Tutorial (Aaron Bedra)](http://cufp.org/conference/sessions/2010/clojure-tutorial-aaron-bedra)\r\n- [Building robust servers with Erlang (Martin Logan)](http://cufp.org/conference/sessions/2010/building-robust-servers-erlang-martin-logan)\r\n- [High-Performance Haskell (Johan Tibell)](http://cufp.org/conference/sessions/2010/high-performance-haskell-johan-tibell)\r\n\r\n## Afternoon session\r\n\r\n- [F# 2.0 - A day at the beach (Rick Minerich)](http://cufp.org/conference/sessions/2010/f-20-day-beach-rick-minerich)\r\n- [Implementing web sites with Scala and Lift (David Pollak)](http://cufp.org/conference/sessions/2010/implementing-web-sites-scala-and-lift-david-pollak)\r\n- [Camlp4 and Template Haskell (Nicolas Pouillard, Jake Donham)](http://cufp.org/conference/sessions/2010/camlp4-and-template-haskell-nicolas-pouillard-jake)\r\n', 'The first day of CUFP 2010 - Friday, October 1, 2010 - will feature\r\nsix specifically selected exciting hands-on tutorials on topics of\r\ninterest to professional software developers.', '', 1280157343, 1),
(246, 246, 39, 'CUFP 2010 Tutorials schedule is up', 'The schedule for the CUFP 2010 Tutorials on Friday, Oct. 1, is now [online](http://cufp.org/cufp-2010-tutorials)!\r\n\r\nThere will be six specifically selected exciting hands-on tutorials on topics of\r\ninterest to professional software developers.  The day features two\r\nsessions with three concurrent tutorials each:\r\n\r\n## Morning session\r\n\r\n- [Clojure Tutorial (Aaron Bedra)](http://cufp.org/conference/sessions/2010/clojure-tutorial-aaron-bedra)\r\n- [Building robust servers with Erlang (Martin Logan)](http://cufp.org/conference/sessions/2010/building-robust-servers-erlang-martin-logan)\r\n- [High-Performance Haskell (Johan Tibell)](http://cufp.org/conference/sessions/2010/high-performance-haskell-johan-tibell)\r\n\r\n## Afternoon session\r\n\r\n- [F# 2.0 - A day at the beach (Rick Minerich)](http://cufp.org/conference/sessions/2010/f-20-day-beach-rick-minerich)\r\n- [Implementing web sites with Scala and Lift (David Pollak)](http://cufp.org/conference/sessions/2010/implementing-web-sites-scala-and-lift-david-pollak)\r\n- [Camlp4 and Template Haskell (Nicolas Pouillard, Jake Donham)](http://cufp.org/conference/sessions/2010/camlp4-and-template-haskell-nicolas-pouillard-jake)\r\n\r\n\r\nSee you in Baltimore!', 'The schedule for the CUFP 2010 Tutorials on Friday, Oct. 1, is now [online](http://cufp.org/cufp-2010-tutorials)!\r\n\r\nThere will be six specifically selected exciting hands-on tutorials on topics of\r\ninterest to professional software developers.', '', 1280147526, 1),
