(280, 280, 21, 'Scaling Scala at Twitter', 'Rockdove is the backend service that powers the geospatial features on\r\nTwitter.com and the Twitter API ("Twitter Places"). It provides a\r\ndatastore for places and a geospatial search engine to find them. To\r\nthrow out some buzzwords, it is:\r\n\r\n- a distributed system\r\n- realtime (immediately indexes updates and changes)\r\n- horizontally scalable\r\n- fault tolerant\r\n\r\nRockdove is written entirely in Scala and was developed by 2 engineers\r\nwith no prior Scala experience (nor with Java or the JVM). We think\r\nthe geospatial search engine provides an interesting case study as it\r\npresents a mix of algorithm problems and "classic" scaling and\r\noptimization issues. We will report on our experience using Scala,\r\nfocusing especially on:\r\n\r\n- "functional" systems design\r\n- concurrency and parallelism\r\n- using a "research language" in practice\r\n- when, where and why we turned the "functional dial"\r\n- avoiding mutable state\r\n', 'Rockdove is the backend service that powers the geospatial features on\r\nTwitter.com and the Twitter API ("Twitter Places"). It provides a\r\ndatastore for places and a geospatial search engine to find them. To\r\nthrow out some buzzwords, it is:\r\n\r\n- a distributed system\r\n- realtime (immediately indexes updates and changes)\r\n- horizontally scalable\r\n- fault tolerant\r\n\r\nRockdove is written entirely in Scala and was developed by 2 engineers\r\nwith no prior Scala experience (nor with Java or the JVM).', '', 1280484379, 1),
(281, 281, 21, 'Cryptol, a DSL for Cryptographic Algorithms', 'Cryptol is a domain-specific functional language designed by Galois,\r\nInc in collaboration with the the NSA for specifying cryptographic\r\nalgorithms. The Cryptol language includes native support for arbitrary\r\nsized words, a strong type-system based on Hindley-Milner style\r\npolymorphism extended with arithmetic size constraints, and the\r\nability to generate proof-objects throughout the compiler toolchain to\r\nprovide correctness evidence that can be independently verified. In\r\naddition, high-level specification is fully executable. The\r\naccompanying toolset provides a rich set of translators that can\r\nproduce both hardware and software implementations for a variety of\r\ntarget platforms. In addition, the toolset can generate formal models\r\nrepresenting the specification and an implementation, whether\r\nautomatically generated from the Cryptol specification or written\r\nindependently, and show that the two models are functionally\r\nequivalent.\r\n\r\nA team of developers from Rockwell Collins, Inc. and Galois, Inc. has\r\nsuccessfully produced high-speed embedded Cryptographic Equipment\r\nApplications (CEAs), automatically generated from high-level\r\nspecifications. These high-speed CEA implementations comprise a\r\nmixture of software code and VHDL, and target a compact new embedded\r\nplatform designed by Rockwell Collins. Automated formal methods prove\r\nthat algorithm implementations faithfully implement their high-level\r\nspecifications.\r\n\r\nCryptol''s high-level approach to hardware implementation does not come\r\nat the expense of performance. For instance, an algorithm core\r\ngenerated from a Cryptol specification for AES-256 and running in\r\nElectronic Codebook mode demonstrated throughput in excess of 16\r\nGbps. When feedback from the output stage to the input was introduced,\r\nthereby defeating the advantage gained by "unrolling" AES rounds,\r\nencryption performance for AES-256 still exceeded 1 Gbps, while\r\nconsuming less than 2% of the available programmable logic for the\r\nalgorithm core.\r\n\r\nSignificantly, the Rockwell Collins/Galois team was able to design,\r\nimplement, simulate, integrate, analyze, and test a complex CEA on the\r\nnew hardware, including AES-256 and Galois Counter Mode (GCM), in less\r\nthan 3 months, significantly reducing the usual time to produce a new\r\ndesign on a new platform.\r\n', 'Cryptol is a domain-specific functional language designed by Galois,\r\nInc in collaboration with the the NSA for specifying cryptographic\r\nalgorithms. The Cryptol language includes native support for arbitrary\r\nsized words, a strong type-system based on Hindley-Milner style\r\npolymorphism extended with arithmetic size constraints, and the\r\nability to generate proof-objects throughout the compiler toolchain to\r\nprovide correctness evidence that can be independently verified. In\r\naddition, high-level specification is fully executable.', '', 1280483504, 1),
(282, 282, 21, 'Naïveté vs. Experience - or, How We Thought We Could Use Scala and Clojure, and How We Actually Did', 'This talk will discuss the use of Scala and Clojure in an ongoing software project, now 2-years old.  The talk will start with an anecdote about how each language\r\nwas pitched to the software team composed of programmers with very little to no prior experience with functional programming.  The actual Scala pitch will be\r\ndissected and criticized and then distilled into a few general thoughts on how to make an effective functional language pitch.\r\n\r\nWith these tangential matters out of the way, a description of the difficulties ramping up to the full use of Scala will be discussed, followed by a simplified\r\ndescription of the system developed.  The talk will briefly cover the conceptual hurdles that the team experienced when changing from a purely object-oriented\r\nmindset to a more functional approach.  Additionally, the talk will focus on how Clojure was used for ancillary functionality and tooling.  The difficulties\r\nexperienced, both technical and cultural, in introducing Clojure into the mainline source will then be covered.\r\n\r\nTo wind down, the advantages and disadvantages, both real and perceived, between the use of both languages in a commercial setting will be explored.  Finally, the\r\nlessons learned after 2 years will be contrasted with the initial pitch to see where experience and naïveté intersected.\r\n', 'This talk will discuss the use of Scala and Clojure in an ongoing software project, now 2-years old.  The talk will start with an anecdote about how each language\r\nwas pitched to the software team composed of programmers with very little to no prior experience with functional programming.', '', 1280482970, 1),
(283, 283, 13, 'Reactive Extensions (Rx): Curing Your Asynchronous Programming Blues', 'Asynchronous, event-driven "reactive" programming is way too hard in today''s world of development tools and frameworks. The huge amount of manual and error-prone plumbing leads to incomprehensible and hard to maintain code. As we reach out to services in the cloud, the desire for asynchronous computation is ever increasing, requiring a fresh look on the problems imposed by reactive programming. Centered around the concept of observable data sources, Rx provides a framework that takes care of the hard parts of reactive programming. Instead of focusing on the hard parts, you now can start dreaming about the endless possibilities of composing queries over asynchronous data sources, piggybacking on convenient LINQ syntax. In this session, we''ll cover the design philosophy of Rx, rooted on the deep duality between the interactive IEnumerable interface and the new reactive IObservable interface in .NET 4. From this core understanding, we''ll start looking at various combinators and operators defined over observable collections, as provided by Rx, driving concepts home by a bunch of samples. Finally, if time permits, we''ll look at the Reactive Extensions for JavaScript which allows us to take the concepts we already know from Rx and apply them to JavaScript and have deep integration with libraries such as jQuery.  Democratizing asynchronous programming starts today. Don''t miss out on it!', 'Asynchronous, event-driven "reactive" programming is way too hard in today''s world of development tools and frameworks. The huge amount of manual and error-prone plumbing leads to incomprehensible and hard to maintain code. As we reach out to services in the cloud, the desire for asynchronous computation is ever increasing, requiring a fresh look on the problems imposed by reactive programming. Centered around the concept of observable data sources, Rx provides a framework that takes care of the hard parts of reactive programming.', '', 1280685301, 1),
(284, 284, 21, 'Eden: An F#/WPF framework for building GUI tools', 'Our group within Credit Suisse is responsible for developing\r\nquantitative models used to value financial products within the\r\nSecurities Division of the bank. One aspect of this role is to deliver\r\ntools based on those models to trading and sales staff, which they can\r\nuse to quickly price proposed transactions and perform other analysis of\r\nmarket conditions.  Historically these tools have been delivered as\r\nExcel spreadsheets.\r\n\r\nWPF (Windows Presentation Foundation) is a GUI framework which\r\nencourages architectural separation between the layout of the user\r\ninterface itself (the "View") and the underlying interactions and\r\ncalculations (the "ViewModel" and "Model").  We have built a framework\r\nfor developing tools in WPF that makes use of a graph-based calculation\r\nengine for implementing ViewModels and Models in F#. The engine is built\r\non F# asynchronous workflows and provides a standard set of features to\r\nour tools. In this talk I''ll discuss the implementation of this\r\ncalculation engine, including various steps in its evolution that led up\r\nto our use of asynchronous workflows. I''ll also talk about how well F#\r\nand asynchronous workflows have worked for us, and briefly discuss some\r\nof the challenges of integrating F# and WPF.\r\n', 'Our group within Credit Suisse is responsible for developing\r\nquantitative models used to value financial products within the\r\nSecurities Division of the bank. One aspect of this role is to deliver\r\ntools based on those models to trading and sales staff, which they can\r\nuse to quickly price proposed transactions and perform other analysis of\r\nmarket conditions.', '', 1280484747, 1),
(285, 285, 21, 'Functional Language Compiler Experiences at Intel', 'For five years Intel''s Programming Systems Lab (PSL) has been\r\ncollaborating with an external partner on a new functional programming\r\nlanguage designed for productivity on many-core processors.  While the\r\nlanguage is not yet public, this talk outlines motivations behind the\r\nlanguage and describes our experiences in implementing it using a\r\nvariety of functional languages.  The reference interpreter is written\r\nin Haskell and compiled with GHC while PSL''s performance\r\nimplementation is written in SML and compiled with Mlton.  We have\r\nalso generated Scheme code compiled with PLT Scheme as part of a\r\nprototyping effort.\r\n\r\nAt several points, the project has had several contributors that did\r\nnot have a background in functional languages working on the compiler\r\nand on writing benchmarks.  We describe their experiences working in\r\nSML and with functional languages in general.  Specifically:\r\n\r\n- what they liked and disliked about using functional languages\r\n- what was easy and hard about learning and using functional languages\r\n- what worked/didn''t work for helping them learn to program in functional languages\r\n- which functional features they used and didn''t use\r\n- general observations about the code that they wrote\r\n- what (if anything) they took away from the experience\r\n\r\nA design principle of the implementation effort was to by default\r\navoid the use of imperative features.  Previous experience and review\r\nof the literature suggested that many parts of a compiler could be\r\nwritten as well or better using primarily functional code, but that\r\nrestricting ourselves entirely to the functional fragment of SML was\r\nprobably not reasonable.  We describe our experiences with this, and\r\nthe tradeoffs that we encountered.  Specifically:\r\n\r\n- During the project we experimented with both immutable and mutable\r\n  intermediate representations (IRs).  We describe and motivate\r\n  some of the scenarios where we used one or the other, explain our\r\n  experiences with this, and describe cases where we feel that we made\r\n  an inappropriate initial choice.\r\n- We chose to avoid all global mutable state in the compiler.  Most\r\n  notably, symbol tables and global configuration information are\r\n  always passed explicitly as parameters to parts of the compiler that\r\n  require them.  This choice had benefits and costs, and we discuss\r\n  our experience with this.\r\n\r\nWe also describe some of the features of SML that we found useful, and\r\ndiscuss some of the lack of features and quirks of SML that annoyed\r\nus.  Specifically:\r\n\r\n- We discuss places where we encountered limitations in the\r\n  module system.  These include the lack of uniformity between the\r\n  signature and structure language, and the lack of recursive modules.\r\n- We describe some of the ways in which we believe that better\r\n  syntactic support could have lessened the programming burden,\r\n  especially with respect to attempting to be purely functional.\r\n  Examples of this include a type class mechanism and/or monadic\r\n  syntax to lessen the burden of passing around explicit state, better\r\n  syntactic support for using the imperative features of the language,\r\n  and better support for custom control operators.\r\n', 'For five years Intel''s Programming Systems Lab (PSL) has been\r\ncollaborating with an external partner on a new functional programming\r\nlanguage designed for productivity on many-core processors.  While the\r\nlanguage is not yet public, this talk outlines motivations behind the\r\nlanguage and describes our experiences in implementing it using a\r\nvariety of functional languages.  The reference interpreter is written\r\nin Haskell and compiled with GHC while PSL''s performance\r\nimplementation is written in SML and compiled with Mlton.', '', 1285618103, 1),
(286, 286, 21, 'Riak Core: Building Distributed Applications Without Shared State', 'Storing big data reliably is hard. Searching that data is just as\r\nhard.  Basho Technologies, the company behind Riak KV and Riak Search,\r\nfocuses on solving these two problems.\r\n\r\nBoth Riak KV (a key-value datastore and map/reduce platform) and Riak\r\nSearch (a Solr-compatible full-text search and indexing engine) are\r\nbuilt around a library called Riak Core that manages the mechanics of\r\nrunning a distributed application in a cluster without requiring a\r\ncentral coordinator or shared state. Using Riak Core, these\r\napplications can scale to hundreds of servers, handle enterprise-sized\r\namounts of data, and remain operational in the face of server\r\nfailure.* This talk will describe the implementation,\r\nresponsibilities, and boundaries of Riak Core, including how Riak\r\nCore:\r\n\r\n* Divides the data- or computing-domain of your application into\r\n  separate virtual nodes located on different physical servers.\r\n* Distributes data and operations to the correct virtual nodes within\r\n  the cluster.\r\n* Dynamically re-shapes the cluster without requiring a central\r\n  coordinator when nodes enter, leave, crash, slow down, or go dark.\r\n* Provides the Erlang community with a solid platform for creating\r\n  other distributed applications.\r\n\r\nSpecial attention will be paid to how Riak Core adopts common functional\r\nprogramming patterns and leverages OTP/Erlang libraries and behaviours.\r\n', 'Storing big data reliably is hard. Searching that data is just as\r\nhard.  Basho Technologies, the company behind Riak KV and Riak Search,\r\nfocuses on solving these two problems.\r\n\r\nBoth Riak KV (a key-value datastore and map/reduce platform) and Riak\r\nSearch (a Solr-compatible full-text search and indexing engine) are\r\nbuilt around a library called Riak Core that manages the mechanics of\r\nrunning a distributed application in a cluster without requiring a\r\ncentral coordinator or shared state.', '', 1280484170, 1),
(287, 287, 21, 'Functional Programming at Freebase', 'Freebase is a community-built, online database of facts and information, developed by Metaweb Technologies in San Francisco, California [1]. Freebase uses a proprietary graph database technology to store and query a network of over 12 million interrelated topics involving several hundred million individual graph relations. Third-party applications are free to query and update the Freebase database, and do so using the Metaweb Query Language, MQL [2]. MQL queries are expressed with a JSON-based template language which makes them easy to integrate into web applications, particularly the client-side portion which is processed with JavaScript?.\r\n\r\nMetaweb''s first-generation MQL implementation was written as a Python-based middle-tier application that dynamically translates JSON-based queries into a low-level proprietary graph query language and networking protocol [3]. The low-level query language was designed for efficiency rather than for direct usability, and significant effort is required to translate between the two languages. Analysis of the entire Freebase application stack has revealed that as much time was being spent in the MQL query and result translation process as was being spent actually resolving the low-level graph queries. Much of this was attributed to the memory-intensive architecture of the translator, but a large portion was attributed to overhead inherent in the Python 2.6 runtime.\r\n\r\nWe have undertaken developing a second-generation MQL translator written in Ocaml and drawing on a number of pure functional techniques. The core language translation process is expressed in terms of embedded language that implements the graph query protocol. This embedded language is used for both for static queries, e.g. for schema lookups, and for expressing the dynamic translation of MQL queries. The translator operates as a server and uses Lwt (Lightweight Threads library [4]) to interleave both client and graph database requests. A web services API and monitoring console have been developed using the Ocsigen web server and associated Eliom infrastructure [5].\r\n\r\nThe performance of our reimplemented MQL translator service is very encouraging. One process can sustain over an order of magnitude more simultaneous MQL requests, and service each request in a small fraction of the time consumed by the Python implementation. Moreover, due to the asynchronous nature of the underlying Lwt I/O subsystem, a single processor core can handle several times the capacity of an entire multi-core server machine running the former Apache/WSGI/Python [6] infrastructure.\r\n\r\nIn addition to describing the MQL translator system, I would like to discuss the underlying mechanism by which it batches fragments of I/O requests together into single larger protocol messages, thereby minimizing communication overhead with the underlying graph database. This technique closely resembles monads typically used in functional programming, but also provides some of the benefits of ''arrows'' [7].\r\n\r\n* [1] http://freebase.com\r\n* [2] http://mql.freebaseapps.com/\r\n* [3] http://research.freebase.com/sigmod692-meyer.pdf\r\n* [4] http://ocsigen.org/lwt\r\n* [5] http://ocsigen.org/eliom/\r\n* [6] http://www.wsgi.org/wsgi/\r\n* [7] http://www.cs.chalmers.se/~rjmh/Papers/arrows.pdf ', 'Freebase is a community-built, online database of facts and information, developed by Metaweb Technologies in San Francisco, California [1]. Freebase uses a proprietary graph database technology to store and query a network of over 12 million interrelated topics involving several hundred million individual graph relations. Third-party applications are free to query and update the Freebase database, and do so using the Metaweb Query Language, MQL [2].', '', 1280485342, 1);
