(288, 288, 21, 'ACL2: Eating One''s Own Dogfood', 'We are using the ACL2 theorem-proving system for formally verifying\r\nproperties of the X86-compatible, 64-bit VIA Nano microprocessor.  To\r\nvalidate Nano circuit models, we translate its Verilog into our\r\nformally defined HDL.  We write specifications in the ACL2 logic, and\r\nmechanically verify HDL descriptions using the ACL2 theorem prover to\r\norchestrate the use of BDDs, AIGs, SAT, symbolic simulations\r\ntechniques, and the theorem prover itself.  Our system has been\r\nintegrated into the Centaur design toolflow; this includes rapid and\r\nregular translation of the Nano design into our framework and daily\r\nregression runs.\r\n\r\nOur tools are written in ACL2, which is itself a functional language.\r\nFor instance, our BDD package is written in ACL2 and has been proven\r\ncorrect using the ACL2 theorem prover -- likewise so is our AIG\r\npackage and many other tools.  Our symbolic simulation system for the\r\nentire ACL2 logic is also written in ACL2, and it has been verified by\r\nthe ACL2 theorem prover.  In fact, the entire ACL2 system is written\r\nin the ACL2 language.  ACL2 is in commercial use by a number of\r\ncompanies, including AMD, Centaur, IBM, and Microsoft.\r\n\r\nWe believe the FP community should consider the same operational\r\nparadigm.  In fact, we challenge the FP community to write analysis\r\ntools for their functional programs in their own programing languages.\r\nThis kind of "eating one''s own dog food" tends to make one''s system\r\nbetter.  Our combined ACL2/CAD system may be the world''s largest\r\nfunctional program as the source code exceeds five megabytes.  Without\r\nour associated mechanical verification system, we couldn''t begin to\r\nmanage the complexity we have created.  We have wondered if we could\r\napply our tools to other functional languages.\r\n\r\n', 'We are using the ACL2 theorem-proving system for formally verifying\r\nproperties of the X86-compatible, 64-bit VIA Nano microprocessor.  To\r\nvalidate Nano circuit models, we translate its Verilog into our\r\nformally defined HDL.  We write specifications in the ACL2 logic, and\r\nmechanically verify HDL descriptions using the ACL2 theorem prover to\r\norchestrate the use of BDDs, AIGs, SAT, symbolic simulations\r\ntechniques, and the theorem prover itself.', '', 1280485530, 1),
(269, 269, 39, 'Clojure Tutorial', 'In this tutorial you will spend some time learning about what clojure\r\nhas to offer and build an application that solves a real world\r\nproblem. In this tutorial pair programming is welcome and encouraged!\r\nBring a friend to help you work through the exercises and to bounce\r\nideas off of.\r\n\r\n### Introduction\r\n- Clojure''s Elevator Pitch\r\n- Diving into the Syntax\r\n\r\nIn the introduction you will learn key features of the clojure\r\nlanguage and learn how to read and understand the syntax at the basic levels.\r\n\r\n### Starting the Application\r\n- Diving into the problem\r\n- Dealing with the data\r\n- An introduction to Incanter\r\n\r\nAfter getting the initial problem, attendees will be introduced to a\r\nreal world scenario that involves data processing. They will be given\r\na data stream that cannot be modified and will have to write some\r\ntransformation code to handle and process the data. Attendees will\r\nalso have to produce some simple statistics on the data.  This\r\nsection will deal with experimentation on the clojure repl and trying\r\nout new ideas that address the problem.\r\n\r\n### Building the Application\r\n- Making the ideas into concrete functions\r\n- Handling dependencies\r\n- Packaging and building\r\n- Polish\r\n\r\nAfter walking through experiments on the repl, attendees will wrangle\r\nthe ideas into a real application. They will learn how to structure a\r\nclojure application and learn how to write clojure in an idomatic\r\nway. At this time bonus challenges will be offered to those who have\r\ncompleted the exercise, and assistance to those who are still working\r\nthrough them.\r\n', 'In this tutorial you will spend some time learning about what clojure\r\nhas to offer and build an application that solves a real world\r\nproblem.', '', 1282403059, 1),
(312, 312, 1, 'Rick Minerich - Profile 312', '<p>My Event and Project Blog: http://richardminerich.com</p><p>F# Discoveries This Week: http://www.atalasoft.com/cs/blogs/rickm/</p>', '', '', 1289352757, 1),
(274, 274, 39, 'Implementing web sites with Scala and Lift', 'Lift is a Web framework in the vein of [Seaside](http://www.seaside.st/) and\r\n[WebObjects](http://developer.apple.com/tools/webobjects). Lift is built on\r\nScala, a functional/OO hybrid lanugage that runs on the Java Virtual\r\nMachine.\r\n\r\nIn contrast to frameworks oriented around the model-view-controller (MVC)\r\npattern, Lift abstracts the HTTP request~response cycle rather than wrapping\r\nHTTP concepts in APIs.  Lift makes use of Scala''s functional abstractions in\r\na way that allows composition of applications.\r\n\r\nIn this tutorial, we will build a multiuser, real-time chat application in\r\nLift and discuss Scala''s language features that make Lift possible.\r\n', 'Lift is a Web framework in the vein of [Seaside](http://www.seaside.st/) and\r\n[WebObjects](http://developer.apple.com/tools/webobjects). Lift is built on\r\nScala, a functional/OO hybrid lanugage that runs on the Java Virtual\r\nMachine.\r\n\r\nIn contrast to frameworks oriented around the model-view-controller (MVC)\r\npattern, Lift abstracts the HTTP request~response cycle rather than wrapping\r\nHTTP concepts in APIs.', '', 1282403180, 1),
(275, 275, 39, 'Camlp4 and Template Haskell', '"Static metaprogramming" is compile-time code analysis and\r\nsynthesis. It has many applications, such as (from simple to complex):\r\ndefining abbreviations, generating boilerplate from type definitions,\r\nextending the language syntax, and embedding DSLs.\r\n\r\nStatic metaprogramming is supported for Haskell with Template Haskell,\r\nand for OCaml with Camlp4; the two systems have a lot in common. In\r\nthis tutorial we will work through examples in both languages,\r\nsticking mostly to their commonalities. We will also say a little\r\nabout features which are unique to each.\r\n\r\nThe main features we will cover are:\r\n\r\n * host language syntax trees\r\n * quotations / antiquotations for host language syntax trees\r\n * defining new quotations\r\n * pragmatics of each tool\r\n\r\n(Quotations / antiquotations are a mechanism for working with host\r\nlanguage abstract syntax trees using the concrete syntax of the host\r\nlanguage.)\r\n\r\nWe will motivate these features through examples of increasing\r\ncomplexity, including a simple DSL for working with JSON data.\r\n\r\nParticipants will leave with a basic understanding of how to build\r\nsyntax extensions with the two systems, including how to run the tool,\r\nhow to work with the host language syntax trees using quotations and\r\nantiquotations, and how to define new quotations to extend the host\r\nlanguage.\r\n', '"Static metaprogramming" is compile-time code analysis and\r\nsynthesis. It has many applications, such as (from simple to complex):\r\ndefining abbreviations, generating boilerplate from type definitions,\r\nextending the language syntax, and embedding DSLs.\r\n\r\nStatic metaprogramming is supported for Haskell with Template Haskell,\r\nand for OCaml with Camlp4; the two systems have a lot in common. In\r\nthis tutorial we will work through examples in both languages,\r\nsticking mostly to their commonalities.', '', 1285866437, 1),
(289, 289, 1, 'Sally Browning - Profile 289', 'Dr. Sally A Browning leads the Cryptol family of projects at Galois. She has a BS in Mathematics and Computer Science from the University of Oregon, and a MS and PhD in Computer Science from the California Institute of Technology. Her thesis, thesis, “The tree machine: a highly parallel architecture for VLSI” with Dr. Carver Mead was an early example of trading space for time in mapping hard problems to hardware. Before joining Galois in 2006, she was part of the Computer Science Research Center (the home of Unix) at Bell Labs, employee #11 at Silicon Graphics, and an independent consultant. In addition she has taught computer science classes at University of Oregon, Caltech, and Oregon Graduate Institute, and art appreciation to elementary and middle school students.', 'Dr. Sally A Browning leads the Cryptol family of projects at Galois. She has a BS in Mathematics and Computer Science from the University of Oregon, and a MS and PhD in Computer Science from the California Institute of Technology. Her thesis, thesis, “The tree machine: a highly parallel architecture for VLSI” with Dr. Carver Mead was an early example of trading space for time in mapping hard problems to hardware. Before joining Galois in 2006, she was part of the Computer Science Research Center (the home of Unix) at Bell Labs, employee #11 at Silicon Graphics, and an independent consultant.', '', 1289352852, 1),
(290, 290, 1, 'Rusty Klophaus - Profile 290', 'Rusty Klophaus has a passion for creating simple and elegant solutions to complicated problems with technology. Rusty grew up on a farm, earned a degree in Computer Science from Princeton University, spent a summer in Philadelphia as a professional musician, co-founded a technology consulting company, and has managed multi-million dollar technology projects. At Basho Technologies, Rusty works on the engineering team building Riak, a distributed, scalable datastore built for easy operations, and Riak Search, a distributed indexing and full-text search engine. Rusty also enjoys talking about technology; he has given presentations on Riak, Nitrogen, and other software projects at conferences internationally.<p>Blog: http://rustyklophaus.com/</p>', 'Rusty Klophaus has a passion for creating simple and elegant solutions to complicated problems with technology. Rusty grew up on a farm, earned a degree in Computer Science from Princeton University, spent a summer in Philadelphia as a professional musician, co-founded a technology consulting company, and has managed multi-million dollar technology projects. At Basho Technologies, Rusty works on the engineering team building Riak, a distributed, scalable datastore built for easy operations, and Riak Search, a distributed indexing and full-text search engine.', '', 1289352756, 1),
