(292, 292, 1, 'Erik Meijer - Profile 292', 'Erik Meijer is an architect in the Microsoft SQL server division where he currently works together with the Microsoft Visual C# and the Microsoft Visual Basic language design teams on data integration in programming languages.\r\n\r\nPrior to joining Microsoft he was an associate professor at Utrecht University and adjunct professor at the Oregon Graduate Institute.\r\n\r\nErik is one of the designers of the standard functional programming language Haskell98 and more recently the Cw language.', 'Erik Meijer is an architect in the Microsoft SQL server division where he currently works together with the Microsoft Visual C# and the Microsoft Visual Basic language design teams on data integration in programming languages.\r\n\r\nPrior to joining Microsoft he was an associate professor at Utrecht University and adjunct professor at the Oregon Graduate Institute.\r\n\r\nErik is one of the designers of the standard functional programming language Haskell98 and more recently the Cw language.', '', 1289352950, 1),
(293, 293, 1, 'Howard Mansell - Profile 293', 'Howard Mansell is the Chief Architect of the Quantitative Strategies group at Credit Suisse, the group responsible for derivative trading models and tools.  Howard was first introduced  to functional programming when he learned Miranda at the University of Kent at Canterbury.  After suffering with C++, COM and Excel for several years, Howard introduced functional programming concepts into the Excel environment, by implementing various proprietary extensions.  The popularity of these led the group to embrace functional programming more widely, and ultimately switch mainstream development to F#.   Howard and his team have driven the successful adoption of F# across the group over the last two years, culminating in its use for the developer of GUI tools.', 'Howard Mansell is the Chief Architect of the Quantitative Strategies group at Credit Suisse, the group responsible for derivative trading models and tools.  Howard was first introduced  to functional programming when he learned Miranda at the University of Kent at Canterbury.  After suffering with C++, COM and Excel for several years, Howard introduced functional programming concepts into the Excel environment, by implementing various proprietary extensions.', '', 1289352952, 1),
(294, 294, 1, 'Neal Glew - Profile 294', 'Neal got his BSc with first-class honours in Computer Science from Victoria University of Wellington in 1993 before going to Cornell University in 1994.  There he studied Typed Assembly Language and other PL topics with Greg Morrisett and Dexter Kozen, receiving a PhD for his dissertation on "Low-Level Type Systems for Modularity and Object-Oriented Constructs" in 2000.  In 2000 he went to InterTrust Technologies research lab (StarLab) and worked briefly on code obfuscation and more generally on code transformation technology.  In 2002 he went to Intel''s PSL, part of Intel Labs, where he is today.  He worked on a Java and CLI virtual machine, instruction set specification, various aspects of parallel programming including his current project to build a compiler for a parallel functional language.  He has papers in POPL, PLDI, ICFP, OOPSLA, ECOOP, and various workshops.\r\n', 'Neal got his BSc with first-class honours in Computer Science from Victoria University of Wellington in 1993 before going to Cornell University in 1994.  There he studied Typed Assembly Language and other PL topics with Greg Morrisett and Dexter Kozen, receiving a PhD for his dissertation on "Low-Level Type Systems for Modularity and Object-Oriented Constructs" in 2000.  In 2000 he went to InterTrust Technologies research lab (StarLab) and worked briefly on code obfuscation and more generally on code transformation technology.', '', 1289352952, 1),
