(296, 296, 1, 'Warren Hunt - Profile 296', '  Warren A. Hunt, Jr. is a Professor at the University of\r\n  Texas Computer Science Department.  He teaches formal\r\n  methods and computer architecture, and he investigates\r\n  and develops automated theorem-proving methods and\r\n  computational biology tools.  Dr. Hunt has been active\r\n  in the hardware verification area for over 25 years,\r\n  and he has applied formal verification tools to a\r\n  litany of microprocessor designs:  FM8501, FM8502,\r\n  FM9001, Motorola CAP DSP, FM9801, and VIA Nano.  Dr.\r\n  Hunt has authored a number of articles relating to\r\n  these topics.  Dr.  Hunt is the steering committee\r\n  chairman of the FMCAD Conference series, and he serves\r\n  as an associate editor of the "Formal Methods in System\r\n  Design" journal.\r\n\r\n  Dr. Hunt worked as a Research Staff Member and Manager\r\n  at IBM''s Austin Research Laboratory from 1997 to 2002,\r\n  where he was involved with formal verification and\r\n  high-performance computing as one of the co-directors\r\n  and PIs of IBM''s PERCS project.  From 1986 until 1997,\r\n  he served as Vice President of Hardware Engineering at\r\n  Computational Logic, Inc.  From 1982 until 1985, Hunt\r\n  served as Hardware and Systems Manager for Cyb Systems;\r\n  from 1979 until 1982, he worked for Texas Instruments\r\n  as an Engineer.  Dr. Hunt has a BSEE from Rice\r\n  University and a CS PhD from UT Austin.\r\n', '  Warren A. Hunt, Jr. is a Professor at the University of\r\n  Texas Computer Science Department.  He teaches formal\r\n  methods and computer architecture, and he investigates\r\n  and develops automated theorem-proving methods and\r\n  computational biology tools.  Dr. Hunt has been active\r\n  in the hardware verification area for over 25 years,\r\n  and he has applied formal verification tools to a\r\n  litany of microprocessor designs:  FM8501, FM8502,\r\n  FM9001, Motorola CAP DSP, FM9801, and VIA Nano.  Dr.\r\n  Hunt has authored a number of articles relating to\r\n  these topics.  Dr.', '', 1289352893, 1),
(298, 298, 1, 'CUFP Talks are up', 'The CUFP schedule is now complete!  Go [here](http://cufp.org/conference/schedule/2010) for a complete schedule, including both the talks and the tutorials.  You can also see the abstracts for the talks as well.\r\n\r\nWe had a really impressive set of submissions this year, and we had some very tough choices to make.  We definitely rejected talks that I would love to hear.  We''re very proud of the list of talks we ended up with, and we''re looking forward to a great workshop in October!', 'The CUFP schedule is now complete!  Go [here](http://cufp.org/conference/schedule/2010) for a complete schedule, including both the talks and the tutorials.  You can also see the abstracts for the talks as well.\r\n\r\nWe had a really impressive set of submissions this year, and we had some very tough choices to make.  We definitely rejected talks that I would love to hear.  We''re very proud of the list of talks we ended up with, and we''re looking forward to a great workshop in October!', '', 1280589981, 1),
