(308, 308, 1, 'Martin Logan - Profile 308', 'Martin Logan has been heavily involved with the Erlang community since 1999. Since that time he has had the privilege to work on Erlang full time for over 5 years. Martin’s great interest in distributed systems and service based design has led him to spend much of his career to studying and solving problems in that space. Wherever possible he tries to implement his solutions with Erlang. \r\nCurrently Martin brings his expertise to Orbitz Worldwide, one of the largest online travel companies in the world. There he leads the technical travel business services group developing solutions for their large scale distributed service based infrastructure. Most recently Martin has taken a leadership role with Erlware where he is a core developer and the primary developer of the Faxien package management system.', 'Martin Logan has been heavily involved with the Erlang community since 1999. Since that time he has had the privilege to work on Erlang full time for over 5 years. Martin’s great interest in distributed systems and service based design has led him to spend much of his career to studying and solving problems in that space. Wherever possible he tries to implement his solutions with Erlang. \r\nCurrently Martin brings his expertise to Orbitz Worldwide, one of the largest online travel companies in the world.', '', 1289352950, 1),
