(355, 355, 1, 'Anton Lavrik - Profile 355', 'I work on distributed and scalable data processing systems using Erlang and domain-specific programming languages using OCaml. Areas of interest include query languages, query engines, data definition and data representation languages, cross-language data serialization, better programming tools.\r\n\r\nMy open-source project: http://piqi.org<p>The Piqi Project: http://piqi.org</p>', 'I work on distributed and scalable data processing systems using Erlang and domain-specific programming languages using OCaml. Areas of interest include query languages, query engines, data definition and data representation languages, cross-language data serialization, better programming tools.\r\n\r\nMy open-source project: http://piqi.org', '', 1289352839, 1),
