(2645, 2645, 19, 'Cryptol, a DSL for Cryptographic Algorithms by Sally Browning (Galois)', 'Cryptol is a domain-specific functional language designed by Galois, Inc in collaboration with the the NSA for specifying cryptographic algorithms. The Cryptol language includes native support for arbitrary sized words, a strong type-system based on Hindley-Milner style polymorphism extended with arithmetic size constraints, and the ability to generate proof-objects throughout the compiler toolchain to provide correctness evidence that can be independently verified. In addition, high-level specification is fully executable. The accompanying toolset provides a rich set of translators that can produce both hardware and software implementations for a variety of target platforms. In addition, the toolset can generate formal models representing the specification and an implementation, whether automatically generated from the Cryptol specification or written independently, and show that the two models are functionally equivalent.\r\n\r\nA team of developers from Rockwell Collins, Inc. and Galois, Inc. has successfully produced high-speed embedded Cryptographic Equipment Applications (CEAs), automatically generated from high-level specifications. These high-speed CEA implementations comprise a mixture of software code and VHDL, and target a compact new embedded platform designed by Rockwell Collins. Automated formal methods prove that algorithm implementations faithfully implement their high-level specifications.\r\n\r\nCryptol''s high-level approach to hardware implementation does not come at the expense of performance. For instance, an algorithm core generated from a Cryptol specification for AES-256 and running in Electronic Codebook mode demonstrated throughput in excess of 16 Gbps. When feedback from the output stage to the input was introduced, thereby defeating the advantage gained by "unrolling" AES rounds, encryption performance for AES-256 still exceeded 1 Gbps, while consuming less than 2% of the available programmable logic for the algorithm core.\r\n\r\nSignificantly, the Rockwell Collins/Galois team was able to design, implement, simulate, integrate, analyze, and test a complex CEA on the new hardware, including AES-256 and Galois Counter Mode (GCM), in less than 3 months, significantly reducing the usual time to produce a new design on a new platform.', 'Cryptol is a domain-specific functional language designed by Galois, Inc in collaboration with the the NSA for specifying cryptographic algorithms. The Cryptol language includes native support for arbitrary sized words, a strong type-system based on Hindley-Milner style polymorphism extended with arithmetic size constraints, and the ability to generate proof-objects throughout the compiler toolchain to provide correctness evidence that can be independently verified. In addition, high-level specification is fully executable.', '', 1294656819, 1),
(2646, 2646, 19, 'Scaling Scala at Twitter by Marius Eriksen (Twitter)', 'Rockdove is the backend service that powers the geospatial features on Twitter.com and the Twitter API ("Twitter Places"). It provides a datastore for places and a geospatial search engine to find them. To throw out some buzzwords, it is:\r\n\r\n* a distributed system\r\n* realtime (immediately indexes updates and changes)\r\n* horizontally scalable\r\n* fault tolerant\r\n\r\nRockdove is written entirely in Scala and was developed by 2 engineers with no prior Scala experience (nor with Java or the JVM). We think the geospatial search engine provides an interesting case study as it presents a mix of algorithm problems and "classic" scaling and optimization issues. We will report on our experience using Scala, focusing especially on:\r\n\r\n* "functional" systems design\r\n* concurrency and parallelism\r\n* using a "research language" in practice\r\n* when, where and why we turned the "functional dial"\r\n* avoiding mutable state\r\n', 'Rockdove is the backend service that powers the geospatial features on Twitter.com and the Twitter API ("Twitter Places"). It provides a datastore for places and a geospatial search engine to find them. To throw out some buzzwords, it is:\r\n\r\n* a distributed system\r\n* realtime (immediately indexes updates and changes)\r\n* horizontally scalable\r\n* fault tolerant\r\n\r\nRockdove is written entirely in Scala and was developed by 2 engineers with no prior Scala experience (nor with Java or the JVM).', '', 1294656909, 1),
(2647, 2647, 19, 'F#: Embracing Functional Programming in Visual Studio 2010 by Luke Hoban (Microsoft)', 'Earlier this year, Microsoft released Visual Studio 2010 with full support for the F# functional programming language. In this talk, we will look at what this meant, both technically and non-technically, and some of the interesting aspects of this "productization" of F#. From ways that functional programming languages can be positioned in the broader developer space, to issues like backwards compatibility, localization and tools scalability, we''ll look at some of the practical concerns facing functional programming languages in the commercial software development space.', 'Earlier this year, Microsoft released Visual Studio 2010 with full support for the F# functional programming language. In this talk, we will look at what this meant, both technically and non-technically, and some of the interesting aspects of this "productization" of F#. From ways that functional programming languages can be positioned in the broader developer space, to issues like backwards compatibility, localization and tools scalability, we''ll look at some of the practical concerns facing functional programming languages in the commercial software development space.', '', 1294656972, 1),
(2648, 2648, 19, 'CUFP 2010 Videos now available online', 'The videos of the CUFP 2010 talks are now available for viewing online for free, and cover solving real-world problems by programming in F#, Scala, Clojure, OCaml, SML, Haskell and custom domain-specific languages.  Enjoy!\r\n\r\n* **[F#: Embracing Functional Programming in Visual Studio 2010](http://cufp.org/videos/f-embracing-functional-programming-visual-studio-2010-luke-hoban-mic)** by [Luke Hoban](http://blogs.msdn.com/b/lukeh/) from [Microsoft](http://www.microsoft.com/).\r\n\r\n* **[Scaling Scala at Twitter](http://cufp.org/videos/scaling-scala-twitter-marius-eriksen-twitter)** by [Marius Eriksen](http://monkey.org/~marius/) from [Twitter](http://twitter.com)\r\n\r\n* **[Cryptol, a DSL for Cryptographic Algorithms](http://cufp.org/videos/cryptol-dsl-cryptographic-algorithms-sally-browning-galois)** by [Sally Browning](http://corp.galois.com/sally-browning/) from [Galois](http://www.galois.com)\r\n\r\n* **[Naïveté vs. Experience – or, How We Thought We Could Use Scala and Clojure and How We Actually Did](http://cufp.org/videos/naïveté-vs-experience-–-or-how-we-thought-we-could-use-scala-and-clo)** by [Michael Fogus](http://blog.fogus.me/) from [SAIC](http://www.saic.com).\r\n\r\n* **[Functional Language Compiler Experiences](http://cufp.org/videos/functional-language-compiler-experiences-intel-neal-glew-intel)** by Neal Glew at [Intel](http://www.intel.com).\r\n\r\n* **[Functional Programming at Freebase](http://cufp.org/videos/functional-programming-freebase-warren-harris-metaweb)** by Warren Harris from Metaweb (now part of [Google](http://www.google.com))', 'The videos of the CUFP 2010 talks are now available for viewing online for free, and cover solving real-world problems by programming in F#, Scala, Clojure, OCaml, SML, Haskell and custom domain-specific languages.', '', 1294658344, 1),
