(3087, 3087, 0, 'Anthony Graham - Profile ', 'I recruit for these guys, and they are always on the look out for exceptional functional programming talent. If you are interested in talking to these guys, please drop me a line on 07792285102 or email me anthonygraham1@gmail.com\r\n\r\nGAMBIT RESEARCH\r\nCompany \r\n- Sell themselves as a Hedge Fund in all but name. Building predictive tools to exploit inefficiencies in the market. No manual input. All automated so no traders. Hedging bets in a ‘quasi arbitrage’ fashion.\r\n\r\n- Their software (Molotov II), which they sell to customers, essentially bets huge sums of money (e.g. c£500,000) on a single result. Primarily football. \r\n\r\n- Currently they only “trade” in order to hedge their risk, therefore they do not take an opinion on any results (i.e. they do not “bet” on a win or loss). The next step in their plan is to start taking an opinion through the use of algorithms, which is why they hire the quants. \r\n\r\n- The customer can’t use one bookmaker as (a) they wouldn’t be allowed take such a large bet and (b) it would collapse the odds and distort the market. As such, they spread the £500,000 across multiple bookmakers in smaller chunks which will go unnoticed. It is a smart order router, just like a bank may employ. \r\n\r\n- Focus Market is predominantly Asia as it’s the worlds biggest. Also it’s tighter with better prices on results. They are Betfair’s biggest customer on the Football markets. Their product, Molotov II, executes these trades on Football results. They get information very rapidly i.e. price updates 3-4 time per second from around the globe! This is crucial to making them successful.\r\n\r\n- 1 million individual bets per month. Turnover is £130 million per month. Company has no debt. They recycle their capital. 40 people presently in the company. \r\n\r\nHow it works: \r\n\r\nLarge bookmakers e.g. Spobet, give credit to Brokers (say around £400 million) who bet on behalf of customers (Gambit being one of them). As such, the risk is not on them, it’s on the Brokers. Gambit sells their software to other customers. \r\n\r\nThey are currently in a good position because they can start taking an opinion on results, which is where the big short term money is. Alternatively, they can join one of the many exchanges that are approaching them to fix their price discrepancies that are costing them money, because so far they are the best at exploiting them. \r\n\r\n\r\nQuant/Technology: \r\n\r\n•	Developers “scrape” all of the odds of all the major betting websites, creating Gambits mega-exchange. To put it in perspective, this exchange is bigger than Betfairs. This removes liquidity in the market and they then place high level bets accordingly. \r\n\r\n•	Developers are very good (high paced scripting + functional programming in Python, erlang, haskel etc) and mathematically competent. It’s a bit like Getco in that they wear a number of hats i.e. involved in coding, support, testing, engineering etc. Work is on the Core Systems Framework or Servers/proxies/Web side. \r\n\r\n•	The Quants will basically use statistics and analysis to identify the games to put these bets on i.e. where there is the lowest risk of losing\r\n\r\n\r\nClients: Samvo, Ladbrokes, Betfair, William Hill, Sbobet (world’ largest betting company) etc \r\n\r\n\r\nSell \r\n- No direct competitors, market leaders. \r\n- Work their own hours\r\n- Great bonuses \r\n- Relaxed (no suits)\r\n\r\n', 'I recruit for these guys, and they are always on the look out for exceptional functional programming talent. If you are interested in talking to these guys, please drop me a line on 07792285102 or email me anthonygraham1@gmail.com\r\n\r\nGAMBIT RESEARCH\r\nCompany \r\n- Sell themselves as a Hedge Fund in all but name. Building predictive tools to exploit inefficiencies in the market. No manual input. All automated so no traders. Hedging bets in a ‘quasi arbitrage’ fashion.\r\n\r\n- Their software (Molotov II), which they sell to customers, essentially bets huge sums of money (e.g.', '', 1304594087, 1),
