(2870, 2870, 0, 'Natarajan Shankar - Profile ', 'At SRI, we have developed several verification tools that use functional programming.  PVS is an interactive theorem prover developed using CLOS.  SAL is a model checking environment built using Scheme.  PVS has a functional programming subset with modules, subtyping, and dependent typing, and a code generator that can generate efficient Lisp and Clean code.  These tools, along with the Yices solver for satisfiability modulo theories, have many commercial users.  ', 'At SRI, we have developed several verification tools that use functional programming.  PVS is an interactive theorem prover developed using CLOS.  SAL is a model checking environment built using Scheme.  PVS has a functional programming subset with modules, subtyping, and dependent typing, and a code generator that can generate efficient Lisp and Clean code.  These tools, along with the Yices solver for satisfiability modulo theories, have many commercial users.  ', '', 1298055330, 1),
