(2918, 2918, 19, '2011 Call for Presentations', '<center>\r\n**Sponsored by SIGPLAN<br>\r\nCo-located with ICFP 2011<br>\r\nTokyo, Japan<br>\r\nSep 22-24<br>\r\nProposal Submission Deadline 15 June 2011<br>**\r\n</center>\r\n<br>\r\n\r\nFunctional programming languages have been a hot topic of academic\r\nresearch for over 35 years, and they have seen an ever larger practical\r\nimpact in settings ranging from tech startups to financial firms to\r\nbiomedical research labs.  At the same time, a vigorous community of\r\nprogrammers employing functional languages has come into existence.\r\n\r\nCUFP is designed to serve this community.  The annual CUFP workshop is\r\na place where people can see how others are using functional\r\nprogramming to solve real world problems; where practitioners meet and\r\ncollaborate; where language designers and users can share ideas about\r\nthe future of their favorite language; and where one can learn\r\npractical techniques and approaches for putting functional programming\r\nto work.\r\n \r\nGiving a CUFP Talk\r\n------------------\r\n \r\nIf you have experience using functional languages in a practical\r\nsetting, we invite you to submit a proposal to give a talk at the\r\nworkshop.  We''re looking for two kinds of talks:\r\n\r\n**Experience reports** are typically 25 minutes long, and aim to inform\r\nparticipants about how functional programming plays out in real-world\r\napplications, focusing especially on lessons learned and insights\r\ngained. Experience reports don''t need to be highly technical;\r\nreflections on the commercial, management, or software engineering\r\naspects are, if anything, more important.\r\n\r\n**Technical talks** are also 25 minutes long, and should focus on teaching\r\nthe audience something about a particular technique or methodology,\r\nfrom the point of view of someone who has seen it play\r\nout in practice.  These talks could cover anything from techniques for\r\nbuilding functional concurrent applications, to managing dynamic\r\nreconfigurations, to design recipes for using types effectively in\r\nlarge-scale applications.  While these talks will often be based on a\r\nparticular language, they should be accessible to a broad range of\r\nprogrammers.\r\n\r\nIf you are interested in offering a talk, or nominating someone to do\r\nso, send an e-mail to avsm2(at)cl(dot)cam(dot)ac(dot)uk or\r\nyminsky(at)janestreet(dot)com by **15 June 2011** with a short description\r\nof what you''d like to talk about or what you think your nominee should\r\ngive a talk about. Such descriptions should be about one page long.\r\n \r\nThere will be a short scribes report of the presentations and discussions but not of the details of individual talks, as the meeting is intended to\r\nbe more a discussion forum than a technical interchange.  *You do not need to submit a paper*, just a proposal for your talk!\r\n\r\nProgram Committee\r\n-----------------\r\n\r\n* Anil Madhavapeddy (University of Cambridge)                                                                                                                                                                                         \r\n* Yaron Minsky      (Jane Street)                                                                                                                                                                                                     \r\n* Jun Furuse        (Standard Chartered)                                                                                                                                                                                              \r\n* Marius Eriksen    (Twitter Inc.)                                                                                                                                                                                                    \r\n* Michael Williams  (Ericsson)                                                                                                                                                                                                        \r\n* Mike McClurg      (Citrix Systems R&D)                                                                                                                                                                                              \r\n* R. Kent Dybvig    (Indiana University)                                                                                                                                                                                              \r\n* Richard Minerich  (Bayard Rock)                                                                                                                                                                                                     \r\n* Sally Browning    (Galois)                                                                                                                                                                                                          \r\n* Shankar Natarajan (SRI Inc.)                                                                                                                                                                                                        \r\n\r\nMore information\r\n----------------\r\n\r\nFor more information on CUFP, including videos of presentations from\r\nprevious years, take a look at the CUFP website at <http://cufp.org>.\r\nNote that presenters, like other attendees, will need to register for\r\nthe event.  Presentations will be video taped and presenters will be\r\nexpected to sign an ACM copyright release form.  Acceptance and\r\nrejection letters will be sent out by July 15th.\r\n\r\n<a name="guidance"></a>\r\n\r\nGuidance on giving a great CUFP talk\r\n-------------------------------\r\n\r\n**Focus on the interesting bits**: Think about what will distinguish your talk, and what will engage the audience, and focus there.  There are a number of places to look for those interesting bits.\r\n\r\n* **Setting**: There are a few areas where FP is pretty well established, including formal verification, financial processing and server-side web-services.  An unusual setting can be a source of interest.  If you''re deploying FP-based mobile UIs or building servers on oil rigs, then the challenges of that scenario are worth focusing on.  Did FP help or hinder in adapting to the setting?\r\n\r\n* **Social**: as with any new technology, there are often barriers to gaining acceptance within an organisation (be it a startup or a big corporation). Did you face any objections with your choice of language (e.g. hiring worries, risk of new technology, training difficulty). How did this pan out and are there lessons in there for others?\r\n\r\n* **Technology**: The CUFP audience is hungry to learn about how FP techniques work in practice.  What design patterns have you applied, and to what areas? Did you use functional reactive programming for user interfaces, or DSLs for playing chess, or fault-tolerant actors for large scale geological data processing?  Teach us something about the techniques you used, and why we should consider using them ourselves.\r\n\r\n* **Getting things done**: How did you deal with large software development in the absence of a myriad of pre-existing support that are often expected in larger commercial environments (IDEs, coverage tools, debuggers, profilers) and without larger, proven bodies of libraries? Did you hit any brick walls that required support from the community?\r\n\r\n* **Don''t just be a cheerleader**: It''s easy to write a rah-rah talk about how well FP worked for you, but CUFP is more interesting when the talks also spend time on what _doesn''t_ work.  Even when the results were all great, you should spend more time on the challenges along the way than on the parts that went smoothly.\r\n\r\n* **Don''t go too fast**: CUFP talks are short --- you have 25 minutes to get your point across.  So don''t rush through a lot of technical material at high speed.\r\n\r\n* **Keep your slides light**: Don''t put too much on your slides.  You especially shouldn''t be reading sentences from your slides aloud. Slides are best when used for keeping track of the broad structure of your talk, and presenting code snippets or graphics.  Also, keep your font sizes nice and big so people can read from the back of the room!\r\n\r\n* **Give a talk that you would love**: As a practitioner of functional programming, ask yourself what topics *you* would like to hear more about, and guide your talk towards those areas.\r\n', '<center>\r\n**Sponsored by SIGPLAN<br>\r\nCo-located with ICFP 2011<br>\r\nTokyo, Japan<br>\r\nSep 22-24<br>\r\nProposal Submission Deadline 15 June 2011<br>**\r\n</center>\r\n', '', 1305299118, 1),
