(2979, 2979, 21, 'CUFP 2011 Call for Proposals', 'The <a href="http://cufp.org/2011-call-presentations">call for proposals</a> for CUFP 2011 is now available. If you are using functional programming to solve real-world problems and wish to discuss your experiences or techniques, then consider submitting a talk proposal by June 15th 2011.  CUFP is co-located with the ACM <a href="http://www.icfpconference.org/icfp2011/">ICFP</a> conference in Tokyo in September, the first time that the event is being held in Asia.\r\n\r\nMore information available in the <a href="http://cufp.org/2011-call-presentations">CFP</a>, and we look forward to hearing from you!', 'The <a href="http://cufp.org/2011-call-presentations">call for proposals</a> for CUFP 2011 is now available. If you are using functional programming to solve real-world problems and wish to discuss your experiences or techniques, then consider submitting a talk proposal by June 15th 2011.', '', 1311529871, 1),
