(3002, 3002, 0, 'Pantelis Petrogiannakis - Profile ', 'Technical Director in Nessos Information Technologies S.A\r\nNessos Information Technologies S.A. is an ISV focused on developing custom software on-demand, as well as off-the-shelf products and services since December 2001. Nessos is highly expertised and offers integrated solutions to specialized business domains. \r\nNessos is an expert in the following business sectors: \r\n	Workflows, business processes and quality systems management (workflow systems) \r\n	 Geographic information systems (GIS) \r\n	 Programming tools and infrastructure (application frameworks) \r\n	 Information systems integration \r\n', 'Technical Director in Nessos Information Technologies S.A\r\nNessos Information Technologies S.A. is an ISV focused on developing custom software on-demand, as well as off-the-shelf products and services since December 2001. Nessos is highly expertised and offers integrated solutions to specialized business domains.', '', 1301403498, 1),
