(3130, 3130, 0, 'Vincent Toups - Profile ', 'Briefly,\r\n\r\nI am a creatively oriented, technically trained PhD (Physics) with expertise in neural modeling, data analysis and a smattering of other numerical methods.  My dissertation focused on using unsupervised clustering techniques to find patterns in neural responses caused by the non-linearity of the spike generating mechanism.\r\n\r\nIn my private life I am an extremely avid functional programmer who is lately interested in transposing monadic idioms from languages like Haskell into various lisp dialects.  I have an extensive library of functional programming utilities in Emacs Lisp including implementations of destructuring bind, monadic computation, multi-methods and a stack based language in the family of Joy or Factor.  I''ve also been working on porting this library to Scheme.  \r\n\r\nMy blog, Dorophone, is principally about functional programming and consists of long, tutorial style articles which have lately focused on monads in lisp.  It is visible here:\r\n\r\ndorophone.blogspot.com\r\n\r\nI''m looking for a job where I can apply my scientific and functional programming skills at the same time.', 'Briefly,\r\n\r\nI am a creatively oriented, technically trained PhD (Physics) with expertise in neural modeling, data analysis and a smattering of other numerical methods.  My dissertation focused on using unsupervised clustering techniques to find patterns in neural responses caused by the non-linearity of the spike generating mechanism.\r\n\r\nIn my private life I am an extremely avid functional programmer who is lately interested in transposing monadic idioms from languages like Haskell into various lisp dialects.', '', 1306850177, 1),
