(3469, 3469, 39, 'Senior Architect For Leading Investment Bank (F# .NET)', 'A director level architect role with a leading Investment Bank with in Fixed Income Quant Analytics for London.\r\n\r\nThis is a senior (director level) hire for a leading quant strategy group within a tier one Investment Bank for London or New York. You will drive software architecture and technology strategy for the quant strategies group within Fixed Income. There is real scope for progression to a senior leadership position with this role.\r\n\r\nThis team will also collaborate with IT. The technology stack is based on C# / C++ / COM on a .NET framework. There are proprietary frameworks used to calculate risk for portfolios of trades and to facilitate automated testing and new quant modelling development.\r\n\r\nYou will have experience of developing large scale technical architectures which meet highly complex requirements. You will have extensive experience of leading teams of expert developers. You will be an expert in the .NET framework and ideally you will have experience of functional programming too (F#). You will be adept at communicating with the business including traders, sales, modellers and business management.\r\n\r\nFor the right candidate, the rewards include exceptional compensation. The benefit of working on cutting edge project in a highly technologically advanced business group. If you would like to know more, please apply with your CV and I will be happy to have a confidential discussion with you about the role.', 'A director level architect role with a leading Investment Bank with in Fixed Income Quant Analytics for London.\r\n\r\nThis is a senior (director level) hire for a leading quant strategy group within a tier one Investment Bank for London or New York. You will drive software architecture and technology strategy for the quant strategies group within Fixed Income. There is real scope for progression to a senior leadership position with this role.\r\n\r\nThis team will also collaborate with IT. The technology stack is based on C# / C++ / COM on a .NET framework.', '', 1326886522, 1),
