(3323, 3323, 21, 'Propose a BOF!', 'CUFP will again be having Bird-of-a-Feather sessions to discuss a variety of FP topics.  Last year''s BOFs were a lot of fun, with topics ranging from meta-programming to packaging systems.\r\n\r\nBut we need you to help!  The BOFs only happen if people propose them.  Click [here](http://cufp.org/bofs-2011) to learn more about the BOFs and to find out how to propose a topic.', 'CUFP will again be having Bird-of-a-Feather sessions to discuss a variety of FP topics.  Last year''s BOFs were a lot of fun, with topics ranging from meta-programming to packaging systems.\r\n\r\nBut we need you to help!  The BOFs only happen if people propose them.  Click [here](http://cufp.org/bofs-2011) to learn more about the BOFs and to find out how to propose a topic.', '', 1315928028, 1),
(3324, 3324, 21, 'Evening BoFs (day 1)', 'Following last year''s success, CUFP 2011 will again include Birds of a Feather sessions. BoFs provide a place for our community to gather informally at CUFP and reach consensus on matters of importance. Any CUFP attendee can propose a BoF session, and grab one of the spare rooms in the evening slots below. Attendance in the evening is open to all.\r\n\r\nBoF sessions facilitate ad-hoc discussions and provide a place to gather and start off the chat, before moving on during the evening to a local restaurant or pub. There is no deadline for proposing a session, but we encourage you to do so at the earliest possible time to help us with planning and to publicize your proposed discussion. Attendees are also free to show up even if you have not confirmed, but again earlier confirmation will help us with planning.\r\n\r\nLook [here](http://cufp.org/bofs-2011) for more details, including instructions for proposing a BOF!', 'Following last year''s success, CUFP 2011 will again include Birds of a Feather sessions. BoFs provide a place for our community to gather informally at CUFP and reach consensus on matters of importance. Any CUFP attendee can propose a BoF session, and grab one of the spare rooms in the evening slots below. Attendance in the evening is open to all.\r\n\r\nBoF sessions facilitate ad-hoc discussions and provide a place to gather and start off the chat, before moving on during the evening to a local restaurant or pub.', '', 1315928650, 1),
