(3187, 3187, 13, 'Erlang Camp and University', 'ErlangCamp is a 2-day workshop teaching the correct principles for designing, building, and deploying Erlang applications. We stress the fundamentals of building a solid application from the ground up. After the workshop, you will be able to create professional Erlang applications.\r\n\r\nThe Erlang University is 3-day, hands-on, in-depth training for users at beginner, intermediate and advanced levels . The ErlangUniversity lets you build on your practical knowledge of Erlang and learn from authorities that are the leaders in their fields in a group no larger than 12.\r\n\r\nSign up here: http://erlangcamp.com/\r\n\r\nCourses available include: \r\nErlang Express – Have a good grasp of Erlang before the camp begins to allow you to hit the ground running.\r\nTaught by: Fred Hebert - ﻿Author of Learn You Some Erlang and TDD expert\r\n\r\nOTP Express – Have a good grasp of Erlang before the camp begins to allow you to hit the ground running.\r\nTaught by: Tino Breddin - Systems Engineer at Erlang Solutions Ltd\r\n\r\nXMPP with Erlang and ejabberd - Or for something completely different, from XMPP expert and author Jack Moffit, learn how to use, configure and extend the ejabberd XMPP server and the exmpp client library.\r\nTaught by: Jack Moffitt - Author of Professional XMPP Programming with JavaScript and jQuery and XMPP expert', 'ErlangCamp is a 2-day workshop teaching the correct principles for designing, building, and deploying Erlang applications. We stress the fundamentals of building a solid application from the ground up. After the workshop, you will be able to create professional Erlang applications.\r\n\r\nThe Erlang University is 3-day, hands-on, in-depth training for users at beginner, intermediate and advanced levels .', '', 1309527062, 1),
