(3211, 3211, 39, 'T1: Building Reliable Client-Server Applications in Erlang', '## Basic & Sequential Erlang:\r\n\r\nThis section deals with Erlang data types and pattern\r\nmatching. Functions, and modules are discussed. It continues by\r\nintroducing recursion, with a special emphasis on different recursive\r\npatterns, including tail recursion.\r\n\r\n## Concurrent Programming\r\n\r\nThis section describes the creation of processes and their life\r\nspan. It looks at sending and receiving messages, selective reception,\r\nand passing data in the messages. It continues with the various uses\r\nof time outs and registering processes, and terminates by showing the\r\ngeneric process code structure. We conclude this section by\r\nintroducing the simple but powerful error handling mechanisms in\r\nprocesses. It looks at process links, exit signals and their\r\npropagation semantics.\r\n\r\nGeneric Servers and Supervisors This section introduces the <code>OTPdesign</code>\r\npatterns commonly referred to as generic servers and supervisors. We\r\ngive an example of a client server application written in Erlang,\r\nmigrating it to a system using the <code>gen_server</code> behaviour libraries. We\r\nwrap up this section by demonstrating how to place the server we''ve\r\njust written in a supervision tree.\r\n', '## Basic & Sequential Erlang:\r\n\r\nThis section deals with Erlang data types and pattern\r\nmatching. Functions, and modules are discussed. It continues by\r\nintroducing recursion, with a special emphasis on different recursive\r\npatterns, including tail recursion.\r\n\r\n## Concurrent Programming\r\n\r\nThis section describes the creation of processes and their life\r\nspan. It looks at sending and receiving messages, selective reception,\r\nand passing data in the messages.', '', 1314900714, 1),
(3212, 3212, 21, 'T2: JaneStreet''s OCaml Core Library', 'Jane Street''s Core library is an industrial-strength alternative to\r\nthe OCaml standard library.  Core is designed with consistency,\r\nexplicitness and efficiency in mind.  This tutorial will cover:\r\n\r\n## Core\r\n\r\nAn overview of the main library, including:\r\n\r\n- How to download and install Core on your own system\r\n- The design principles behind Core\r\n- Examples of how to use some of the trickier libraries\r\n\r\n## Syntax Extensions:\r\n\r\nA review of the the syntax extensions included in Core and how to use\r\nthem effectively.  The extensions to be covered are:\r\n\r\n- <code>pa_sexplib</code>: auto-generation of functions for serializing to and from\r\n  an s-expression format\r\n- <code>pa_binprot</code>: auto-generation of functions for serializing and\r\n  deserializing to an efficient binary format\r\n- <code>pa_compare</code>: auto-generation of comparison functions\r\n- <code>pa_typehash</code>: for generating a hash of a type definition.  Useful for\r\n  ensuring agreement on types in network protocols.\r\n- <code>pa_fields</code>: for auto-generating first-class fields and various\r\n  iterators over the fields of a record type.\r\n- <code>pa_variants</code>: for auto-generating first-class variants and iterators\r\n  over the set of cases in a variant type.\r\n\r\n## Core_extended:\r\n\r\nIn addition to giving an overview of the Core and how to make the most\r\nof it, we''ll cover Core_extended, which is a set of extensions to core\r\nthat are less stable, but still highly useful.  Notable among those\r\nlibraries is:\r\n\r\n- <code>Shell</code>: a library for interacting with the UNIX shell\r\n- <code>Command</code>: a library for building command-line executables featuring\r\n  subcommands for combining a collection of utilities into one common\r\n  command, and built in auto-completion support for Bash.\r\n', 'Jane Street''s Core library is an industrial-strength alternative to\r\nthe OCaml standard library.  Core is designed with consistency,\r\nexplicitness and efficiency in mind.  This tutorial will cover:\r\n\r\n## Core\r\n\r\nAn overview of the main library, including:\r\n\r\n- How to download and install Core on your own system\r\n- The design principles behind Core\r\n- Examples of how to use some of the trickier libraries\r\n\r\n## Syntax Extensions:\r\n\r\nA review of the the syntax extensions included in Core and how to use\r\nthem effectively.', '', 1316523594, 1),
(3213, 3213, 39, 'T3: Building a Functional OS', 'Have you ever wondered what lies beneath the mysterious layers of your\r\nOS kernel? This tutorial will dispel such questions by walking you\r\nthrough the construction a web server operating system, written almost\r\nentirely in OCaml.  We use the Xen hypervisor to supply virtual\r\nhardware that the guest will execute under, so that only a single set\r\nof virtual drivers are required for networking and storage (ideal for\r\nlearning about how it all works).\r\n\r\nThe tutorial will last 3 hours and be highly interactive. We will:\r\n\r\n- begin by introducing the Mirage programming framework, and how to\r\n  use it under a familiar UNIX environment\r\n- introduce high-level OCaml abstractions for a console, lightweight\r\n  threads, and channels that map to UNIX sockets\r\n- use the tuntap infrastructure to insert a TCP/IP/Ethernet stack as\r\n  an alternative to the UNIX kernel stack\r\n- compile the same source code to a microkernel running directly under\r\n  Xen\r\n- build your own "hello world" webserver and execute it on the public\r\n  internet using Amazon EC2!\r\n\r\nAfter the initial tutorial, we plan to hang around and help with\r\nfurther questions, or even explore alternative microkernels such as\r\nHalVM (Haskell) or GuestVM (Java). Come along and learn the essential\r\nskills to learn how to build specialised services in your favourite\r\nprogramming language!\r\n', 'Have you ever wondered what lies beneath the mysterious layers of your\r\nOS kernel? This tutorial will dispel such questions by walking you\r\nthrough the construction a web server operating system, written almost\r\nentirely in OCaml.  We use the Xen hypervisor to supply virtual\r\nhardware that the guest will execute under, so that only a single set\r\nof virtual drivers are required for networking and storage (ideal for\r\nlearning about how it all works).\r\n\r\nThe tutorial will last 3 hours and be highly interactive.', '', 1316573787, 1),
(3221, 3221, 0, 'Jason Laffan - Profile ', '', '', '', 1311012807, 1),
(3214, 3214, 39, 'T4: Collaborative Scientific Software', 'Science has always been a social activity. In this tutorial, we will build\r\nan application in OCaml to support collaborative research amongst\r\nscientists. A classic 3-layer architecture will be used: a domain logic in\r\nthe middle, a database backend to persist analysis results, and a web\r\ninterface to present the application''s functionality to end-users.\r\n\r\nObtaining data and analyzing it are two basic scientific\r\nactivities. In the domain layer, we will implement a function to\r\ndownload data from a widely used public genomics data repository, and\r\nthen use OCaml-R to analyze this data. The downloaded data as well as\r\nthe analysis results will be saved to a PostgreSQL database using\r\nPG''OCaml, which validates OCaml code at compile time against the\r\ndatabase schema. Finally, we will implement a website using Ocsigen to\r\nsummarize the downloaded datasets and visualize the analysis\r\nresults. Time permitting, we will add user accounts and an access\r\ncontrol policy to give end-users the ability to select the\r\ncollaborators they share their data with.\r\n\r\nBy the end of this tutorial, participants should feel comfortable building a\r\ncomplete application end-to-end in OCaml. It should be clear how each\r\nlayer''s functionality could be extended to build a full enterprise\r\napplication. The tutorial should be of interest to non-scientists as well.\r\nOne needs only to replace tools in the domain layer to build applications\r\nfor other purposes.\r\n', 'Science has always been a social activity. In this tutorial, we will build\r\nan application in OCaml to support collaborative research amongst\r\nscientists. A classic 3-layer architecture will be used: a domain logic in\r\nthe middle, a database backend to persist analysis results, and a web\r\ninterface to present the application''s functionality to end-users.\r\n\r\nObtaining data and analyzing it are two basic scientific\r\nactivities. In the domain layer, we will implement a function to\r\ndownload data from a widely used public genomics data repository, and\r\nthen use OCaml-R to analyze this data.', '', 1314859583, 1),
(3215, 3215, 39, 'T5: Parallel Programming in Haskell (Simon Peyton Jones, Simon Marlow, Manuel Chakravarty)', 'In principle Haskell is a great language for parallel programming (few\r\nside effects, implicit parallelism, yada yada), but how does this work\r\nout in practice?  This tutorial will put you in a position where you\r\ncan try it for yourself.  There will be three parts (about an hour\r\neach):\r\n\r\n- What''s hot in parallel Haskell: a whirlwind tour of what is going on\r\n  (Simon Peyton Jones)\r\n- Programming in the Par monad and ThreadScope (Simon Marlow)\r\n- Data Parallel Haskell (Manuel Chakravarty)\r\n\r\nWe will mostly concentrate on *parallel* programming (where the goal\r\nis to improve performance) rather than *concurrent* programming (where\r\nthe goal is modular program design).\r\n\r\nTake home: A good understanding of the basics of two\r\nparallel-programming paradigms in Haskell.\r\n', 'In principle Haskell is a great language for parallel programming (few\r\nside effects, implicit parallelism, yada yada), but how does this work\r\nout in practice?  This tutorial will put you in a position where you\r\ncan try it for yourself.', '', 1315411529, 1),
(3216, 3216, 39, 'T6: Systems Programming in Scala (Steven Jenson, Marius Eriksen)', 'In this tutorial you will learn Scala from a *systems programming*\r\ncentric point of view. By the end of the tutorial you will have built\r\na simple, robust and performant distributed search engine for tweets\r\nusing many functional programming idioms in a systems context. Scala\r\nis a large language, so we won''t cover every nook and cranny. However,\r\nthe most important concepts will be covered, and participants will be\r\nleft with experience with writing a non-trivial Scala application and\r\nwith the skills to learn the rest by themselves.\r\n\r\nWe start out by teaching the basic Scala concepts and language syntax.\r\n\r\n## Basic Language Concepts\r\n\r\n- Functions, Classes, Methods, Inheritance, `try-catch-finally`.\r\n  Value-oriented programming\r\n- Lists, Maps, functional combinators: `map`, `foreach`, `filter`,\r\n  `zip`, `folds`\r\n- Case Classes, Objects, Packages, `apply`, `update`, Functions are\r\n  Objects (Uniform Access Principle), Basic Pattern Matching\r\n- `PartialFunction` and advanced Pattern Matching\r\n- A Tour of the Scala Collections library\r\n\r\nNext we introduce a few Twitter-specific concepts that will be used in\r\nour example application\r\n\r\n## Twitter Concepts\r\n- Tweets, Twitter Streaming API\r\n- `Future` and Finagle\r\n\r\nFollowed by building our example application: a distributed search\r\nengine for tweets built using functional concepts\r\n\r\n## Build our Search Application\r\n- Read Tweets: Read fake data\r\n- Index Tweets: Building a functional indexer\r\n- Query Tweets: Read from the index\r\n- Use _Your_ Tweets: Read from Twitter''s Streaming API\r\n- Distributed Indexing\r\n- Run multiple indexers\r\n- query in parallel and merge results\r\n\r\nLastly we will discuss how these functional concepts map onto the\r\nobject-oriented JVM.\r\n\r\n## How Scala concepts translate to Java\r\n- Classes\r\n- Bytecode\r\n\r\n', 'In this tutorial you will learn Scala from a *systems programming*\r\ncentric point of view. By the end of the tutorial you will have built\r\na simple, robust and performant distributed search engine for tweets\r\nusing many functional programming idioms in a systems context. Scala\r\nis a large language, so we won''t cover every nook and cranny.', '', 1314900881, 1),
(3217, 3217, 39, 'T7: The Snap Framework for web applications in Haskell (Gregory Collins)', 'The Snap Framework is a fast and easy to use library for writing web\r\napplications in Haskell. This hands-on code lab will guide\r\nparticipants in using Snap to create a simple web application in\r\nHaskell from start to finish.\r\n', 'The Snap Framework is a fast and easy to use library for writing web\r\napplications in Haskell. This hands-on code lab will guide\r\nparticipants in using Snap to create a simple web application in\r\nHaskell from start to finish.\r\n', '', 1315050361, 1),
(3218, 3218, 39, 'T8: F# for the Working Functional Programmer', 'F# is the functional language of choice for the .NET framework: Its\r\ncore resembles the core of OCaml, and its extensions over OCaml allow\r\ndirect access to the full .NET infrastructure.  Moreover, F# is a full\r\ncitizen of the language set of Visual Studio 2010.  However, the\r\n.NET/Visual Studio culture may sometimes seem a little alien to a\r\nfunctional programmer coming from a different language: Some of the\r\nterminology is subtly different, the documentation is sometimes hard\r\nto navigate, and some programming choices are hard to make.  ("Classes\r\nor sum types?"; "What unit testing framework?"; "WPF or Forms"? etc.)\r\n\r\nThis tutorial is meant to bridge this gap: We''ll go over the language\r\ncore quickly, and then cover some advanced topics relevant to the\r\nworking programmer, including:\r\n\r\n- when and how to write native .NET types, classes, methods\r\n- how to write unit tests and property-based tests\r\n- casts and when to use them\r\n- how asynchronous programming works\r\n- concurrency, mailboxes and message passing\r\n\r\nWe''ll do some hands-on exercises, and then you can be on your way,\r\nhacking.\r\n', 'F# is the functional language of choice for the .NET framework: Its\r\ncore resembles the core of OCaml, and its extensions over OCaml allow\r\ndirect access to the full .NET infrastructure.  Moreover, F# is a full\r\ncitizen of the language set of Visual Studio 2010.  However, the\r\n.NET/Visual Studio culture may sometimes seem a little alien to a\r\nfunctional programmer coming from a different language: Some of the\r\nterminology is subtly different, the documentation is sometimes hard\r\nto navigate, and some programming choices are hard to make.', '', 1316494781, 1),
