(3231, 3231, 1, 'Lennart  Augustsson - Profile ', 'Lennart Augustsson is a Swedish computer scientist. He was previously a lecturer at the Computing Science Department at Chalmers University of Technology. His research field is functional programming and implementations of functional languages.\r\n\r\nAugustsson has worked for Carlstedt Research and Technology, Sandburst, and Credit Suisse and is currently employed by Standard Chartered Bank.\r\n\r\nAugustsson is the author of:\r\n\r\n    * The Cayenne programming language.\r\n    * The HBC Haskell compiler.\r\n    * Several hardware device drivers for NetBSD.\r\n    * The front end of the pH compiler (parallel Haskell) from MIT.\r\n    * The initial version of the Bluespec compiler.\r\n\r\nHe was intimately involved in early LPMud development, both in the LPMUD driver and the CD mudlib. His MUD community pseudonym is Marvin.\r\n\r\nAugustsson has written three winning entries in the International Obfuscated C Code Contest:\r\n\r\n    * 1985 Most obscure program (1985/august.c)\r\n    * 1986 Best complex task done in a complex way (1986/august.c)\r\n    * 1996 Best of Show (1996/august.c)', 'Lennart Augustsson is a Swedish computer scientist. He was previously a lecturer at the Computing Science Department at Chalmers University of Technology.', '', 1311664706, 1),
(3232, 3232, 21, 'Keynote: Pragmatic Haskell', 'Over the years I''ve both used Haskell a lot commercially and also made four Haskell implementations.\r\nOf the four implementations three are very non-standard because they were aimed for particular targets.\r\nI will talk about various aspects of using and implementing non-standard Haskell as well as show a number of examples from my latest Haskell implementation which is strict.  I will also make a pragmatic assessment of strict versus lazy.\r\n', 'Over the years I''ve both used Haskell a lot commercially and also made four Haskell implementations.\r\nOf the four implementations three are very non-standard because they were aimed for particular targets.\r\nI will talk about various aspects of using and implementing non-standard Haskell as well as show a number of examples from my latest Haskell implementation which is strict.  I will also make a pragmatic assessment of strict versus lazy.\r\n', '', 1311899974, 1),
