(3238, 3238, 1, 'Jared Flatow - Profile ', 'Jared Flatow is an engineer at the Nokia Research Center in Palo Alto. Prior to joining the NRC in 2009, Jared was tackling large-data problems in the field of bioinformatics at the Northwestern University Biomedical Informatics Center in Chicago. Jared was among the first to apply Map/Reduce to problems in bioinformatics, presenting his work using Hadoop at the Next-Generation Sequencing Data Analysis \r\nconference in 2008. Jared long-dreamed of rewriting a Map/Reduce framework in Python, but it was not until discovering Disco that he realized the elegance of combining the strengths of both Erlang and  Python towards that end. Since then, Jared has become a contributor to Disco, and co-architect of the simple and scalable Discodex data- indexing pipeline. His recent efforts have been aimed at using Discodex to achieve a full-stack massive-scale data visualization pipeline with his colleagues at the Nokia Research Center.', 'Jared Flatow is an engineer at the Nokia Research Center in Palo Alto. Prior to joining the NRC in 2009, Jared was tackling large-data problems in the field of bioinformatics at the Northwestern University Biomedical Informatics Center in Chicago. Jared was among the first to apply Map/Reduce to problems in bioinformatics, presenting his work using Hadoop at the Next-Generation Sequencing Data Analysis \r\nconference in 2008.', '', 1311667506, 1),
(3239, 3239, 1, 'Tom Wilkie - Profile ', 'Founder & VP Engineering at Acunu', 'Founder & VP Engineering at Acunu', '', 1311667713, 1),
(3240, 3240, 1, 'Andrew Byde - Profile ', 'Andrew joined Acunu from HP Labs, where he spent 10 years doing research into information extraction, market-based computing and biologically-inspired complex systems.  During that time he spent 2 years as a Royal Society Industry Fellow at the University of Southampton.  Andrew obtained a PhD in Mathematics from Stanford University and an MA in Mathematics from Cambridge University.  He has 24 publications and over 20 patents to his name.\r\n\r\nA talented CS Mage by training, Andrews'' capricious nature makes him a dangerous enemy and unpredictable ally.  With his trademark spells ''Shatter Illusions'', ''Twisted Reasoning'' and ''Bolt of Genius'' he regularly makes a mockery of traditional battle scenarios, confusing and bringing enlightenment in equal measure; those seeking to prepare themselves against him -- for example by donning a Helm of Rigid Thinking, or by invoking spells such as ''Thicken Skull'', beware, his Elf nature gives him +20 on all ''Shift Paradigm'' rolls.', 'Andrew joined Acunu from HP Labs, where he spent 10 years doing research into information extraction, market-based computing and biologically-inspired complex systems.  During that time he spent 2 years as a Royal Society Industry Fellow at the University of Southampton.  Andrew obtained a PhD in Mathematics from Stanford University and an MA in Mathematics from Cambridge University.  He has 24 publications and over 20 patents to his name.\r\n\r\nA talented CS Mage by training, Andrews'' capricious nature makes him a dangerous enemy and unpredictable ally.', '', 1311668023, 1),
(3241, 3241, 1, 'Theorem-based derivation of an AES Implementation', 'Even though step-by-step refinement has long been seen as desirable, it is hard to find compelling industrial applications of the technique. In theory, transforming a high-level specification into a high-performance implementation is an ideal means of producing a correct design, but in practice it is hard to make it work, and even harder to make it worthwhile. This talk describes an exception.  We relate a design experience in which theorem-based refinement played a crucial role in producing an industrial quality FPGA encryptor and decryptor for AES. Quite simply, we are unlikely to have succeeded without the technique.', 'Even though step-by-step refinement has long been seen as desirable, it is hard to find compelling industrial applications of the technique. In theory, transforming a high-level specification into a high-performance implementation is an ideal means of producing a correct design, but in practice it is hard to make it work, and even harder to make it worthwhile. This talk describes an exception.  We relate a design experience in which theorem-based refinement played a crucial role in producing an industrial quality FPGA encryptor and decryptor for AES.', '', 1311669004, 1),
(3242, 3242, 1, 'Discrete Event Simulation using Erlang', 'Any energy company planning to design and deploy a large- scale smart metering system is eager to minimize the risks in- volved by such a massive and costly roll-out. A simulation of that system before it exists is among the most effective tools to aid the decision-making process.', 'Any energy company planning to design and deploy a large- scale smart metering system is eager to minimize the risks in- volved by such a massive and costly roll-out. A simulation of that system before it exists is among the most effective tools to aid the decision-making process.', '', 1311669467, 1),
(3243, 3243, 1, 'Model based testing of AUTOSAR automotive components ', 'Testing AUTOSAR components with traditional software testing techniques turns out to be an expensive undertaking. Traditionally, one manually constructs test cases, but the enormous amount of configuration parameters make it hard to reuse tests written for a specific configuration in a different configuration. The least one needs to do is to inspect the test case and see if it makes sense for the new configuration. With a test suite of ten thousand tests, that’s not an easy exercise. Even harder is it to adapt the tests if the configuration parameters require that.  On top of the large configuration space, there is the complexity of the almost infinite amount of possible scenarios. How would one manually create a test suite that covers at least a large number of all possible ways components can interact with each other?', 'Testing AUTOSAR components with traditional software testing techniques turns out to be an expensive undertaking. Traditionally, one manually constructs test cases, but the enormous amount of configuration parameters make it hard to reuse tests written for a specific configuration in a different configuration. The least one needs to do is to inspect the test case and see if it makes sense for the new configuration. With a test suite of ten thousand tests, that’s not an easy exercise. Even harder is it to adapt the tests if the configuration parameters require that.', '', 1311669703, 1),
