(3245, 3245, 1, 'HTML5 web application development in OCaml', 'Recently, we have developed a few of HTML5 based web applications by using Ocamljs [1], which is a compiler from OCaml into JavaScript.  We will report on some experiences obtained by using OCaml as a client-side web language.', 'Recently, we have developed a few of HTML5 based web applications by using Ocamljs [1], which is a compiler from OCaml into JavaScript.  We will report on some experiences obtained by using OCaml as a client-side web language.', '', 1311670051, 1),
