(3247, 3247, 1, 'Large-scale Internet Services in Scala at Twitter', 'We discuss our experiences designing, implementing, and running large-scale internet services in Scala. These services handle over 100,000 requests per second and Scala is involved in every tweet sent. ', 'We discuss our experiences designing, implementing, and running large-scale internet services in Scala. These services handle over 100,000 requests per second and Scala is involved in every tweet sent. ', '', 1311670435, 1),
(3248, 3248, 1, 'Applying Functional Programming to Build Platform-Independent Mobile Applications', 'Native mobile applications enjoyed tremendous success in recent years, and looking at various mobile application stores such as Apple''s App Store or Google''s Android Market reveals a staggering number of native mobile applications. As technologies to build these applications mature and the market saturates, mobile OS vendors are struggling to find ways to keep up with and secure the exponential market growth.  Inhibiting factors include platform-specific development environments, programming languages, and building blocks for applications; developer-unfriendly licensing, policies and subscriptions; and controlled channels of application distribution.', 'Native mobile applications enjoyed tremendous success in recent years, and looking at various mobile application stores such as Apple''s App Store or Google''s Android Market reveals a staggering number of native mobile applications. As technologies to build these applications mature and the market saturates, mobile OS vendors are struggling to find ways to keep up with and secure the exponential market growth.', '', 1311670659, 1),
