(3250, 3250, 1, 'Fourteen Days of Haskell: A Real Time Programming Project in Real Time', 'For a long time it has been believed that functional programming should be suited to dataflow computations, like those in signal processing and communication systems.  But there have been few concrete examples of it being used in these applications.', 'For a long time it has been believed that functional programming should be suited to dataflow computations, like those in signal processing and communication systems.  But there have been few concrete examples of it being used in these applications.', '', 1311670987, 1),
(3251, 3251, 1, 'Disco: using Erlang to implement Mapreduce, Nokia', 'We will describe our experiences using Erlang within Nokia to build Disco [1], a lean and flexible MapReduce framework for large-scale data analysis that scales to large clusters and is used in production at Nokia. ', 'We will describe our experiences using Erlang within Nokia to build Disco [1], a lean and flexible MapReduce framework for large-scale data analysis that scales to large clusters and is used in production at Nokia. ', '', 1311671397, 1),
(3252, 3252, 21, 'Functional mzScheme DSLs in Game Development ', 'Naughty Dog has a history of using various Lisp dialects to solve a wide variety of game development problems. But when making the jump from the Playstation 2 to the Playstation 3 we decided that maintaining our custom Lisp-based game development system was too costly. We dedicated our efforts to rebuilding our tools, engine, and game in C++ and assembly language.\r\n\r\nThis left no scripting system for gameplay and, more importantly, no system for creating DSLs and the oodles of “glue” data that is typically required to develop a Naughty Dog video game. Existing tools weren’t going to cut it: there was no off-the-shelf scripting system that fit our stringent memory requirements and no language that would allow rapid DSL creation that fit into our tool chain. With a bit of naivety, a penchant for the Scheme language, and a passion for functional programming techniques we dove in and started putting together a system to fill in the gaps.\r\n\r\nThe results have been profoundly good but not without many issues. We’ve fought with poor tool performance, difficult build environment integration, alien syntax, abysmal error reporting, and just plain confusion. The functional nature of our system has been a big win, allowing us to flexibly distill our data down to just the right form to embed into our game’s run-time environment. And we’ve got a system where programmers, artists, animators, and designers are productively “programming” directly in our S-expression Scheme-like language.\r\n\r\nThis talk will give a brief overview of our experience at Naughty Dog building this functional DSL development system on top of MzScheme. I’ll talk about the challenges of “blue collar” programmers entering the somewhat academic world of language research and development while under the onerous deadlines of retail software development. I’ll talk about the many opportunities this approach afforded us, some of which we were able to capitalize on to great success, others which lay tantalizingly just out reach. I’ll talk about the culture clash of getting C++ programmers, technical game designers, and non-technical artists to be productive in a world of S-expressions and syntax transformations. And I’ll give an overview of some metrics of the impressive contributions our system was able to make to the development of Uncharted series of games for the Playstation 3.\r\n', 'Naughty Dog has a history of using various Lisp dialects to solve a wide variety of game development problems. But when making the jump from the Playstation 2 to the Playstation 3 we decided that maintaining our custom Lisp-based game development system was too costly. We dedicated our efforts to rebuilding our tools, engine, and game in C++ and assembly language.\r\n\r\nThis left no scripting system for gameplay and, more importantly, no system for creating DSLs and the oodles of “glue” data that is typically required to develop a Naughty Dog video game.', '', 1311900063, 1),
(3253, 3253, 1, 'OCaml and Acunu Experience Report ', 'Acunu is reengineering the Linux storage stack from the ground-up for Big Data applications.  Since our inception, we''ve been users of OCaml for research, prototyping and production code.  We''ve use OCaml when implementing brand new, cutting edge algorithms[1] in an prototype storage engine, and when producing an enterprise grade, multi-master management stack.', 'Acunu is reengineering the Linux storage stack from the ground-up for Big Data applications.  Since our inception, we''ve been users of OCaml for research, prototyping and production code.  We''ve use OCaml when implementing brand new, cutting edge algorithms[1] in an prototype storage engine, and when producing an enterprise grade, multi-master management stack.', '', 1311672037, 1),
