(3452, 3452, 21, 'Haskell Development Role at Investment Bank (SG)', 'A large Investment Bank with a successful global business is currently looking to hire a bright Haskell developer for their quant development team based in Singapore.\r\n\r\nThe role would suit a candidate who has a Phd or MSc, or extensive experience with functional programming (esp. Haskell). The team develops and improves systems for the group''s quantitative analytics group with a focus on building trader tools as well as domain-specific-languages used by IT developing for sales, trading, market risk etc. across all asset classes.\r\n\r\nThe ideal candidate will have good Haskell programming experience as well as a track record of outstanding academic achievement or examples of open source project (your own code). You need to demonstrate strong OO ( Java / C# / C++ ) programming skills too and a solid understanding of computer science fundamentals. A good grasp of Mathematics would be a plus.\r\n\r\nWe have successfully placed several members of this team and so have an understanding of what they look for and whether it could be a good fit for you. This is a rare opportunity to work with some really talented programmers whilst use Haskell to solve real-world problems.\r\n\r\nIf you would like to apply or want more information, please send your CV to jwoods@kaizenpartnership.co.uk\r\n', 'A large Investment Bank with a successful global business is currently looking to hire a bright Haskell developer for their quant development team based in Singapore.\r\n\r\nThe role would suit a candidate who has a Phd or MSc, or extensive experience with functional programming (esp. Haskell). The team develops and improves systems for the group''s quantitative analytics group with a focus on building trader tools as well as domain-specific-languages used by IT developing for sales, trading, market risk etc.', '', 1325613423, 1),
