(3474, 3474, 39, 'CUFP 2012 is on the way', 'The date for CUFP 2012 is now set: It will happen September 13-15, and be co-located with [ICFP 2012](http://icfpconference.org/icfp2012/) in Copenhagen, Denmark.\r\n\r\n[Mike Sperber](http://cufp.org/users/msperber)  and [Anil Madhavapeddy](http://cufp.org/users/avsm) will co-chair the conference; [Duncan Coutts](http://cufp.org/users/dcoutts) and [Simon Thompson](http://www.cs.kent.ac.uk/people/staff/sjt/) will organize the tutorials.\r\n\r\nWe''re busy putting together a program committee. Expect more news in the near future!', 'The date for CUFP 2012 is now set: It will happen September 13-15, and be co-located with [ICFP 2012](http://icfpconference.org/icfp2012/) in Copenhagen, Denmark.\r\n\r\n[Mike Sperber](http://cufp.org/users/msperber)  and [Anil Madhavapeddy](http://cufp.org/users/avsm) will co-chair the conference; [Duncan Coutts](http://cufp.org/users/dcoutts) and [Simon Thompson](http://www.cs.kent.ac.uk/people/staff/sjt/) will organize the tutorials.\r\n\r\nWe''re busy putting together a program committee. Expect more news in the near future!', '', 1327347136, 1),
