(3421, 3421, 39, 'Parallel Haskell Programmers', 'Parallel Scientific, LLC is a Boulder, CO based early stage, but funded startup company working in the area of scalable parallelization for scientific and large data computing.  We are implementing radically new software tools for the creation and optimization of parallel programs benefiting applications and leveraging modern systems architecture. We build on our mathematical knowledge, cutting edge programming languages and our understanding of systems software and hardware.  We are currently working with the Haskell development team and major HPC laboratories world wide on libraries and compiler extensions for parallel programming.\r\n\r\nParallel Scientific was founded by Peter Braam in 2010.  Peter formerly taught mathematics and computer science at Oxford and Carnegie Mellon.  Then he contributed file systems to Linux and invented Lustre (which provides storage to 9 of the top 10 systems in the world). He ran several successful startups, and Parallel Scientific is run by an very experienced management team and board.    \r\n\r\nSuccessful candidates can in some cases work remotely and will work in a modern virtual environment.  We provide training in advanced processes for software design and implementation and domain specific knowledge.\r\n\r\n# Required skills:\r\n\r\n1. Very strong background in computer science or mathematics\r\n2. Experience with Haskell\r\n3. Knowledge of systems programming and operating systems functionality\r\n4. Knowledge of system architectures, such as high performance networking, memory architectures, multi and manycore CPUs and GPGPUs\r\n5. Experience with performance tuning of parallel or concurrent algorithms\r\n6. Experience designing and implementing concurrent or parallel programs\r\n\r\n# Experience in one or more of the following areas is desirable:\r\n\r\n1. Experience with Haskell compiler technology\r\n2. In depth knowledge of core Haskell libraries for parallel programming (NDP, REPA etc)\r\n3. Experience in the area of middleware algorithms for data flow programming, graphs, cloud based data analytics, or sparse matrices\r\n3. Domain specific knowledge in scientific programming areas related to irregular and sparse problems, e.g. data analytics using graph analysis, genomics, tightly connected numerical analysis\r\n4. Experience with performance tuning for parallel applications on multi core systems (e.g. with the Intel toolkit), for GPGPU''s using Cuda/OpenCL or with MPI/OpenMP on clusters of SMPs\r\n\r\n\r\nPlease send a resume to jobs@parsci.com.', 'Parallel Scientific, LLC is a Boulder, CO based early stage, but funded startup company working in the area of scalable parallelization for scientific and large data computing.  We are implementing radically new software tools for the creation and optimization of parallel programs benefiting applications and leveraging modern systems architecture. We build on our mathematical knowledge, cutting edge programming languages and our understanding of systems software and hardware.', '', 1321948031, 1),
