INSERT INTO `webform` (`nid`, `confirmation`, `teaser`, `submit_text`, `submit_limit`, `submit_interval`, `additional_validate`, `additional_submit`, `confirmation_format`, `submit_notice`, `allow_draft`, `redirect_url`, `block`, `status`, `auto_save`) VALUES
(67, '', 0, '', -1, -1, '', '<?php\r\n$nid = arg(1); \r\n$sql = "SELECT field_email_email  FROM {content_type_job} WHERE nid = ''$nid''";\r\n$result = db_query(db_rewrite_sql($sql));\r\n$email = db_fetch_object($result);\r\n$email = $email->field_email_email;\r\n\r\n$sql = "SELECT field_first_name_value  FROM {content_field_first_name} WHERE nid = ''$nid''";\r\n$result = db_query(db_rewrite_sql($sql));\r\n$firstname = db_fetch_object($result);\r\n$firstname = $firstname->field_first_name_value;\r\n\r\n$sql = "SELECT field_last_name_value  FROM {content_field_last_name} WHERE nid = ''$nid''";\r\n$result = db_query(db_rewrite_sql($sql));\r\n$lastname = db_fetch_object($result);\r\n$lastname = $lastname->field_last_name_value;\r\n\r\n$sql = "SELECT title  FROM {node} WHERE nid = ''$nid''";\r\n$result = db_query(db_rewrite_sql($sql));\r\n$title = db_fetch_object($result);\r\n$title = $title->title;\r\n\r\n$UrlBasePath = ''http://''.$_SERVER[''HTTP_HOST''];\r\n$posturl = $UrlBasePath.url(''node/''.$nid);\r\n\r\n\r\n// fetch data submitted via webform for later use in the body of the email\r\n$params[''poster_first_name''] = $firstname;\r\n$params[''poster_last_name''] = $lastname;\r\n$params[''post_title''] = $title;\r\n$params[''post_url''] = $posturl;\r\n$params[''first_name''] = $form_values[''submitted''][4];\r\n$params[''last_name''] = $form_values[''submitted''][5];\r\n$params[''email''] = $form_values[''submitted''][3];\r\n$params[''message''] = $form_values[''submitted''][2];\r\n$params[''username''] = $form_values[''submitted''][6];\r\n$params[''user_url''] = $UrlBasePath.''/users/''.$form_values[''submitted''][6];\r\n\r\n$to = $email;\r\n// set sender\r\n$from = "donotreply@cufp.org";\r\n// install devel module and uncomment next line to see entire data structure in a nifty little DHTML widget\r\n// dpm($form);\r\n\r\n// drupal message on confirmation page\r\ndrupal_set_message(''Form has been sent'');\r\n\r\n// send the confirmation mail\r\ndrupal_mail(''confirmation_reservation'', ''confirmation_reservation_mail'', $to, language_default(), $params, $from);\r\n\r\n// construct email\r\n\r\nfunction confirmation_reservation_mail($key, &$message, $params) {\r\n  $message[''subject''] = "CUFP Job Response";\r\n  $message[''body''] = "Greetings ".$params[''poster_first_name'']." ".$params[''poster_last_name''].",\\n\\n";\r\n  $message[''body''] .= "The following message has been sumbitted in response to your job post: ''".$params[''post_title'']."'' (".$params[''post_url''].")\\n\\n";\r\n  $message[''body''] .= "First Name:". $params[''first_name'']."\\n";\r\n  $message[''body''] .= "Last Name:". $params[''last_name'']."\\n";\r\n  $message[''body''] .= "Email:" . $params[''email'']."\\n";\r\n  $message[''body''] .= "Message:" . $params[''message'']."\\n\\n";\r\n  $message[''body''] .= "You may also want to review this user''s CUFP profile here: ".$params[''user_url'']."\\n\\n";\r\n  \r\n  \r\n  $message[''body''] .= "Kindest regards,\r\nCUFP.ORG Team\r\n";\r\n    }\r\n?>', 1, 0, 0, 'node/68', 1, 1, 0),
