(67, 35, 2, '0', 'Hi Lawrence. \r\n\r\nI am a headhunter with a focus on functional programming roles within the finance sector. I have completed several successful searches in this space and hoped it might be possible to speak to you regarding your requirements. I am currently working with several outstanding F# programmers who could be a very good fit for the role.\r\n\r\nI hope to hear from you. Thanks.\r\n\r\nJames\r\n\r\n+44 7956 31015'),
