(78, 43, 4, '0', 'anil@recoil.org'),
(78, 43, 5, '0', 'Would it be ok with you if I held a local CUFP meetup here in Michigan?  I wouldn''t call it an "CUFP meetup" unless, of course, I have your permission to use the name CUFP.  I''d like to meet like-minded software developers that are interested in commercial use of the functional programming paradigm--which is why I''d like to hold a meetup.\r\n\r\n--\r\nOnorio '),
(78, 44, 1, '0', 'Michael'),
(78, 44, 2, '0', 'Hendricks'),
(78, 44, 3, '0', 'michael@ndrix.org'),
(78, 44, 4, '0', 'anil@recoil.org'),
(78, 44, 5, '0', 'Is there a registration fee for the October 2010 conference in Baltimore?'),
(67, 45, 4, '0', 'Guillaume'),
(67, 45, 5, '0', 'Yziquel'),
(67, 45, 3, '0', 'guillaume.yziquel@gmx.ch'),
(67, 45, 2, '0', 'Hello.\r\n\r\nI recently noticed the advertisement for an F# position in the field of equity derivatives. Please contact me by email so that I know where to send my cover letter, resume, and scanned documents.\r\n\r\nFor your information, the address info@kaizenpartnership.com is currently rejecting incoming emails.\r\n\r\nHere''s the cover letter (please contact me for the resume, and for the scanned documents):\r\n\r\nGuillaume YZIQUEL\r\n54, rue Marcel Bonnet,\r\nF - 94 230 Cachan,\r\nFrance.\r\nEmail  : guillaume.yziquel@gmx.ch\r\nTel : [+33] (0)6 47 64 21 70\r\n\r\nJames Wood\r\nThe Kaizen Partnership\r\nKings House\r\n36 - 37 King Street\r\nLondon, EC2V 8BB\r\nUnited Kingdom\r\nEmail  : info@kaizenpartnership.com\r\nTel : [+44] (0)207 710 0280\r\n\r\nObject: Cover letter for The Kaizen Partnership.\r\n\r\n\r\n      Dear Mr. James Wood,\r\n\r\n      I presently wish to submit my résumé to your recruiting firm,\r\nfollowing an announcement on the Commercial Users of Functional\r\nWebsite for an F# .Net developer position involving equity\r\nderivatives. As I have some serious functional programming\r\nexperience mainly in Objective Caml, some experience in the\r\nfinancial industry, good mathematical skills, my application may\r\nhopefully be of interest to you.\r\n\r\n      After a solid, rather high profile, academic upbringing in\r\nmathematics, I graduated in 2006 from the École Polytechnique and\r\nthe École Normale Supérieure of Cachan, in France, with a\r\nmathematical expertise in themes such as semi-algebraic geometry,\r\nfunctional analysis, and some good knowledge of statistics and\r\nstochastic processes. I was subsequently employed at Partners\r\nGroup, in Switzerland, as a quantitative analyst, to work on the\r\nrisk management process for their product line of hedge fund\r\nportfolios. After an academic parenthesis, I then moved to Paris\r\nto work in a quantitative hedge fund in startup mode willing to\r\ninvest some of their energy with functional languages. My current\r\njob title, research engineer, is somewhat akin, in english\r\nterminology, to a quantitative analyst or quantitative developer\r\nposition, and I am currently involved in the development of an\r\nautomated trading system.\r\n\r\n      My knowledge of computer science, and more specifically of\r\nObjective Caml, comes mainly from my exposure to Linux systems\r\nsince 2001, my personal work with Objective Caml since 2008, and\r\na rather compelling drive to dive into low-level details. I have\r\nfocused my open-source work on Debian packaging, and language\r\nbindings, such as an embedding of the R interpreter into\r\nObjective Caml, which has been released in February 2010, and I\r\nhave work-in-progress bindings for Ocaml-Python, with a Camlp4\r\nsyntax extension. An OCaml-Java binding is also in progress, but\r\nmuch more rudimentary. In the scope of this personal work, I''ve\r\ncome to deal with issues on assembly level, and I''ve dabbled in\r\nOS programming on CPU level. .NET, however, is something I''m\r\nrather unfamiliar with.\r\n\r\n      My interest in the advertised position is underpinned by the\r\nperspective of applying functional programming in a financial\r\nsetting, which is something of interest to me. The exact scope of\r\nthe development work involved in this position is yet somewhat\r\nimprecise, though it seems to be focused on derivatives pricing\r\nand financial risk management. I''d appreciate knowing more about\r\nthe position details, and I therefore remain at your disposal for\r\nany future enquiries you''d see fit.\r\n\r\nYours Faithfully,\r\n\r\nGuillaume Yziquel.'),
(67, 45, 6, '0', 'yziquel'),
