(78, 48, 5, '0', 'Hi there,\r\nI was wondering: is this site still active. It might be good to add posting dates to the job-offers.\r\n\r\nWe posted a job today, and it seemed to come thourgh but we did have multiple error messages (memory problems) when posting a job for Maximonster. Now it seems to have been added to a que, despite the errors.\r\n\r\nGreat that a site like this exists!\r\n\r\nregards, Michiel Klonhammer'),
