(67, 49, 3, '0', 'Catenacci@Ieee.Org'),
(67, 49, 2, '0', 'Hi Syed,\r\n\r\nI was wondering about the F# development position you posted on both cs.hubfs.net and here on cufp.org.\r\n\r\nIs there any possibility that you might be willing to let someone work via telecommuting?  I wouldn''t waste your time by sending a CV if telecommuting isn''t an option.  I''m in Michigan.\r\n\r\n--\r\nOnorio Catenacci'),
