(67, 56, 2, '0', 'Hello, \r\n\r\nI would like to apply for this position, as I am interested both in web programming and Haskell. My CV follows.\r\n\r\nWith best regards, \r\n  pierre\r\n\r\n---\r\n\r\nPeter Kovaliov, born 1990.\r\n\r\nEducation:\r\n\r\n2008 -- finished Phys-Math Lyceum N30\r\n2008 till now -- St. Petersburg State University, faculty of\r\nMathematics & Mechanics\r\n\r\nWork:\r\n\r\n2006-2007     -- portal-credo.ru, webmaster\r\n2009 till now -- OOO "Novij Marketing", QA Lead Developer\r\n\r\nAwards:\r\n\r\n2007 -- Baltic Intel Science & Engineering Fair, Main prize\r\n\r\nLanguages: fluent English, native Russian, basic French.\r\n\r\nSkills:\r\n\r\nHaskell, K, C, OCaml, Ruby, Common Lisp, Scheme, JavaScript, a bit of C++, Erlang,\r\n(X)HTML/CSS/...\r\n\r\nBio:\r\n\r\nIn 2007 I became interested in Haskell, which continues to be one of\r\nthe areas of my expertise. Around that time I was intrigued by web\r\nprogramming technologies, so I wrote a simple DSL interpreter in\r\nHaskell which wrapped databases in AJAXified interfaces -- thus it\r\nallowed me to build simple dynamic websites with purely static xhtml\r\nfrontend, using JS and XSLT for UI and templating.\r\n\r\nAfter that I wrote a simple refactoring engine for Java; \r\nit used an experimental EDSL to define refactorings \r\ninteractively, being able to perform basic automatic\r\nrefactoring tasks like "move to superclass" and "rename variable".\r\nLater I participated in development of Haskell XMPP \r\nclient library, which is used by russian Haskell community''s \r\nlambdabot. (http://breds.ru/haskell-xmpp/)\r\n\r\nRecently I became fascinated by K programming language.\r\nMy current project is a web-based semi-automatic testing system; \r\nit is used to check XML-based protocol implementations interactively, \r\nthe backend''s prototype is written in K.\r\n\r\nI''m also interested in low-level C programming, in 2009 I took part in \r\nan effort to port OCaml bytecode interpreter to bare hardware\r\n(precisely, u-boot platform --\r\nhttp://git.denx.de/?p=u-boot/u-boot-ocaml.git)\r\n\r\nI also have some experience with Erlang and Common Lisp, but it is mostly \r\nlimited to educational projects. I am amazed by Erlang''s simplicity and I \r\nwould like to study its culture in-depth.\r\n'),
