(67, 65, 2, '0', 'Hi,\r\n\r\nI''m a developer from Ukraine with a 6 years experience in commercial development in various areas. My main languages of use are C++, Tcl and Haskell. Last three years I have been working in the embedded automative development for the Harman/Becker via outstaff from Luxoft. I''m very interested in algebraic programming and various categorical stuff (e.g. I can tell you the difference between Monad and MonadPlus in monoidal sense) as well as in the smart high-performance pure functional data structures and algorithms (I''m a big fan of the finger trees and Okasaki''s book). I''m looking for a remote job opportunity mostly, but anyway I''m very interested in any possibility of production-level functional development. Below you may find my shelfari profile with books I''ve read, as well as my micro-blog at juick.com (mostly in russian, but most links of interest are to the english posts). All hail to the warm fuzzy monads.\r\n\r\nhttp://www.shelfari.com/jtootf\r\nhttp://juick.com/jtootf/\r\n\r\nRegards,\r\n  Paul Sujkov'),
