(67, 69, 2, '0', 'Hi,\r\n\r\nMy name is Petter Bergman and I''m writing you from Malmö, south of Sweden. Is this position still available? I''m currently employed but are looking to start my own business working with Haskell and this type of opportunity would be a great start. I have a Msc in Computer Science and ~3 years experience working with software in mobile communications. In my spare time I have developed a booking system in Haskell which has been live now for about one year. It''s not type-system wizardry or anything, but nevertheless it shows that haskell can be used for this type of project, and be very effective as well.\r\n\r\nAnyway, hope to hear from you!\r\n\r\n/Petter Bergman'),
