(67, 70, 3, '0', 'ulissesmonhecosta@gmail.com'),
(67, 70, 2, '0', 'Hello,\r\n\r\nLet me introduce my academic and working experience.\r\n\r\nI just finish last month my internship at Cisco Systems, Inc. in California, I was there an software engineer and my main duties were the development of testcases, development of scripts to run test cases and test automation.\r\nThe tests I did were mostly written in Tcl language and were aimed to testing a new feature of the Cisco routers operating system - IOS. We use there test methodologies and in fact sometimes I used one model checker to generate the good properties about my testing subject. I also developed there  APIs to help automation of test and implementation of testcases.\r\nI also learned a lot on how to generate L2 to L7 traffic ( close to real and statefull network traffic). From a general point of view was a large project that left the team very happy. Still did a few more small projects related to safety and automation of known issues in some more features of the IOS.\r\n\r\nBefore this internship I was doing a masters degree in Formal Methods and Cryptography in the University of Minho, Portugal. I have done 30 credits in Formal Methods and did 20 credits in Cryptography. I confess that I realized that I like most of the area of security that cryptography itself. I did some interesting projects related to the security area of operating systems, including honeypots and C compiler related security aspect. With regard to Formal Methods earned very methodologies of software development, particularly as regards the production and careful analysis of critical software.\r\nI learned a lot about modeling (model checking), testing and verification. I am fully aware that software proving is a lengthy process and that for most projects in software engineering does not pay, but go through this learning has given me very comfortable with the careful production methods and according to good software.\r\nHere also gained knowledge in test frameworks for Java and Haskell.\r\nDuring the year that was doing the Masters was also research fellow at the University of Minho, in the Distributed Systems Group, where I made an application able to draw maps of network services in a distributed system in order to get a sense of system as a whole is behaving from the network level to the level of the processes that are consuming more resources on each machine.\r\nI used to snort, as a tool for obtaining data and also C and Haskell for implementing the solution. This was not a project purely for Distributed Systems, but very upset for statistical analysis and data network.\r\n\r\nAcademically, during the period of my degree I was still connected to several national and international projects. One of the most interesting was the IBM DB2 student ambassador, where I gained strong knowledge of the database engine from IBM (DB2), XML, XPath and XQuery. This group also participated as a translator of the book "Getting Started with DB2 Express-C" for Portuguese and yet I have co-authored the book "Getting Started with Open Source Development" which was published for a few months.\r\nEven during the academic was an active member of a support group for Open Source at the Department of Informatics, University of Minho, where the group performed the tasks in Linux administrator and vice president of the group. In the year I was vice president implemented the largest Portuguese open source mirror, which continues until today.\r\n\r\nAs an engineer, I consider myself a high spirit of observation and with good ability to solve problems. Working long periods of time has not significant impact on my performance, I am a goal oriented person and I try to solve problems always with good quality standards. Fast technology or method learner.\r\n\r\nFor now I want to gain more experience in software development, specially in functional languages and applying all the knowledge I learned so far to good pieces of software that we can say: "quality inside". Maybe in a couple of years I will finish my masters, but for now I think I have all the knowledge to began a good career. Of course I am aware that I have a lot more to learn, and I want to be part of a professional and intelligent team to learn more and grow faster as a team player.\r\n\r\nBest Regards,\r\n\r\n-- \r\nUlisses Araújo Costa'),
