(78, 79, 5, '0', 'Hi\r\n\r\nI work for Erlang Solutions and there is a conference in Stockholm that may be of interest to CUFP''s. I have included the details below. Please do let me know if you require anything else. It would be great to get this event out to the wider community.\r\n\r\nThanks\r\nJodie\r\n\r\nTalks and Speakers now announced!\r\n\r\nThe speakers and talks have been finalised for the Erlang User Conference. With talks from Motorola, Google, Basho, Gemini Mobile and many more, this year''s conference is packed full of exciting talks, with great speakers such as Simon Thompson, Kenneth Lundin, Tino Breddin and Joseph Wayne Norton. You can find all the speakers and talks here. <http://www.erlang-factory.com/conference/ErlangUserConference2010/speakers>\r\n\r\nRegistration for the Sixteenth International Erlang User Conference and Erlang University courses are now open. Register now and you will receive a Early Bird Discount and pay only SEK 1000 including VAT! DON’T MISS OUT as last year''s conference sold out, register now! <https://www.erlang-factory.com/conference/ErlangUserConference2010/register>\r\n\r\nThe Sixteenth International Erlang User Conference will take place in Stockholm, on the 16th November 2010.\r\n\r\nThe conference is aimed at:  INSERT INTO `webform_submitted_data` (`nid`, `sid`, `cid`, `no`, `data`) VALUES
