(67, 103, 2, '0', 'Syed,\r\n\r\nI am a professional Objective Caml developer, F# being Microsoft''s reimplementation of Objective Caml for the CLR platform. I have 8 years of experience in functional programming with type inference and parametric polymorphism. I currently work as a senior software engineer and informally as a project leader at MyLife.com, one of the larger functional programming shops in the US. I hold an MS in Finance and Banking, and thus, beyond knowing the technology, I understand the terminology of finance and am able to communicate effectively with quants. I have actually had a consulting role in the past (late 2009-early 2010) as a quantitative programmer in Objective Caml for a team of quants in Paris called Lexifi. I am very interested by computational finance, and would love to go back to programming quantitative algorithms and models for investment banks. I am definitely the right man for the job.\r\n\r\nI currently live in the US, but would love to move back to Europe. I am an EU citizen, so immigration is a non-issue.\r\n\r\nPlease, check out my resumé, which you can find at http://alex.baretta.com/. You can call me back any time on my US phone number (+1-650-210-6554).\r\n\r\nCheers,\r\n\r\nAlex Baretta'),
