(67, 117, 2, '0', 'Ashish,\r\n\r\nI''m writing to inquire about the Functional Programming job at NYU.  My background is available in my profile, but the relevant details are that I am a recent Physics PhD with a background in scientific programming and a very good understanding of functional programming.  My relevant strengths for this position are that my research furnished me with experience in data analysis and visualization, and a deep interest in functional programming has lead me into intense bouts of self-education in the subject.\r\n\r\nMy experience with OCaml is limited to a few trinket neural models during the planning phase of my research (I settled on C and NEURON for modeling) but I''m very comfortable with functional programming in Scheme (and other lisp dialects) and reasonably comfortable with static typing (one of my areas of interest is converting idioms in Haskell and ML-like languages into Scheme - so I read a fair amount of statically typed code).  For what it is worth, The Caml Hump is on my blog feed list.\r\n\r\nPlease see my blog at dorophone.blogspot.com.  Much of the recent content covers functional programming.\r\n\r\nIn the interest of full disclosure, I''m not much of a software engineer - I''ve certainly developed large codebases for scientific tasks, but this kind of programming is very different than writing code for many users.  I''m sure that I could develop the appropriate skills, but it would be a learning situation for me.  However, much post-grad self reflection has lead me to believe a transition into scientific programming is in my future, and I''d love the opportunity to cut my teeth in the kind of environment you are offering.\r\n\r\nHope to hear from you soon,\r\n-Vincent'),
(67, 117, 6, '0', 'vtoups'),
