(78, 121, 5, '0', 'Dear Sir,\r\n\r\nThis is a proposal to give a CUFP talk about Sim-Diasca (http://www.sim-diasca.com), a large-scale concurrent (parallel and distributed) discrete simulation engine we designed for industrial needs, and implemented in Erlang.\r\n\r\nThis would be a 25 minute long experience report, explaining why and how we used a functional approach to do so, and what were its benefits and shortcomings.\r\n\r\nWe had submitted a related experience report to ICFP, but they strongly advised us to give a CUFP talk instead.\r\n\r\nI will be out of the office until Wednesday, June 22, but I can then send this article, to give you a better view of what are the topics that this talk would tackle.\r\n\r\nThanks for any feedback about interest and relevance of this talk,\r\nBest regards,\r\n\r\nOlivier Boudeville.\r\n'),
(67, 122, 4, '0', 'Mark'),
