(67, 122, 3, '0', 'markhamstra@gmail.com'),
(67, 122, 2, '0', 'William,\r\n\r\nI recently came across your CUFP jobs posting regarding an Ocaml programming position at Be Sport.  Since the position you describe looks to be very much the kind of job I am looking for, I am taking the time to contact you as requested.  I''m not sure just what you are looking for in a first contact, so please bear with me as I give you a brief, informal rundown of my experience and qualifications, and I''ll rely upon you to inform me of further steps to take.\r\n\r\nAfter doing my undergraduate work in mathematics, I became interested and involved in architecture (actual buildings, not software/systems architecture.)  I did a research fellowship at the American Center of Oriental Research in Amman, Jordan, where I studied the transition from Classical to Islamic architecture in the Levant and also provided technical support for the various archaeology teams that rotated through ACOR.  From there I moved on to doing IT support and CAD software customization for architectural and engineering firms with the intent of eventually pursuing a M.Arch degree and becoming an architect.\r\n\r\nInstead, I ended up working as a software engineer for Bentley Systems, the developers of the MicroStation CAD platform.  I did a wide variety of software development work while at Bentley (principally in C, but also some Java), including porting MicroStation to Linux, working on the 1.0 team for what was essentially a CAD-oriented document and application web-server, and ending my years\r\nat Bentley working on the TriForma 3D architectural modeling application (since evolved and renamed to Bentley Architecture -- http://www.bentley.com/en-US/Products/Bentley+Architecture/).  I also was working essentially another full-time-equivalent position covering in for inadequacies in Bentley''s IT systems planning and management during a time of rapid growth.\r\n\r\nAfter several years I left Bentley with the intention of taking a position with a major architectural firm that was one of the key TriForma users.  Unfortunately, because of prior hiring agreements between Bentley and NBBJ, a formal offer on that position couldn''t be made until after I had actually left Bentley, and in the event I wasn''t able to turn an informal understanding into a final agreement with NBBJ.  Instead, I became involved over the next several years in a couple of independent, start-up software development efforts -- one in which I was the principal developer, working to turn the OpenCASCADE CAD/Solid Modeling libraries (C++) into an open source architectural CAD application; the other I can''t tell you much about because of interests that are still protected by a pretty strict\r\nnon-disclosure agreement, but the effort was essentially in the social networking space and implemented in Java.  Neither one of these efforts ended up being successful (to date, at least), and became deeply frustrated with software development and instead did full-time childcare and domestic duties for a couple of years.\r\n\r\nLooking to get back into software and facing HR managers skeptical of my lack of formal CS education, I began pursuing an MCS degree at the University of Illinois Urbana-Champaign.  In that process I became intrigued with alternative language/DSL approaches to problems that are difficult or inelegant to address in C or Java style imperative languages, and also with the multi-core problem.    My CS421 course on compilers and languages (taught in OCaml) was the first serious work I had done in functional programming, having previously only dabbled some in Emacs lisp and Python''s lambda expressions.  I took a couple of semesters off in the middle of my studies just so that I could intensively explore the various available language options with which to address the looming concurrency demands of programming in an increasingly multi-core environment.  My emphasis was on functional programming and immutable data, so even though I spent some time improving my object oriented skills by learning Smalltalk, I spent much more time looking into Erlang, Scala, Haskell, and Clojure (as well as deeper into Ocaml.)  I eventually ended up settling on Clojure because I felt that it provided the best concurrency semantics, and I subsequently did two semester-long projects in Clojure when I returned to my studies at UIUC.  I''ve already completed 4/3 of the course work to satisfy the MCS degree requirements (see summary at the end of this post), but I haven''t actually received my degree yet because I missed an administrative deadline while distracted with far more pressing concerns -- my father recently died of cancer, and while helping my mother care for him at home over the last months of his life, dealing with memorial services, the aftermath of his death, etc. I missed the filing deadline for graduation application.\r\n\r\nOf late, I have swung back to working with OCaml, since I really want to do functional programming instead of going back into the Java world, and functional programming job prospects look better to my eye in OCaml than in other options.  I''m quite comfortable programming in OCaml now, and have been working of late on datamining with OCaml, including an implementation of Classification based on Predictive Association Rules\r\n(http://www.cs.uiuc.edu/homes/hanj/pdf/sdm03_cpar.pdf).\r\n\r\nAs for Ocsigen, I haven''t gotten much further than working through the Eliom Programmer''s Guide/Tutorial.  But having done previous work with web frameworks, including Lift and Seaside, Eliom makes good sense to me immediately, and I am confident that I can rapidly develop fluency in it and the rest of the Ocsigen stack.  I''ve also been carefully following developments in multithreaded libraries/extensions for Ocaml (Netmulticore, Jocaml, Functory, OCamlPro, etc.), and am eager to work at applying one or more of these to Be Sport''s scalability concerns. \r\n\r\nI believe that that is more than enough to give you a sense of who I am and what my qualifications are.  In closing, let me reaffirm that I would very much like to work with you at Be Sport, and I am looking forward to your reply.\r\n\r\n\r\nMark Hamstra\r\n\r\n\r\n\r\n\r\n===================== UIUC coursework summary ==================\r\n\r\n[course, credit hours, grade]\r\n\r\nCS421 Programming Languages and Compilers 4 A+\r\nMATH461 Probability Theory 3 A\r\nCS411 Database Systems 4 A+\r\nCS412 Introduction to Datamining 3 A\r\nCS511 Advanced Database Systems 4 A\r\nCS425 Distributed Systems 4 A-\r\nCS473 Algorithms 4 A-\r\nCS433 Computer Systems Organization  4 A-\r\nCS423 Operating Systems Design 4 B-\r\nCS527 Advanced Topics in Software Engineering (Testing) 4 A-\r\nCS598 Object Oriented Programming and Design 4 A\r\nENG460 Entrepreneurship for Engineers 1 B+\r\nENG466 High-Tech Venture Marketing 2 A\r\nENG565 Technology Innovation and Strategy 2 A\r\nENG566 Finance for Engineering Management 2 B+'),
(67, 122, 6, '0', 'Mark Hamstra'),
