(67, 124, 2, '0', 'Hi William,\r\n\r\nI just came across CUFP,org and learned that you are looking for OCaml programmers.\r\n\r\nBeing a long time functional programming aficionado, here I would like to discuss this position with you. Here is a brief introduction of myself:\r\n\r\nIf there is one book that made the most change of my life, it is definitely the classical SICP (Structure and Interpretation of Computer Programs). I read it on my own as a senior college student major in CS and mathematics. It contains such a deep understanding of the field, while just being the length of a normal book. The wizard book turned me into a Schemer. Then I picked EoPL (Essentials of Programming Languages) and TSPL (The Scheme Programming Language) to master the language, and later on read papers about Scheme and functional programming in general. By chance, I was given the task to translate another Scheme book HtDP(How to Design Programs) into Chinese. This eventually led me to US and join the PLT Scheme (now known as Racket) team as a grad student. During my years at University of Utah, I have worked on an ML to Scheme compiler, SRFIs (Scheme Requests for Implementation), R6RS (The Revised6 Report on the Algorithmic Language Scheme), and some HOL theorem proving. After graduating, I joined Wolfram Research to work on Mathematica, another functional/multi-paradigm programming language. In conclusion, I''m a well trained functional programmer with a key insight on how to design programs, and also have a good interest and understanding of science in general.\r\n\r\nGiven all mentioned above, I believe I''m a decent candidate for your position. Hope to hear back from you soon.\r\n\r\nSincerely,\r\nChongkai'),
