(67, 133, 2, '0', 'Hello Mr.Wood,\r\n\r\nI saw your post on CUFP.\r\n\r\nActually I''am looking for an opportunity to work\r\nin Functional Programming.\r\n\r\nUnfortunately, I''am not architect. Do you have some opportunity for a functional developer (Haskell)?\r\n\r\nThank you\r\n\r\nLoïc '),
(67, 133, 6, '0', 'Loïc'),
(78, 134, 1, '0', 'Duncan'),
(78, 134, 2, '0', 'Coutts'),
(78, 134, 3, '0', 'duncan@well-typed.com'),
(78, 134, 4, '0', 'john@gavuladesign.com.com'),
(78, 134, 5, '0', 'A client of mine was asking me how to register for CUFP. I notice that there is currently no link from the conference page http://cufp.org/conference to the registration page, but it looks like ICFP registration is now open: http://www.icfpconference.org/icfp2011/\r\n\r\nOn last year''s conference page (http://cufp.org/conference/2010) there was a clear link "Registration is now available [here]." Could this be added again for this year please.\r\n\r\nThanks!'),
(67, 135, 4, '0', ''),
(67, 135, 5, '0', ''),
(67, 135, 3, '0', 'gloria.1579@gmail.com'),
(67, 135, 2, '0', 'http://www.austinaquaflow.com/Lighting.html'),
(67, 135, 6, '0', 'Glory25S'),
(67, 136, 4, '0', 'Eduardo'),
(67, 136, 5, '0', 'Bellani'),
(67, 136, 3, '0', 'ebellani@gmail.com'),
(67, 136, 2, '0', 'Hello Sacco Te Lintel Hekkert.\r\n\r\nWhat drove me to send this message was your paragraph:\r\n\r\n"The ideal candidate has experience with C and Python and is familiar\r\nwith functional programming. Experience with Haskell is certainly a\r\nplus. But rather than developers with experience in specific languages\r\nwe are looking for fast learners with a flexible mindset."\r\n\r\nA place that has this mentality usually attracts interesting people to\r\nwork on interesting things. This is what I am searching in this moment\r\non my career.\r\n\r\nMy current job is as a researcher for a pattern recognition project\r\ninside a somewhat large document processing company. As I have some\r\ndegrees of freedom, all the code I produced for my prototypes where in\r\nCL (SBCL more specifically) and scheme (racket).\r\n\r\nTo keep things simple, here is what I think I can offer you:\r\n\r\n* I can program in multiple paradigms, adapting the computational model\r\n  and concepts to the problem faced.\r\n\r\n* I can communicate clearly and generate professional quality code. My\r\n  ideal work environment involves respect for my colleagues and\r\n  clients, constant feedback, quality control, and a focus on project\r\n  iteration with agile methodologies.\r\n\r\n* I love what I do.\r\n\r\nMy current CV is at my github account[1]. Anything else, please ask.\r\n\r\nEduardo Bellani\r\n\r\n[1] http://github.com/ebellani/Curriculum-Vitae/blob/master/cv.pdf?raw=true\r\n'),
(67, 136, 6, '0', 'Eduardo Bellani'),
(78, 137, 1, '0', 'Simon'),
(78, 137, 2, '0', 'Levy'),
(78, 137, 3, '0', 'levys@wlu.edu'),
(78, 137, 4, '0', 'anil@recoil.org'),
(78, 137, 5, '0', 'I would like to invite Yaron Minsky to give a public lecture to Computer Science and Business Admin students and faculty at Washington & Lee University. I have been unable to find direct contact info for Yaron and so am using this forum. I teach a Programming Language Design course (Friedman, Wand, and Haynes curriculum) that also explores ML and type theory.  We could probably get some additional honorarium funding from our Business Admin program -- a unique opportunity to talk to and recruit top students from different backgrounds.'),
(78, 138, 1, '0', 'Vitaliy'),
(78, 138, 2, '0', 'Liptchinsky'),
(78, 138, 3, '0', 'vitaliy.liptchinsky@bwinparty.com'),
(78, 138, 4, '0', 'anil@recoil.org'),
(78, 138, 5, '0', 'Dear Sir or Madam,\r\n\r\nIs there already information available regarding location and place of the conference in 2012.\r\n\r\nBest regards,\r\nVitaliy Liptchinsky'),
(67, 139, 4, '0', 'Ram'),
(67, 139, 5, '0', 'Gole'),
(67, 139, 3, '0', 'ram.gole@gmail.com'),
(67, 139, 2, '0', 'Dear Sir,\r\n\r\nI am experienced in design and implementation of low latency and high frequency trading system. Past 1 year I have experimented with Erlang; and now believe for these requirements Erlang is best to develop applications. I have more than 7 years experience with web application, desktop applications. I write Firefox addons for my firm during free time.\r\n\r\nPlease consider me for this opportunity and I will not disappoint you.\r\n\r\nThanks and Regards\r\nRam'),
(67, 139, 6, '0', 'Ram'),
(78, 140, 1, '0', 'shravan'),
(78, 140, 2, '0', 'kumar'),
(78, 140, 3, '0', 'shravangulla@rediffmail.com'),
(78, 140, 4, '0', 'anil@recoil.org'),
(78, 140, 5, '0', 'hi\r\niam shravan from india .interested to make career in haskell.\r\nwhat is the skill set required and any good web links???\r\nby the way in which domain they can be used more??????\r\n\r\nfrom\r\nshravan\r\n\r\npl email me  '),
(78, 141, 1, '0', 'John'),
(78, 141, 2, '0', 'Malone'),
(78, 141, 3, '0', 'john.malone@apexrs.com.au'),
(78, 141, 4, '0', 'yminsky@janestreet.com'),
(78, 141, 5, '0', 'Hi Team,\r\n\r\nI am an IT Recruiter and currently have a role with a company of mine in Sydney - where they will be working on a state-of-the-art static analysis tools that will find bugs in C/C++ code at compile time.\r\n\r\nWritten in Ocaml and Haskell or other functional languages.\r\n\r\nI am enquiring in regards to any of your members that might be interested in working/or currently located in Sydney.\r\n\r\nAny help would be greatly appreciated.\r\n\r\n\r\nRegards,\r\n\r\n\r\nJohn\r\n+61415222483'),
(78, 142, 1, '0', 'shravan'),
(78, 142, 2, '0', 'kumar'),
(78, 142, 3, '0', 'shravangulla@rediffmail.com'),
(78, 142, 4, '0', 'anil@recoil.org'),
(78, 142, 5, '0', 'hi\r\n\r\niam at student level,can anyone tell me how is haskell for jobs and career'),
(78, 143, 1, '0', 'shravan'),
(78, 143, 2, '0', 'kumar'),
(78, 143, 3, '0', 'shravangulla@rediffmail.com'),
(78, 143, 4, '0', 'anil@recoil.org'),
(78, 143, 5, '0', 'hi\r\n\r\niam at student level,can anyone tell me how is haskell for jobs and career'),
(78, 144, 1, '0', 'Niall'),
(78, 144, 2, '0', 'Dalton'),
(78, 144, 3, '0', 'nialldalton@mac.com'),
(78, 144, 4, '0', 'anil@recoil.org'),
(78, 144, 5, '0', 'Hello -- I asked Lennart Augustsson about slides from his cufp talk on ''pragmatic haskell'', as I didn''t see them on cufp.org. Lennart also suggested there should be video of the talk somewhere. Can you provide any pointers to these materials?\r\n\r\nThanks\r\nNiall\r\n\r\n\r\nOn Jan 19, 2012, at 3:01 AM, Lennart Augustsson wrote:\r\n\r\nI think I can find those.  There should also be a video. \r\n\r\n  -- Lennart (iPhone)\r\n\r\nOn Jan 19, 2012, at 15:35, Niall Dalton <nialldalton@me.com> wrote:\r\n\r\nHi Lennart,\r\n\r\nI wonder if it''s possible to get a copy of your slides from the "pragmatic haskell" talk from last year''s cufp?\r\n\r\nRegards\r\nNiall\r\n\r\n'),
(78, 145, 1, '0', 'Thandeka'),
(78, 145, 2, '0', 'Racheky'),
(78, 145, 3, '0', 'thandekar@sun.ac.za'),
(78, 145, 4, '0', 'anil@recoil.org'),
(78, 145, 5, '0', 'Dear Sir/Madam\r\n\r\nMy name is Thandeka Racheky from TRAC SA a Technology Research Activity Center and we help students from underprivileged schools  with Science experiments and syllabus content, we enable and encourage them to enter careers in Science, Engineering and Technology. I am working on helping the learners to get bursary application forms and would like to know if you do fund learners and if you do have a bursary form please send me one that will be highly appreciated.\r\n\r\nKind regards\r\nThandeka Racheky\r\n');
