  `changefreq` int(10) unsigned NOT NULL DEFAULT '0',
  `priority` float NOT NULL DEFAULT '0.5',
  PRIMARY KEY (`lid`),
  KEY `link_module` (`module`(25)),
  KEY `link_language` (`language`),
  KEY `link_changed` (`changed`),
  KEY `link_priority` (`priority`),
  KEY `type_id` (`type`,`id`),
  KEY `loc` (`loc`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=5883 ;

